      "contents": "## Crystalluria and urolithiasis guide\n\n### Hill's Calcium oxalate\nMonohydrate\n\n**Crystal identification**\n*   Vary in size and shape; typically 'oval' (top left, underneath calcium oxalate dihydrate crystal, and top right, enlarged)\n*   Sometimes long and pointed (lower left), sometimes dumbbell shaped\n*   Colorless\n\n**Urolith identification**\n*   Most common type of urolith in male dogs\n*   Often round and smooth (top left). Sometimes darkened by blood pigment (top right), rarely have 'jackstone' appearance (lower left)\n*   Radiopaque\n\n### Hill's Struvite\nMagnesium ammonium phosphate\n\n**Crystal identification**\n*   Characteristically colorless, coffin-lid shaped rectangular crystals, of varying sizes\n*   Rarely crystals aggregate on the slide into fern-like structures\n\n**Urolith identification**\n*   Most common type of urolith in female dogs\n*   Characteristically multiple, round or faceted with a smooth surface and creamy to grey in color (top left). May have an irregular surface (top right)\n*   Often contains a proportion of calcium phosphate (e.g. urolith lower left is 80% struvite, 20% calcium phosphate)\n*   Radiopaque"
