      "description": "This page describes Hill's S+OXSHIELD, which reduces the risk of struvite and calcium oxalate stones via three tests: Relative Super-Saturation (RSS), Urine pH, and Hill's Calcium Oxalate Titration (COT).",
      "contents": "## S+OX SHIELD\n\nBroad range of conditions covered\n\nReduces the risk of struvite and calcium oxalate stones\n\n### THE SCIENCE OF S+OXSHIELD\nFoods with the S+OXSHIELD seal meet a nutrition profile with specific ranges for certain nutrients.\n\nThis profile was validated in pets to promote a urinary environment that reduces the risk of developing struvite and calcium oxalate crystals by using three tests:\n\n*   **RELATIVE SUPER-SATURATION (RSS)**\n    Measures urine saturation of key minerals that affect crystal and stone formation\n*   **URINE PH**\n    Measures urine pH, a key aspect of urine that affects the formation of struvite crystals and stones\n*   **HILL'S CALCIUM OXALATE TITRATION (COT)**\n    Measures the likelihood for calcium oxalate to precipitate in urine\n\nMany Prescription Diet foods already have the added benefit of being formulated to promote a urinary environment that reduces the risk of developing struvite and calcium oxalate stones. The S+OXSHIELD seal helps you quickly identify these foods and make it easy to communicate this benefit to clients.\n\nTo learn more about our foods, please talk to your Hill's representative.\n\nProduct list updated as of March 2024.\n\n*Wet products only.\n"
