      "contents": "## Estimated Energy Requirements\n\n## Resting Energy Requirements\n\n| lbs | kg | RER (kcal/day) |\n|---|---|---|\n| 1 | 0.5 | 39 |\n| 2 | 0.9 | 65 |\n| 3 | 1.4 | 88 |\n| 4 | 1.8 | 110 |\n| 5 | 2.3 | 130 |\n| 6 | 2.7 | 149 |\n| 7 | 3.2 | 167 |\n| 8 | 3.6 | 184 |\n| 9 | 4.1 | 201 |\n| 10 | 4.5 | 218 |\n| 11 | 5.0 | 234 |\n| 12 | 5.5 | 250 |\n| 13 | 5.9 | 265 |\n| 14 | 6.4 | 280 |\n| 15 | 6.8 | 295 |\n| 16 | 7.3 | 310 |\n| 17 | 7.7 | 324 |\n| 18 | 8.2 | 339 |\n| 19 | 8.6 | 353 |\n| 20 | 9.1 | 366 |\n| 25 | 11.4 | 433 |\n| 30 | 13.6 | 497 |\n| 35 | 15.9 | 558 |\n| 40 | 18.2 | 616 |\n| 45 | 20.5 | 673 |\n| 50 | 22.7 | 729 |\n| 55 | 25.0 | 783 |\n| 60 | 27.3 | 835 |\n| 65 | 29.5 | 887 |\n| 70 | 31.8 | 938 |\n| 75 | 34.1 | 988 |\n| 80 | 36.4 | 1037 |\n| 85 | 38.6 | 1085 |\n| 90 | 40.9 | 1132 |\n| 95 | 43.2 | 1179 |\n| 100 | 45.5 | 1225 |\n| 105 | 47.7 | 1271 |\n| 110 | 50.0 | 1316 |\n| 115 | 52.3 | 1361 |\n| 120 | 54.5 | 1405 |\n| 125 | 56.8 | 1449 |\n| 130 | 59.1 | 1492 |\n| 135 | 61.4 | 1535 |\n| 140 | 63.6 | 1577 |\n| 145 | 65.9 | 1619 |\n| 150 | 68.2 | 1661 |\n| 155 | 70.5 | 1702 |\n| 160 | 72.7 | 1743 |\n| 165 | 75.0 | 1784 |\n| 170 | 77.3 | 1824 |\n| 175 | 79.5 | 1864 |\n| 180 | 81.8 | 1904 |\n| 185 | 84.1 | 1944 |\n| 190 | 86.4 | 1983 |\n| 195 | 88.6 | 2022 |\n| 200 | 90.9 | 2061 |\n\n\n**Feline**\n\nGrowth DER (kcal/day)\nGrowing kittens = 2.5 \u00d7 RER\n\nMaintenance DER (kcal/day)\nNormal, neutered adult = 1.2 \u00d7 RER\nIntact adult = 1.4 \u00d7 RER\nObese prone = 1.0 \u00d7 RER\nWeight loss = 0.8 \u00d7 RER\n\n**Canine**\n\nGrowth DER (kcal/day)\nUp to four months = 3 x RER\nFour months and older = 2 \u00d7 RER\n\nMaintenance DER (kcal/day)\nAverage, neutered adult = 1.6 \u00d7 RER\nIntact adult = 1.8 \u00d7 RER\nObese prone = 1.4 \u00d7 RER\nWeight loss = 1.0 \u00d7 RER\n\nWork DER (kcal/day)\nLight work = 2 \u00d7 RER\nModerate work = 3 x RER\nHeavy work = 4-8 \u00d7 RER\n\nRER - Resting Energy Requirement represents the energy requirement for a normal animal at rest in a thermoneutral environment and is based on body weight.\n\nDER - Daily Energy Requirement represents the average daily energy expenditure of an animal, dependent on lifestage and activity (work, gestation, lactation and growth)."
