      "description": "This page describes the identification of different urinary crystals and uroliths, including calcium oxalate monohydrate, struvite magnesium ammonium phosphate, and calcium oxalate dihydrate.",
      "contents": "## Crystalluria and urolithiasis guide\n\n### Hill's Calcium oxalate\nMonohydrate\n\nCrystal identification\n*   Vary in size and shape, usually dumbbell (top left) or oval (top right), rarely rectangular with rounded ends (lower left) or spindle-shaped\n*   Colorless (all illustrations also include calcium oxalate dihydrate crystals)\n\nUrolith identification\n*   Very common type of urolith in cats\n*   Characteristically small, smooth and spherical, though may be irregular\n*   Usually tan or brown color\n*   Radiopaque\n*   Renal uroliths very likely to be oxalate\n\n### Hill's Calcium oxalate\nDihydrate\n\nCrystal identification\n*   Vary in size, but always octahedral in shape\n*   Colorless\n*   Appear as 'envelopes', i.e. square with prominent diagonals (which distinguish from struvite crystals)\n\nUrolith identification\n*   Characteristic irregular 'crystalline' appearance (left) or with irregular surface (right). Mixtures of dihydrate and monohydrate often occur (urolith above right is 60% dihydrate, 35% monohydrate)\n*   Usually white or creamy color\n*   Radiopaque\n\n### Hill's Struvite\nMagnesium ammonium phosphate\n\nCrystal identification\n*   Characteristically colorless, coffin-lid shaped rectangular crystals (upper row), shorter than in dogs and often with some square forms (that might be confused with calcium oxalate mono- or dihydrate)\n*   Rarely crystals aggregate on the slide into fern-like structures\n*   Less typical forms (lower row) include hexagonal & octagonal forms (which might be mistaken for cystine) and narrow, pointed crystals. Struvite will dissolve in dilute acetic acid, but cystine won't\n\nUrolith identification\n*   Very common type of urolith in cats. If sterile (>90% of cases) usually appears as an oval wafer or disc (top left), occasionally as a jagged, quartz-like structure. If infected is often egg-shaped (top right). May have surface irregularities (lower left). Lower right shows infection-induced uroliths with 10% calcium phosphate\n*   Usually creamy or light brown color (darkens with prolonged exposure to blood pigment)\n*   Most uroliths occur in the bladder\n*   Radiopaque"
