      "contents": "## Recommended methods for feeding Hill's Prescription Diet a/d Dog & Cat Food\n\n*   For greatest acceptance, ensure food is between room and body temperature (68-104 degrees F); do not feed straight from the refrigerator\n*   Discard any unused portion after 36 hours\n*   When syringe feeding, thoroughly stir the contents of the can before filling the syringe\n*   For tube feeding, blend with 1-2 parts water, or see our recommended dilution guide below.\n*   In patients with reduced gastrointestinal function, a 3 day transitional feeding strategy may be necessary:\n    *   Day 1 - a third of recommended total intake and twice that amount of water;\n    *   Day 2 - two-thirds of recommended total intake and half that amount of water;\n    *   Day 3 - full recommended intake, undiluted.\n\n## Dilution guide for Hill's Prescription Diet a/d Dog & Cat Food\n\n| PRODUCT        | kcal/ml | TUBE SIZE (French) |     |     |     |     |     |\n| :------------- | :------ | :----------------- | :-: | :-: | :-: | :-: | :-: |\n|                |         | 10                 | 12  | 14  | 16  | 18  |\n| Undiluted a/d  | 1.2     | \ud83d\ude1e                 | \ud83d\ude10  | \ud83d\ude10  | \ud83d\ude0a  | \ud83d\ude0a  |\n| + x2 a/d 50ml  | 1       | \ud83d\ude1e                 | \ud83d\ude10  | \ud83d\ude0a  | \ud83d\ude0a  | \ud83d\ude0a  |\n| + x2 a/d 100ml | 0.9     | \ud83d\ude1e                 | \ud83d\ude0a  | \ud83d\ude0a  | \ud83d\ude0a  | \ud83d\ude03  |\n| + x2 a/d 150ml | 0.8     | \ud83d\ude0a                 | \ud83d\ude0a  | \ud83d\ude0a  | \ud83d\ude03  | \ud83d\ude03  |\n\n*   \ud83d\ude1e Not recommended\n*   \ud83d\ude10 Acceptable\n*   \ud83d\ude0a Easy\n*   \ud83d\ude03 Very easy\n"
