      "contents": "## IRIS staging for Feline Kidney Disease\n\nThis page describes the International Renal Interest Society (IRIS) staging for feline kidney disease, with recommendations for Hill's Prescription Diet k/d.  It also mentions considering Hill's Prescription Diet k/d + j/d for cats with concurrent degenerative joint disease.\n\n### IRIS Stage I\n*   IDEXX literature indicates that SDMA can detect 25%-40% loss of kidney function\n*   Many patients with IRIS stage 1 CKD are asymptomatic\n\nFeed Hill's Prescription Diet k/d Early Support or Hill's Prescription Diet k/d or Hill's Prescription Diet k/d + j/d Cat Food\n\n### IRIS Stage II or III\n*   More than 75% of functional nephrons have been lost\n*   Characterized by azotemia and other signs such as PU/PD, lethargy, inappetence, vomiting and weight loss as disease progresses\n\nFeed Hill's Prescription Diet k/d or Hill's Prescription Diet k/d + j/d Cat Food\n\n### IRIS Stage IV\n*   More than 90% of nephrons have been lost\n*   Excessive retention of metabolic waste products\n*   Uremic syndrome signs (vomiting, diarrhea, oral ulcerations, depression) occur as disease advances\n\nFeed Hill's Prescription Diet k/d or Hill's Prescription Diet k/d + j/d Cat Food\n\n### IRIS Staging Table\n\n|             | Stage I: \u2264 100% | Stage II: \u2264 33% | Stage III: \u2264 25% | Stage IV: < 10% |\n| :---------- | :-------------- | :--------------- | :---------------- | :-------------- |\n| Azotemia    | None            | Mild renal       | Moderate renal    | Severe renal    |\n| Plasma Creatinine (mg/dl) | < 1.6           | 1.6-2.8          | 2.9-5.0         | \u2265 5.0         |\n| SDMA (\u00b5g/dL)  | \u2264 18            | 18-25            | 26-38           | \u2265 38            |\n\nSub-staging based on proteinuria (UPC) and blood pressure\n\nFull IRIS staging guidelines: http://iris-kidney.com/guidelines/staging.html\nLevels apply to average size cats measured when patient is fasted and well-hydrated.\nPersistently elevated blood SDMA concentration (>14ug/dl) may be used to diagnose early CKD.\n\n### Concurrent Degenerative Joint Disease\nEVIDENCE OR RISK OF DEGENERATIVE JOINT DISEASE:\nFeed Hill's Prescription Diet k/d + j/d Cat Food"
