      "contents": "Question | Rationale | Action\n---|---|---\nDescribe how your cat spends his or her day. | Evaluate access to outside and other sources of food. Cats with unsupervised access outdoors may be ingesting other foods. | Consider confining cats indoors for 1 month and then assess effectiveness of nutritional management.\nHow many other pets are in your house? | Evaluate access to other pets' food (dogs, cats, birds, 'pocket pets', etc). | Remove all food after feeding or confine the hyperthyroid cat to areas without access to other pets' food and reassess after 1 month.\nWhat is your cat's favorite food or treat? | This is a nonthreatening way of determining if the cat is being offered treats or other food. Many owners don't consider people food or treats as part of the 'diet' or they may not mention them. | Reinforce that Hill's Prescription Diet y/d Cat Food must be the sole source of nutrition. Some high-iodine foods include dairy products, egg yolks, seafood, dried fruit, canned vegetables, cured meats, fresh chicken or turkey (with broth or additives injected), soy products, seaweed products (carrageen, alginate), and red dye #3 or E 127 erythrosine (found in many foods/pills that are red or brown color). Additional dietary iodine information is available on websites about human thyroid health.\nWhat are you feeding your cat? | Evaluate what foods are being offered and ask questions to determine what other foods are accessible to the patient. | Reinforce that Hill's Prescription Diet y/d Cat Food must be the sole source of nutrition. See above for a list of common foods and ingredients that may be high in iodine.\nHow are you feeding your cat? | Allow owners to describe how they store, prepare and serve the food. Contamination with iodine can occur if Hill's y/d Feline is decanted and stored in containers or is served in bowls not thoroughly cleaned that have previously been used for other foods. | Recommend storing Hill's Prescription Diet y/d Cat Food in the original bag or can. If food is decanted into a storage container, it should be new or thoroughly cleaned (dishwasher). Likewise, the bowl/serving dish should be new or thoroughly cleaned and used exclusively for Hill's Prescription Diet y/d Cat Food.\nWhat medications or supplements are you giving your cat? | Allow owners to describe all medications and supplements. | Flavored or artificially colored medications or supplements, supplements with fish or shell fish ingredients, and liquids used by compounding pharmacies can be sources of iodine.\nWho feeds your cat? | Evaluate the possibility that other members of the family are inadvertently contaminating the feeding dish or giving other foods. | Designate one person in the household to be responsible for feeding the hyperthyroid cat and cleaning the feeding dishes.\nDo you have children living at home? | It's possible for cats to consume foods dropped on the floor, left on counters or offered as treats (when parents aren't watching). | Reinforce that Hill's Prescription Diet y/d Cat Food must be the sole source of nutrition. See above for a list of common foods and ingredients that are high in iodine.\nWhat is the cat's water source? | Most municipal water sources contain minute amounts of iodine; however, other sources (e.g., well water, ponds) may contain more. | Consider switching to distilled water for 1 month and then re-evaluate effectiveness of nutritional management."
