      "contents": "Managing hyperthyroidism in cats using nutritional management.\n\nBaseline Evaluation:\n1. Confirm Hyperthyroidism.\n2. Physical examination (body weight, ophthalmic evaluation, blood pressure).\n\n3. Begin transition to Hill's Prescription Diet y/d Thyroid Care Cat Food.  If switching from anti-thyroid medication, discontinue medication first.\n\n4. Most cats transition to the food over 7 days; some may need longer (several weeks).\n\n5. Some cats may experience a transient increase in T4 which resolves once the cat has been eating Hill's Prescription Diet y/d Cat Food as the sole source of nutrition for 1-2 months.\n\n6. Initial rechecks: physical exam, T4, BUN, serum creatinine, urine specific gravity.\n\n7. Recheck 4 and 8 weeks after transition to Hill's Prescription Diet y/d Cat Food. Serum T4 should be within range in most cats by 4-12 weeks.\n\n8. Long-term rechecks: physical exam, T4, CBC, serum chemistries, urinalysis.\n\n9. Recheck every 6 months indefinitely."
