      "description": "This page contains product information, sizes, and recommended/not recommended uses for Hill's Prescription Diet i/d Low Fat Dog Food.",
      "contents": "## Hill's Prescription Diet i/d Low Fat Dog Food\n\nHill's Prescription Diet i/d Low Fat Dry Dog Food is great tasting, low fat nutrition clinically tested to help manage complex fat-responsive disorders such as pancreatitis and hyperlipidemia. This highly digestible formula also supports easy nutrient absorption. Fortified with Hill's breakthrough ActivBiome+ ingredient technology clinically shown to rapidly activate the gut microbiome to support digestive health and well-being.\n\n**Flavors and Sizes Available:**\n\n| Food | Flavour | Sizes Available |\n|---|---|---|\n| Dry | Chicken Flavor | 8.5 LB, 17.6 LB, 27.5 LB |\n| Wet | Original Flavor | 13 OZ |\n| Wet | Rice, Vegetable and Chicken Stew | 5.5 OZ, 12.5 OZ |\n\n**Recommended for:**\n\n*   Primary Indications:\n    *   Pancreatitis\n    *   Hyperlipidemia\n    *   Exocrine pancreatic insufficiency (EPI)\n    *   Protein losing enteropathy (PLE) with lymphangiectasia\n    *   Cushing's syndrome\n    *   Diabetes with hyperlipidemia or pancreatitis\n*   Other Indications:\n    *   Acute gastroenteritis (diarrhea or vomiting)\n    *   Esophageal disorders\n    *   Gastritis (acute or chronic)\n    *   Flatulence\n    *   Forms of chronic enteropathy (inflammatory bowel disease): Antibiotic responsive, Steroid responsive, Food responsive\n    *   Recovery from gastrointestinal surgery\n    *   Stress colitis\n\n**Not recommended for:**\n\n*   Growing puppies, pregnant or nursing dogs\n\n**Evidence-Based Clinical Nutrition:**\n\n*   Low fat nutrition shown to decrease fasting serum triglycerides in hyperlipidemic dogs."
