      "description": "This page describes Hill's Prescription Diet i/d Stress Dog Food, including its indications, flavors, sizes, and key features.",
      "contents": "## Hill's Prescription Diet i/d Stress Dog Food\n\nHill's Prescription Diet i/d Stress Dry Dog Food is specially formulated clinical nutrition to help manage stress & stress-related Gl upsets in small and medium breed dogs. Fortified with Hill's breakthrough ActivBiome+ ingredient technology clinically shown to rapidly activate the gut microbiome to support digestive health and well-being.\n\n**FOOD** | **FLAVOUR** | **SIZES AVAILABLE**\n---|---|---\n[Dry Food Image] | Chicken Flavor | 8 LB, 14.33 LB\n[Stew Image] | Rice, Vegetable & Chicken Stew | 5.5 OZ\n\n**Recommended for:**\n\n*   Primary Indication: Stress Colitis in dogs less than 14 kg (30 lb)\n*   Other Indications:\n    *   Acute gastroenteritis (diarrhea or vomiting)\n    *   Colitis (acute or chronic)\n    *   Cushing's syndrome\n    *   Diabetes with hyperlipidemia or pancreatitis\n    *   Esophageal disorders\n    *   Exocrine pancreatic insufficiency (EPI)\n    *   Flatulence\n    *   Gastritis (acute or chronic)\n    *   Hyperlipidemia\n    *   Pancreatitis\n    *   Protein losing enteropathy (PLE) with lymphangiectasia\n\n**Not recommended for:**\n\n*   Growing puppies, pregnant or nursing dogs\n\n**Evidence-Based Clinical Nutrition:**\n\n*   Alpha-casozepine was efficient to decrease anxiety in dogs with anxiety-related behavioral complaint.\n*   Behavioral observations evidenced some signs of improvement in anxious dogs fed food with casein hydrolysate. Plasma cortisol level significantly decreased in anxious dogs fed with casein hydrolysate food.\u00b2\n\n**Additional information:**\n\n*   Hill's Prescription Diet i/d Stress Dry Dog Food provides all the nutrition your patient needs during episodes of stress-related Gl upset and can be used long-term. If a stressful event is foreseeable, it is recommended to start feeding in advance.\n\nIngredients, nutrient profiles, and citations are located at the end of this section.\n\nS+OX SHIELD: Reduces the risk of developing struvite and oxalate stones\n\n*Kibble is not shown at actual size. Colors may vary from photograph.*"
