      "contents": "## Hill's Prescription Diet Metabolic Dog Food\n\nClinically proven to help dogs quickly and naturally lose weight by activating their unique metabolism.\n\n**Recommended for:**\n*   Weight loss\n*   Weight maintenance (obese-prone or post weight loss)\n*   Diabetes in obese dogs\n*   Hypothyroidism\n*   Cushing's syndrome\n*   Diabetes in normal weight or mildly overweight dogs\n\n**Not recommended for:**\n*   Growing puppies, pregnant or nursing dogs\n\n**Evidence-Based Clinical Nutrition:**\n*   Clinically proven to reduce body weight by 13% in 2 months'\n*   The nutrition of Metabolic is clinically proven to work with each dog's unique metabolic response activating the body's natural ability to burn excess body fat and affect calorie utilization.2\n*   In an in-home feeding study 96% of pets experienced weight loss within 2 months.\n\n**Flavors and Sizes Available:**\n\n| Flavor                        | Sizes Available                                   |\n| ----------------------------- | ------------------------------------------------- |\n| Chicken Flavor                | 7.7 LB, 17.6 LB, 27.5 LB, 13 OZ                       |\n| Lamb Meal & Rice Formula      | 6 LB, 17.6 LB                                    |\n| Vegetable & Chicken Stew      | 12.5 OZ                                           |\n| Vegetable & Beef Stew         | 12.5 OZ                                           |\n| Vegetables, Beef & Rice Stew  | 2.8 OZ                                            |\n| Vegetables, Rice & Chicken Stew | 2.8 OZ                                            |\n"
