      "description": "This page describes Hill's Prescription Diet Metabolic Dog Food and related products for weight management.",
      "contents": "## Hill's Prescription Diet Metabolic Dog Food\n\nMaintains effective and safe rate of up to 1-2% body weight loss weekly during weight loss period.\n\n**Additional information:**\nHill's Prescription Diet Metabolic has a complete portfolio of dry food, canned food, and treats. They are designed to work together to ensure safe and healthy weight loss and easy weight maintenance. Advanced weight management nutrition appropriate for multi-dog households.\n\n**Other products to consider:**\n*   For patients with obesity, including those with diabetes: Hill's Prescription Diet Metabolic Weight + j/d Dog Food, Hill's Prescription Diet c/d Multicare + Metabolic Weight Dog Food, Hill's Prescription Diet r/d Dog Food\n*   For patients requiring a weight maintenance food (obese-prone or post weight loss) or with diabetes at a normal weight or mildly overweight: Hill's Prescription Diet Metabolic Weight + j/d Dog Food, Hill's Prescription Diet c/d Multicare + Metabolic Weight Dog Food, Hill's Prescription Diet w/d Multi-Benefit Dog Food\n*   For patients with Cushing's syndrome: Hill's Prescription Diet i/d Dog Food, Hill's Prescription Diet i/d Low Fat Dog Food, Hill's Prescription Diet w/d Multi-Benefit Dog Food, Hill's Prescription Diet c/d Multicare + Metabolic Weight Dog Food, Hill's Prescription Diet Metabolic Weight + j/d Dog Food, Hill's Prescription Diet r/d Dog Food, Hill's Prescription Diet i/d Stress Dog Food\n*   For patients with hypothyroidism: Hill's Prescription Diet Metabolic Weight + j/d Dog Food, Hill's Prescription Diet c/d Multicare + Metabolic Weight Dog Food, Hill's Prescription Diet r/d Dog Food\n*   For patients requiring weight loss or maintenance and prone to CaOx or struvite urolith formation: Hill's Prescription Diet c/d Multicare + Metabolic Weight Dog Food\n*   For patients with obesity and osteoarthritis: Hill's Prescription Diet Metabolic Weight + j/d Dog Food\n\n| KEY FEATURES                                    |      | KEY BENEFITS                                                                           |\n| :---------------------------------------------- | :--- | :------------------------------------------------------------------------------------- |\n| Proprietary blend of synergistic ingredients and nutrients | Added| Provides appetite regulation, reduces inflammation and activates metabolism.         |\n| Antioxidants                                      | High | Helps protect against free radical oxidation to help maintain a healthy immune system. |\n| Fiber                                             | Increased | Soluble and insoluble fiber to help trigger satiety, control appetite, and maintain gastrointestinal health.  |\n| L-Carnitine                                       | High | Helps dogs burn fat while sparing lean muscle mass, resulting in more effective weight loss.                                     |\n| Lysine                                            | High | Helps metabolize fat for energy production and maintain lean body mass.               |"
