      "description": "This page describes Hill's Prescription Diet Metabolic + j/d Dog Food, its indications, and available flavors and sizes.",
      "contents": "## Hill's Prescription Diet Metabolic + j/d Dog Food\n\nClinically proven nutrition to help dogs naturally lose weight by activating their metabolism and improve mobility in as little as 21 days.\n\n**Food** | **Flavor** | **Sizes Available**\n---|---|---\nDry | Chicken Flavor | 8.5 LB, 15 LB, 24 LB\nWet | Vegetable & Tuna Stew | 12.5 OZ\nWet | Carrots & Tuna Stew | 2.8 OZ\n\n**Recommended for:**\n\n*   Primary Indication:\n    *   Weight loss and maintenance with concurrent osteoarthritis\n*   Other Indications:\n    *   Diabetes in normal weight, mildly overweight, or obese dogs\n    *   Hypothyroidism\n    *   Cushing's syndrome\n    *   Atopic dermatitis (environmental allergy)\n    *   Flea allergy dermatitis (FAD)\n    *   Otitis externa (chronic)\n    *   Pruritic dermatitis\n    *   Supports skin health in cases of secondary infections, other dermatoses\n\n**Not recommended for:**\n\n*   Growing puppies, pregnant or nursing dogs\n\n**Evidence-Based Clinical Nutrition:**\n\n*   Clinically proven nutrition to reduce body weight by 13% in 2 months'\n*   The nutrition of Metabolic is clinically proven to work with each dogs unique metabolic response activating the body's natural ability to burn excess body fat and affect calorie utilization.1.2\n*   In an in-home feeding study 88% of pets experienced weight loss within 2 months with this nutrition.\u00b3\n*   Maintains effective and safe rate of up to 1-2% body weight loss weekly during weight loss period when fed as directed.\n*   Clinically proven nutrition to help dogs with arthritis walk and run better, play better, and climb stairs more easily. 4-7\n\nIngredients, nutrient profiles, and citations are located at the end of this section."
