      "page_number": 101,
      "document": "Hills.pdf",
      "description": "This page provides key features, key benefits, and daily feeding amounts for Hill's Prescription Diet c/d Multicare Dog Food.",
      "contents": "## Key Features\n\n| Feature                     | Level     | Benefit                                                                        |\n|-----------------------------|-----------|--------------------------------------------------------------------------------|\n| Magnesium, Phosphorus, Calcium | Controlled | Helps limit the building blocks for formation of struvite & calcium oxalate stones. |\n| Sodium                      | Controlled | Helps reduce calcium excretion into the urine.                                 |\n| Omega-3 Fatty Acids EPA and DHA     | High      | Reduce inflammation associated with UTI and uroliths.                             |\n| Potassium Citrate           | Added     | Decreases the risk of calcium oxalate crystals and uroliths.                      |\n| Antioxidants                | High      | Vitamins E and Beta Carotene help defend cells against free radical oxidation and counteract inflammation. |\n\n## Daily Feeding Amounts\n\nThese ranges are a starting point only, because dogs' needs vary. Adjust feeding amounts to maintain optimal body weight.\n\nAnimal feeding tests using AAFCO procedures substantiate that Hill's Prescription Diet c/d Multicare Dog Food provides complete and balanced nutrition for maintenance of adult dogs.\n\n| Weight (lbs) | 5     | 10    | 15    | 20    | 30    | 40    | 60    | 80    | 100   |\n|--------------|-------|-------|-------|-------|-------|-------|-------|-------|-------|\n| Cups         | 1/2   | 7/8   | 1 1/4 | 1 1/2 | 2     | 2 2/3 | 3 1/2 | 4 1/3 | 5 1/4 |\n| Loaf - 13 oz | 1/2   | 3/4   | 1     | 1 1/3 | 1 3/4 | 2 1/4 | 3     | 3 2/3 | 4 1/3 |\n| Stew - 12.5 oz| 3/4   | 1 1/3 | 1 3/4 | 2 1/4 | 3     | 3 2/3 | 5     | 6 1/4 | 7 1/3 |\n| Stew - 5.5 oz | 1 3/4 | 3     | 4     | 5     | 6 3/4 | 8 1/3 | 11 1/3| 14 1/4| 16 3/4|\n| Stew - 2.8 oz | 3 1/2 | 5 1/2 | 7 1/2 | 9 1/2 | 13    | 16    | 22    | 27    | 32    |"
