      "description": "This page provides information about Hill's Prescription Diet c/d Multicare + Metabolic Dog Food, including its indications, and clinical nutrition.",
      "contents": "## Hill's Prescription Diet c/d Multicare + Metabolic Dog Food\n\nFormulated to help dissolve struvite stones, reduce risk of calcium oxalate stones and reduce weight.\n\n**Food:** [Image of food bag]\n\n**Flavour:** Chicken Flavor\n\n**Sizes Available:** 8.5 lb, 24.5 lb\n\n**Recommended for:**\n\n**Primary Indications:**\n*   Weight loss & maintenance in dogs prone to CaOx or struvite urolith formation\n*   Reduce recurrence of calcium oxalate (CaOx), calcium phosphate, & struvite uroliths\n\n**Other Indications:**\n*   Struvite dissolution\n*   Diabetes in normal weight, mildly overweight, or obese dogs\n*   Cushing's syndrome\n*   Hypothyroidism\n\n**Not recommended for:**\n*   Puppies\n*   Dogs that are pregnant or lactating\n*   Dogs concurrently receiving urinary acidifiers\n*   Dogs with cystine and ammonium urate stones\n\n**Evidence-Based Clinical Nutrition:**\nThe nutrition of Hill's Prescription Diet c/d Multicare + Metabolic has been:\n*   Clinically tested to reduce body weight by 13% in 60 days'\n*   Clinically shown to work with each dog's unique metabolic response, activating the body's natural ability to burn excess body fat and affect calorie utilization. 1, 2, 4, 5, 7\n*   Used in an in-home feeding study and 88% of pets experienced weight loss within 2 months. 3, 6\n*   Clinically proven to avoid weight regain following a weight loss program. 12\n\n**Additional information:**\nHill's Prescription Diet c/d Multicare + Metabolic dog food is formulated to help dissolve struvite stones, help reduce inflammation from UTI and stones, and reduce the risk of struvite & calcium oxalate stones, and has nutrition clinically proven to reduce weight.\n\nIngredients, nutrient profiles, and citations are located at the end of this section.\n"
