      "description": "This page provides information about Hill's Prescription Diet u/d Dog Food, including its recommended uses, flavors, available sizes, and clinical nutrition information.",
      "contents": "## Hill's Prescription Diet u/d Dog Food\n\nUrinary care that supports bladder health and reduces the risk of urate and cystine crystal and stone formation.\n\n**Food** | **Flavor** | **Sizes Available**\n---|---|---\nDry | Chicken Flavor | 8.5 lb, 27.5 lb\nWet | Chicken Flavor | 13 oz\n\n**Recommended for:**\n*   Primary Indication:\n    *   Urate & cystine urolith management\n*   Other Indications:\n    *   Hepatic encephalopathy\n    *   Portosystemic shunt\n    *   Uremic encephalopathy\n\n**Not recommended for:**\n*   Growing puppies, pregnant or nursing dogs\n*   Patients with struvite urolithiasis, hyperlipidemia, hypoalbuminemia, pancreatitis, history of pancreatitis or at risk of pancreatitis\n\n**Evidence-Based Clinical Nutrition:**\nThe nutrition of Prescription Diet u/d has been shown in multiple studies to decrease the building blocks of stones in dogs prone to the development of urate stones.\n\nIngredients, nutrient profiles, and citations are located at the end of this section.\n"
