      "document": "Hills.pdf",
      "description": "This page contains information about Hill's Prescription Diet u/d Dog Food, including nutritional information, key features, and feeding guidelines.",
      "contents": "## Hill's Prescription Diet u/d Dog Food\n\n**Additional information:**\n*   Decreases purine intake and uric acid excretion, which lowers risk of forming urate crystals and uroliths.\n*   Protein level are sufficient for the maintenance of adult dogs, yet low enough to dilute urine by decreasing urea production.\n*   Urine pH of individual dogs may vary due to complicating factors such as time of feeding before urine collection, type of urine collection, individual animal variation, or test methodology. Note: Dogs on low protein foods such as Hill's Prescription Diet u/d Dry Dog Food commonly exhibit unusual laboratory values. Specifically urine specific gravity (USG) is usually less than 1.020 and blood (serum) urea nitrogen (BUN) is less than (10 mg/dl). Monitoring USG, urinary pH and BUN are methods to monitor the food's effectiveness and owner compliance.\n*   Long-term use: Dogs fed Hill's Prescription Diet u/d Canine long term should be monitored for the development of protein depletion. Because dogs with urate or cystine urolithiasis may have underlying metabolic abnormalities, we recommend performing a fasting serum chemistry profile and echocardiogram every 6 months in these patients.\n\n**Other products to consider:**\n*   For patients with portosystemic shunt: Hill's Prescription Diet l/d Dog Food\n*   For patients with hepatic encephalopathy: Hill's Prescription Diet l/d Dog Food, Hill's Prescription Diet k/d Dog Food\n*   For patients with uremic encephalopathy: Hill's Prescription Diet k/d Dog Food, Hill's Prescription Diet k/d + j/d Dog Food\n\n**KEY FEATURES**\n\n|                      |                  | **KEY BENEFITS**                                                                                                |\n| :------------------- | :--------------- | :------------------------------------------------------------------------------------------------------------- |\n| Protein              | Controlled       | Along with certain amino acids and nucleic acids, this combination results in decreased urinary concentrations of stone-forming constituents. |\n| Target Urinary pH    | 7.1 \u2013 7.7        | Increases the solubility of urate and cystine crystals.                                                        |\n| Taurine, L-Carnitine | Added, High      | Help maintain normal heart muscle function.                                                                     |\n| Dietary Buffering Capacity | Increased        | Helps raise urine pH to decrease risk of urate crystallization.                                                 |\n| Sodium               | Low              | Supports urinary tract health.                                                                                  |\n| Antioxidant blend    | High             | Vitamins E and Beta Carotene help defend cells against free radical oxidation and counteract inflammation.       |\n\n**DAILY FEEDING AMOUNTS**\n\nThese ranges are a starting point only, because dogs' needs vary. Adjust feeding amounts to maintain optimal body weight.\n\nAnimal feeding tests using AAFCO procedures substantiate that Hill's Prescription Diet u/d Dog Food provides complete and balanced nutrition for maintenance of adult dogs.\n\n**ADULT MAINTENANCE**\n\n| LB    | 5     | 10    | 15    | 20    | 30    | 40    | 60  | 80    | 100   |\n| :---- | :---- | :---- | :---- | :---- | :---- | :---- | :-- | :---- | :---- |\n| In Cups | 1/2   | 3/4   | 1 1/8 | 1 1/3 | 1 3/4 | 2 1/3 | 3   | 3 3/4 | 4 1/2 |\n| Loaf - 13 oz | 3/8   | 2/3   | 1     | 1 1/4 | 1 1/2 | 2     | 2 2/3 | 3 1/4 | 3 3/4 |"
