      "document": "Hills.pdf",
      "description": "This page contains the key features, key benefits, and daily feeding amounts for Hill's Prescription Diet Derm Complete Dog Food.",
      "contents": "## Key Features and Benefits\n\n| Feature                      | Detail                               | Benefit                                                                                                                                |\n| ---------------------------- | ------------------------------------ | -------------------------------------------------------------------------------------------------------------------------------------- |\n| Skin & immune system support | Unique blend                         | Manages allergy signs to promote skin health and healing.                                                                             |\n| Fatty acids                  | High levels                          | Fortified with omega 3 and 6 fatty acids to help support healthy skin which is a barrier against potential environmental allergens. |\n| Single, High Quality protein | Egg                                  | Shown to control clinical signs including scratching, head shaking, sleep & stool quality in dogs with food allergies.                 |\n| Anti-inflammatory            | Bioactives and Phytonutrients        | Helps reduce signs of allergic responses including licking, scratching, headshaking and skin redness in as as little as 28 days.        |\n| Magnesium, Phosphorus, Calcium | Controlled                         | To help reduce the risk of urinary stone formation                                                       |\n\n## Daily Feeding Amounts\n\nThese ranges are a starting point only, because dogs' needs vary. Adjust feeding amounts to maintain optimal body weight.\n\nAnimal feeding tests using AAFCO procedures substantiate that Hill's Prescription Diet Derm Complete Dog Food provides complete and balanced nutrition for maintenance of adult dogs.\n\n### Adult Maintenance\n\n| Lbs   | 5   | 10  | 15    | 20    | 30  | 40    | 60    | 80    | 100   |\n| :---- | :-- | :-- | :---- | :---- | :-- | :---- | :---- | :---- | :---- |\n| Cups  | 1/2 | 7/8 | 1 1/4 | 1 1/2 | 2   | 2 1/2 | 3 1/2 | 4 1/4 | 5     |\n| Loaf (13 oz) | 1/2 | 3/4 | 1     | 1 1/3 | 1 3/4 | 2 1/4 | 3     | 3 2/3 | 4 1/3 |\n"
