      "description": "This page describes the key features, key benefits, and daily feeding amounts for Hill's Prescription Diet Derm Complete Puppy Dog Food.",
      "contents": "## Key Features\n\n| Feature                        | Details                                                                                                            |\n| ------------------------------ | ------------------------------------------------------------------------------------------------------------------ |\n| Skin & immune system support   | Unique blend to manage allergy signs and promote skin health and healing                                            |\n| Fatty Acids                    | High levels to help manage skin inflammation and support a healthy skin barrier                                      |\n| Novel Protein                  | Egg, formulated to manage clinical signs including scratching, head shaking, sleep & stool quality                    |\n| Anti-inflammatory              | Bioactives and phytonutrients. Nutrition formulated to help reduce allergic responses.                                  |\n\n## Daily Feeding Amounts\n\nThe following are the daily feeding amounts in cups:\n\n| Weight (lbs) | < 4 Months | 4-9 Months | 10-12 Months |\n| :----------: | :--------: | :--------: | :----------: |\n|      5       |     1      |    3/4     |     5/8      |\n|      10      |   1 5/8    |   1 1/3    |    1 1/8     |\n|      15      |   2 1/8    |   1 7/8    |    1 1/2     |\n|      20      |   2 2/3    |   2 1/4    |    1 3/4     |\n|      30      |   3 2/3    |     3      |    2 1/2     |\n|      40      |   4 1/2    |   3 3/4    |      3       |\n|      60      |     -      |   5 1/4    |      4       |\n|      80      |     -      |     -      |      5       |\n|     100      |     -      |     -      |      6       |"
