      "description": "This page provides information and feeding guidelines for Hill's Prescription Diet z/d Dog Food, including key features, benefits, and a daily feeding chart for adult maintenance.",
      "contents": "## Key Features and Benefits\n\n| Feature             | Description                                                                                                |\n|----------------------|------------------------------------------------------------------------------------------------------------|\n| Protein             | Hydrolyzed: Highly digestible animal protein source; no intact animal protein.                            |\n| Carbohydrate        | Single source: A highly digestible single carbohydrate source helps avoid common food allergens.           |\n| Omega-6 Fatty Acids | Added: Helps nourish the skin and coat.                                                                  |\n| Antioxidants       | High levels: Helps maintain a healthy immune system and the skin barrier protection.                        |\n\n## Daily Feeding Amounts\n\nThese ranges are a starting point only, because dogs' needs vary. Adjust feeding amounts to maintain optimal body weight.\n\nAnimal feeding tests using AAFCO procedures substantiate that Hill's Prescription Diet z/d Dog Food provides complete and balanced nutrition for maintenance of adult dogs.\n\n### Adult Maintenance\n\n| LB    | 5     | 10    | 15    | 20    | 30    | 40    | 60    | 80     | 100    |\n|-------|-------|-------|-------|-------|-------|-------|-------|--------|--------|\n| In Cups| 5/8   | 1     | 1 1/3 | 1 2/3 | 2 1/4 | 2 3/4 | 3 2/3 | 4 1/2  | 5 1/3  |\n| Loaf - 13 oz| 5/8   | 1     | 1 1/3 | 1 2/3 | 2 1/4 | 2 3/4 | 3 2/3 | 4 1/2  | 5 1/3  |\n| Loaf - 5.5 oz | 1 1/3 | 2 1/4 | 3     | 3 3/4 | 5 1/4 | 6 1/2 | 8 3/4 | 10 3/4 | 12 3/4 |"
