      "contents": "## Hill's Prescription Diet z/d Dog Food Feeding Guide (Small Bites)\n\nThese ranges are a starting point only, because dogs' needs vary. Adjust feeding amounts to maintain optimal body weight.\n\nAnimal feeding tests using AAFCO procedures substantiate that Hill's Prescription Diet z/d Dog Food provides complete and balanced nutrition for maintenance of adult dogs.\n\n| Weight (lbs) | 5   | 10  | 15  | 20  | 30  | 40  | 60  | 80  | 100 |\n|--------------|-----|-----|-----|-----|-----|-----|-----|-----|-----|\n| Small Bites - In Cups | 1/2 | 7/8 | 1 1/4 | 1 1/2 | 2 1/4 | 2 2/3 | 3 1/2 | 4 1/2 | 5 1/4 |"
