      "description": "This page provides information on Hill's Prescription Diet z/d Low Fat Dog Food, including key features, benefits, and daily feeding amounts.",
      "contents": "## Prescription Diet z/d Low Fat Dog Food\n\nFor patients with chronic otitis externa or pruritic dermatitis: Hill's Prescription Diet Derm Complete Dog Food, Hill's Prescription Diet d/d Dog Food, Hill's Prescription Diet j/d Dog Food, Hill's Prescription Diet Metabolic Weight + j/d Dog Food\n\nFor patients with protein losing enteropathy (PLE) without lymphangiectasia: Hill's Prescription Diet d/d Dog Food, Hill's Prescription Diet i/d Dog Food, Hill's Prescription Diet a/d Dog/Cat Food\n\nFor patients with exocrine pancreatic insufficiency (EPI): Hill's Prescription Diet i/d Low Fat Dog Food, Hill's Prescription Diet i/d Stress Dog Food, Hill's Prescription Diet i/d Dog Food\n\nFor patients with forms of chronic enteropathies (inflammatory bowel disease) including food responsive enteropathy, antibiotic responsive diarrhea, or steroid responsive enteropathy: Hill's Prescription Diet Gastrointestinal Biome Dog Food, Hill's Prescription Diet d/d Dog Food, Hill's Prescription Diet i/d Low Fat Dog Food, Hill's Prescription Diet i/d Dog Food\n\nFor patients with flatulence: Hill's Prescription Diet Gastrointestinal Biome Dog Food, Hill's Prescription Diet i/d Low Fat Dog Food, Hill's Prescription Diet i/d Stress Dog Food, Hill's Prescription Diet i/d Dog Food, Hill's Prescription Diet w/d Multi-Benefit Dog Food\n\n### Key Features and Benefits\n\n| Key Features             |                               | Key Benefits                                                                                                |\n| :----------------------- | :---------------------------- | :---------------------------------------------------------------------------------------------------------- |\n| Protein                  | Hydrolyzed                    | Highly digestible hydrolyzed soy protein                                                                    |\n| Omega-6 Fatty Acids      | Added                         | Helps nourish the skin and coat, and promote a healthy skin barrier                                       |\n| Antioxidants             | High levels                   | Helps maintain a healthy immune system                                                                      |\n| Fat                      | Low                           | Helps manage complex, fat responsive conditions and fat intolerance. Optimal choice for dogs that need low fat, great tasting nutrition therapy. |\n| Minerals (Phosphorus, Magnesium, Calcium) | Controlled                    | Help reduce the risk of struvite and oxalate stones                                                         |\n\n### Daily Feeding Amounts\n\nThese ranges are a starting point only, because dogs' needs vary. Adjust feeding amounts to maintain optimal body weight.\n\nAnimal feeding tests using AAFCO procedures substantiate that Hill's Prescription Diet z/d Low Fat Hydrolyzed Soy Recipe Dry Dog Food provides complete and balanced nutrition for maintenance of adult dogs.\n\n#### Adult Maintenance\n\n| LB    | 5      | 10     | 15     | 20     | 30     | 40     | 60     | 80     | 100    |\n| :---- | :----- | :----- | :----- | :----- | :----- | :----- | :----- | :----- | :----- |\n| Cups  | 2/3    | 1 1/8  | 1 1/2  | 1 3/4  | 2 1/2  | 3      | 4 1/4  | 5 1/4  | 6 1/4  |\n| Loaf-13 oz | 5/8    | 1      | 1 1/3  | 1 3/4  | 2 1/3  | 3      | 4      | 4 3/4  | 5 3/4  |"
