      "document": "Hills.pdf",
      "description": "Daily feeding amounts for Hill's Prescription Diet k/d Dog Food based on adult maintenance and weight.",
      "contents": "## Daily Feeding Amounts\n\nThese ranges are a starting point only, because dogs' needs vary. Adjust feeding amounts to maintain optimal body weight.\n\nAnimal feeding tests using AAFCO procedures substantiate that Hill's Prescription Diet k/d Dog Food provides complete and balanced nutrition for maintenance of adult dogs.\n\n### Adult Maintenance\n\n| LB         | 5     | 10    | 15    | 20    | 30    | 40    | 60    | 80     | 100    |\n|------------|-------|-------|-------|-------|-------|-------|-------|--------|--------|\n| In Cups    | 1/2   | 7/8   | 1 1/8 | 1 1/3 | 2     | 2 1/3 | 3 1/4 | 4      | 4 2/3  |\n| In Cups    | 1/2   | 3/4   | 1     | 1 1/4 | 1 3/4 | 2 1/4 | 3     | 3 2/3  | 4 1/4  |\n| Loaf       | 1/2   | 3/4   | 1     | 1 1/3 | 1 3/4 | 2 1/4 | 3     | 3 3/4  | 4 1/2  |\n| Loaf - 13 oz | 1/2   | 3/4   | 1     | 1 1/3 | 1 3/4 | 2 1/4 | 3     | 3 3/4  | 4 1/2  |\n| Stew - 12.5 oz | 5/8   | 1     | 1 1/3 | 1 2/3 | 2 1/4 | 2 3/4 | 3 3/4 | 4 2/3  | 5 1/2  |\n| Stew - 12.5 oz | 1 1/3 | 2 1/4 | 3     | 3 3/4 | 5     | 6 1/4 | 8 1/2 | 10 1/2 | 12 1/2 |\n| Stew - 5.5 oz  | 5/8   | 1     | 1 1/3 | 1 2/3 | 2 1/4 | 2 3/4 | 3 3/4 | 4 2/3  | 5 1/2  |\n| Stew - 5.5 oz  | 1 1/3 | 2 1/4 | 3     | 3 3/4 | 5     | 6 1/3 | 8 2/3 | 10 2/3 | 12 2/3 |"
