      "description": "This page describes Hill's Prescription Diet k/d + j/d Dog Food, including key product features, key benefits, and daily feed amounts.",
      "contents": "## Hill's Prescription Diet k/d + j/d Dog Food\n\n**Other products to consider:**\n*   For patients with Chronic Kidney Disease (CKD) IRIS Stage 2 (non-proteinuric), IRIS Stages 3-4, and all IRIS stages with proteinuria: Hill's Prescription Diet k/d Dog Food\n*   For patients with acute kidney insult: Hill's Prescription Diet k/d Dog Food\n*   For patients with uremic encephalopathy: Hill's Prescription Diet k/d Dog Food, Hill's Prescription Diet u/d Dog Food\n*   For patients with early Chronic Kidney Disease (CKD) IRIS Stage 1 (non-proteinuric): Hill's Prescription Diet g/d Dog Food, Hill's Prescription Diet k/d Dog Food\n*   For patients with leishmaniasis with concurrent CKD: Hill's Prescription Diet k/d Dog Food\n\n| KEY FEATURES                      |                                                                                   | KEY BENEFITS                                                                                                |\n| :-------------------------------- | :-------------------------------------------------------------------------------- | :---------------------------------------------------------------------------------------------------------- |\n| Phosphorus, Sodium                | Reduced                                                                           | Help slow the progression of chronic kidney disease.                                                      |\n| ActivBiome+ Kidney Defense         | Added                                                                             | A proprietary blend of prebiotics shown to activate the gut microbiome to reduce uremic toxins.           |\n| Enhanced Appetite Trigger (\u0395.\u0391.\u03a4.) for dogs | Added                                                                             | Stimulates appetite in dogs with kidney disease and encourages food intake.                              |\n| Omega-3 fatty acids (EPA/DHA) from fish oil | Added                                                                             | Helps fight kidney and joint inflammation.                                                                |\n| Glucosamine & chondroitin sulfate | Added                                                                             | Provides building blocks for cartilage repair.                                                             |\n| Essential Amino Acids             | Increased                                                                         | More than 130% of AAFCO minimum to help the dog's natural ability to build muscle mass.                |\n| L-Carnitine                       | Added                                                                             | Helps improve utilization of fat to avoid muscle breakdown for energy.                                  |\n\nDAILY FEEDING AMOUNTS\n\nThese ranges are a starting point only, because dogs' needs vary. Adjust feeding amounts to maintain optimal body weight.\n\nAnimal feeding tests using AAFCO procedures substantiate that Hill's Prescription Diet k/d + j/d Dog Food provides complete and balanced nutrition for maintenance of adult dogs.\n\n**ADULT MAINTENANCE**\n\n| LB      | 5     | 10    | 15    | 20    | 30    | 40    | 60      | 80      | 100   |\n| :------ | :---- | :---- | :---- | :---- | :---- | :---- | :------ | :------ | :---- |\n|         | 3/8   | 3/4   | 1     | 1 1/4 | 1 2/3 | 2     | 2 3/4   | 3 1/3   | 4     |\n| In Cups |       |       |       |       |       |       |         |         |       |\n|         | 5/8   | 1     | 1 1/3 | 1 2/3 | 2 1/4 | 2 3/4 | 3 3/4   | 4 2/3   | 5 1/2 |\n| Stew - 12.5 oz     |       |       |       |       |       |       |         |         |       |"
