      "description": "This page contains recommended uses and contraindications for Hill's Prescription Diet a/d Dog & Cat Food, an urgent care food.",
      "contents": "## Hill's Prescription Diet a/d Dog & Cat Food\n\nFormulated for dogs and cats recovering from a debilitative state, supports wound and tissue healing and encourages appetite.\n\n**Food:** [Image of food can]\n**Flavor:** With Chicken\n**Sizes Available:** 5.5 oz\n\n**Recommended for:**\n\n**Primary Indications:**\n*   Anorexia\n*   Cachexia & weight loss\n*   Debility, malnutrition & convalescence\n*   Hepatic lipidosis (non-encephalopathic) in cats\n*   Hypermetabolic states\n*   Hypoglycemia\n*   Insulinoma\n*   Neoplasia, most forms\n*   Surgery (Pre- and Post-Op)\n*   Tube & syringe feeding\n\n**Other Indications:**\n*   Diabetes in underweight dogs or cats\n*   Constipation (Gl motility impaired)\n*   Esophageal disorders\n*   Gastritis (acute or chronic)\n*   Protein losing enteropathy (PLE) without lymphangiectasia\n\n**Not recommended for:**\n*   Patients where the primary therapeutic goal is to avoid fluid retention or prevent the accumulation of nitrogenous by-products, phosphorus or sodium\n*   Patients that cannot tolerate high fat intake\n*   Patients with hepatic encephalopathy, hyperlipidemia, pancreatitis, history of pancreatitis or at risk of pancreatitis\n\n**Additional information:**\nHill's Prescription Diet a/d is intended for intermittent or supplemental feeding only. Not recommended for long-term feeding (more than 6 months).\n\nIngredients, nutrient profiles, and citations are located at the end of this section."
