      "description": "This page provides information about Hill's Prescription Diet I/d Dog Food, including recommended uses, flavors, and sizes.",
      "contents": "## Hill's Prescription Diet I/d Dog Food\n\nNutrition to support dog's liver health and helps protect vital liver function.\n\n### Recommended for:\n*   Ascites & edema associated with liver disorders\n*   Copper-storage disease\n*   General liver disorders\n*   Hepatic encephalopathy\n*   Portosystemic shunt\n*   Insulinoma\n\n### Not recommended for:\n*   Pregnant or nursing dogs\n*   Patients with hyperlipidemia, pancreatitis, history of pancreatitis or at risk of pancreatitis\n\n### Additional information:\nPrescription Diet I/d Dry Dog Food is designed for the nutritional management of dogs with liver disease including hepatocellular disease, portosystemic shunts, chronic canine inflammatory hepatic disease, fibrotic hepatopathies, biliary disease, and glucocorticoid-induced hepatopathy. In certain circumstances, as with puppies with portosystemic shunts or other liver conditions, this product may be fed to puppies with careful supervision of a veterinarian. Provides complete and balanced nutrition for growing puppies as well as adult dogs.\n\n### Other products to consider:\n*   For patients with ascites & edema associated with liver disorders: Prescription Diet h/d Dog Food\n*   For patients with portosystemic shunt: Prescription Diet u/d Dog Food\n*   For patients with hepatic encephalopathy: Prescription Diet k/d Dog Food, Prescription Diet u/d Dog Food\n*   For patients with insulinoma: Prescription Diet a/d Dog/Cat Food, Prescription Diet w/d Multi-Benefit Dog Food, Prescription Diet Gastrointestinal Biome Dog Food\n\n| FOOD | FLAVOUR | SIZES AVAILABLE |\n| --- | --- | --- |\n|  | Chicken Flavor | 17.6 LB |\n|  | Chicken Flavor | 13 OZ |"
