      "description": "This page provides key features, benefits, and daily feeding amounts for Hill's Prescription Diet I/d Dog Food.",
      "contents": "## Key Features\n\n| Feature                  | Detail           | Key Benefits                                                                                                                                                              |\n|--------------------------|------------------|---------------------------------------------------------------------------------------------------------------------------------------------------------------------------|\n| Highly Digestible Protein | Controlled       | Reduces liver workload. Helps healing and regeneration of liver tissue. Delivers branched-chain amino acids (BCAA) and aromatic amino acids (AAA) in an appropriate ratio. |\n| Carbohydrate Sources     | Highly digestible | Reduce protein breakdown and resulting gluconeogenesis.                                                                                                                    |\n| Sodium                   | Low              | Helps control clinical signs associated with ascites/edema and hypertension.                                                                                                |\n| L-Carnitine              | High             | Helps improve fat metabolism in the liver.                                                                                                                                 |\n| Vitamin K, Zinc          | Added            | Help avoid deficiencies commonly related to liver disease.                                                                                                                  |\n| Soluble Fiber            | Added            | Promotes colonic evacuation and encourages nitrogen fixation by enteric bacteria, which reduces ammonia production and absorption.                                          |\n| Copper                   | Low              | Helps avoid accumulation of copper in the liver of dogs predisposed to copper-storage disease.                                                                                   |\n| Antioxidants             | Added            | Helps protect against free radical oxidation to help maintain a healthy immune system.                                                                                         |\n\n## Daily Feeding Amounts\n\nThese ranges are a starting point only, because dogs' needs vary. Adjust feeding amounts to maintain optimal body weight.\n\nAnimal feeding tests using AAFCO procedures substantiate that Hill's Prescription Diet I/d Dog Food provides complete and balanced nutrition for growing puppies and maintenance of adult dogs.\n\n| Growth    | LB  | 5   | 10  | 15  | 20  | 30  | 40  | 60  | 80  | 100 |\n|-----------|-----|-----|-----|-----|-----|-----|-----|-----|-----|-----|\n| < 4 Months |     |     |     |     |     |     |     |     |     |     |\n| In Cups   |     | 7/8 | 1 1/2 | 2 1/8 | 2 2/3 | 3 1/2 | 4 1/3 |     |     |     |\n| Loaf = 13 oz |     | 2/3 | 1 1/4 | 1 1/2 | 2   | 2 2/3 | 3 1/4 |     |     |     |\n| 4-9 Months |     |     |     |     |     |     |     |     |     |     |\n| In Cups   |     | 3/4 | 1 1/4 | 1 3/4 | 2 1/4 | 3   | 3 2/3 | 5   |     |     |"
