      "description": "This page describes the key features, key benefits, and daily feeding amounts for Hill's Prescription Diet t/d Dog Food.",
      "contents": "## Key Features and Benefits\n\n| Feature                  | Description                                                                                             |\n| ------------------------ | ------------------------------------------------------------------------------------------------------- |\n| Fiber                    | Increased. Fiber matrix resists crumbling. Striated fibers in the food help with cleaning action.        |\n| Kibble Size              | Large. Kibble engulfs more of the tooth surface to clean up to the gum line.                             |\n| Antioxidants             | Added. Defend cells from free radical oxidation, promoting a healthy immune system.                    |\n| Protein                  | Reduced. Limits a component of plaque.                                                                   |\n| Calcium                  | Reduced. Limits the mineralization of plaque to tartar.                                                   |\n| Minerals (Phosphorus, Magnesium, Calcium) | Controlled. Help reduce the risk of struvite and oxalate stones.                                     |\n\n## Daily Feeding Amounts\n\nThese ranges are a starting point only, because dogs' needs vary. Adjust feeding amounts to maintain optimal body weight.\n\nAnimal feeding tests using AAFCO procedures substantiate that Hill's Prescription Diet t/d Dog Food provides complete and balanced nutrition for maintenance of adult dogs.\n\n### Adult Maintenance\n\n| LB    | 5     | 10    | 15    | 20    | 30    | 40    | 60    | 80    | 100   |\n| :---- | :---- | :---- | :---- | :---- | :---- | :---- | :---- | :---- | :---- |\n| Cups | 7/8   | 13/8  | 17/8  | 2 1/3 | 3 1/4 | 4     | 5 1/2 | 6 3/4 | 8     |\n\n### Small Bites\n\n| LB    | 2     | 4     | 6     | 8     | 10    | 15    | 20    |\n| :---- | :---- | :---- | :---- | :---- | :---- | :---- | :---- |\n| Cups | 3/8   | 3/4   | 1     | 1 1/4 | 1 3/8 | 1 7/8 | 2 1/3 |"
