      "description": "This page describes Hill's Prescription Diet Hypo Dog Treats, its features, benefits, and suitability for dogs with food sensitivities.",
      "contents": "## Hill's Prescription Diet Hypo Dog Treats\n\nHypo dog treats are made with hydrolyzed protein to help manage food sensitivities, to promote healthy skin and coat, and formulated to complement other Prescription Diet dog foods.\n\n**Food:** [Dog treat icon]\n**Flavor:** Original\n**Sizes Available:** 12 oz\n\n**Recommended for:**\n\n*   A tasty treat specially formulated to minimize the potential for an allergic reaction in pets with suspected food allergies or for pets with related skin conditions.\n*   Hill's Prescription Diet Hypo Dog Treats are compatible for dogs being fed Hill's Prescription Diet a/d, d/d, Derm Complete, c/d Multicare, g/d, i/d, i/d Sensitive, j/d, w/d, Gastrointestinal Biome or z/d dog food.\n*   These treats are formulated to promote a urinary environment that reduces the risk of developing struvite & calcium oxalate crystals when fed with a compatible S+OXSHIELD food.\n\n**Not recommended for:**\n\n*   Dogs susceptible to copper hepatopathy\n\n**Additional information:**\n\n*   Tasty, healthy and rewarding way to treat pets with food sensitivities or related skin conditions. Minimizes the potential for adverse food reactions with hydrolyzed protein. Ideal for pet use during food elimination trials. Same technology used in Hill's Prescription Diet z/d pet foods. Specially formulated for use with Hill's Prescription Diet z/d, d/d and i/d, i/d Sensitive, Gastrointestinal Biome and Derm Complete dog foods. Each treat is approx. 17 kcal per treat and is highly palatable.\n\n**Key Features**\n\n| Feature           | Description                                                                |\n| :---------------- | :------------------------------------------------------------------------- |\n| Protein           | Hydrolyzed                                                                 |\n| Carbohydrate      | Refined                                                                    |\n| Omega Fatty Acids | Added                                                                      |\n| Antioxidants      | High                                                                       |\n\n**Key Benefits**\n\n| Benefit                        | Description                                                                        |\n| :----------------------------- | :--------------------------------------------------------------------------------- |\n| Animal protein source          | No intact animal protein.                                                          |\n| Carbohydrate source            | A single, highly digestible carbohydrate source helps avoid common food allergens. |\n| Omega Fatty Acids              | Help manage associated inflammation, and nourish the skin and coat.                |\n| Antioxidants                   | Help support a healthy immune system and skin barrier function.                    |"
