      "description": "Daily feeding amounts for Hill's Prescription Diet Hypo Dog Treats based on dog's weight.",
      "contents": "## Daily Feeding Amounts\n\nThese ranges are a starting point only because dogs' needs vary; adjust feeding amounts to maintain optimal body weight.\n\nDo not feed more than the maximum number of treats per day listed below, based on the dog's ideal body weight. If the dog tends to gain weight when supplementing with Prescription Diet Hypo Treats, adjust as needed to maintain proper body weight.\n\n+---------------------------+---+----+----+----+----+----+----+----+-----+\n| Adult Maintenance (lbs)   | 5 | 10 | 15 | 20 | 30 | 40 | 60 | 80 | 100 |\n+---------------------------+---+----+----+----+----+----+----+----+-----+\n| Treats (pcs/day) | 1 | 2  | 3  | 3  | 5  | 6  | 8  | 10 | 11  |\n+---------------------------+---+----+----+----+----+----+----+----+-----+\n"
