      "document": "Hills.pdf",
      "description": "This page describes Hill's Prescription Diet Metabolic Dog Treats and related products, recommended uses, and restrictions.",
      "contents": "## Hill's Prescription Diet Metabolic Dog Treats\n\nHill's Prescription Diet Metabolic Treats help support healthy weight loss and weight maintenance, and are a great complement for dogs being fed other Prescription Diet Weight loss or maintenance canine food.\n\n**Food:** Bone shaped treat\n**Flavor:** Chicken Flavor\n**Sizes Available:** 12 oz\n\nS+OX Shield: Reduces the risk of developing struvite and oxalate stones\n\n**Recommended for:**\n*   Hill's Prescription Diet Metabolic Canine Treats are tasty, healthy and rewarding treats for adult dogs to support healthy weight loss and weight maintenance. Prescription Diet Metabolic Canine Treats are a great complement for dogs being fed Hill's Prescription Diet c/d Multicare, Hill's Prescription Diet c/d Multicare + Metabolic Weight, Hill's Prescription Diet j/d, Hill's Prescription Diet Metabolic, Hill's Prescription Diet Metabolic Weight + j/d, Hill's Prescription Diet r/d, or Hill's Prescription Diet w/d Multi-Benefit dog food. They are also appropriate for all healthy adult and senior dogs or dogs being fed Hill's Science Diet Adult Perfect Weight or Hill's Science Diet Adult Light dog food.\n*   Your dog will love these tasty crunchy bone-shaped biscuits which are moderate in calories, protein and phosphorus, low in sodium and have increased fiber. They are designed to complement many Prescription Diet foods and, when fed as directed, can help support healthy weight loss and maintenance.\n*   These treats are also formulated to be compatible and complementary with Prescription Diet products that have the S+OXSHIELD.\n\n**Not recommended for:**\n*   Growing puppies, pregnant or nursing dogs\n\n**Additional information:**\n*   These treats are have reduced protein & phosphorus, low sodium and high in fiber and taste great. Up to 10% of the daily energy needs can be met by feeding these treats while still maintaining an appropriate nutrient profile to aid in the management of the underlying condition or disease. To ensure maximum effectiveness of the Prescription Diet food, limit Prescription Diet Metabolic Dog Treats to 10% or less of the dog's daily energy intake.\n\n**Other products to consider:**\n*   Hill's Prescription Diet Original and Soft Baked Chicken Flavor Dog Treats:\n*   Hill's Prescription Diet Hypo Dog Treats:\n\nIngredients, nutrient profiles, and citations are located at the end of this section.\n"
