      "contents": "## Hill's Prescription Diet i/d Cat Food\n\nHill's Prescription Diet i/d Dry Cat Food is highly digestible nutrition with prebiotic fiber, clinically shown to help resolve diarrhea and support quick recovery. It meets the special nutritional needs of kittens and adult cats and is made with chicken for an irresistible taste that cats' will love.\n\n**Food** **Flavour**   **Sizes Available**\n\n*   With Chicken 4 LB, 8.5 LB\n*   With Chicken 5.5 OZ\n*   Chicken & Vegetable Stew 2.9 OZ\n\n**Recommended for:**\n\n**Primary Indications:**\n\n*   Acute gastroenteritis (diarrhea or vomiting)\n*   Constipation (motility impaired)\n*   Esophageal disorders\n*   Exocrine pancreatic insufficiency (EPI)\n*   Gastritis (acute or chronic)\n*   Gastrointestinal disorders in kittens\n*   Pancreatitis\n*   Recovery from gastrointestinal surgery\n*   Growth\n*   Neoplasia, most forms\n\n**Other Indications:**\n\n*   Constipation (motility present)\n*   Flatulence\n*   Forms of chronic enteropathy (inflammatory bowel disease):\n    *   Food responsive\n    *   Antibiotic responsive\n    *   Steroid responsive\n*   Infectious diarrhea\n*   Anorexia\n*   Cachexia & weight loss\n*   Debility, malnutrition & convalescence\n*   Hypermetabolic states\n*   Surgery (Pre- and Post-Op)\n\nIngredients, nutrient profiles, and citations are located at the end of this section.\n\nS+OX SHIELD: Reduces the risk of developing struvite and oxalate stones"
