      "contents": "## Hill's Prescription Diet i/d Cat Food\n\n**Not recommended for:**\n*   Patients with concurrent use of urinary acidifiers\n\n**Additional information:**\n*   Hill's Prescription Diet i/d dry cat food is specially formulated by nutritionists and veterinarians for digestive care and is clinical nutrition to help improve digestion and stool quality. This dry food is made with chicken and has an irresistible taste that cats love.\n\n**Other products to consider:**\n*   For patients with constipation from impaired GI motility, esophageal disorders, acute or chronic gastritis, or recovery from gastrointestinal surgery: Hill's Prescription Diet a/d Dog/Cat Food\n*   For patients with exocrine pancreatic insufficiency (EPI): Hill's Prescription Diet z/d Cat Food\n*   For patients with gastrointestinal neoplasia or infectious diarrhea: Hill's Prescription Diet Gastrointestinal Biome Cat Food\n*   For patients with constipation (GI motility present): Hill's Prescription Diet Gastrointestinal Biome Cat Food, Hill's Prescription Diet w/d Multi-Benefit Cat Food, Hill's Prescription Diet r/d Cat Food\n*   For patients with forms of chronic enteropathies (inflammatory bowel disease) including food responsive enteropathy, antibiotic responsive diarrhea, or steroid responsive enteropathy: Hill's Prescription Diet Gastrointestinal Biome Cat Food, Hill's Prescription Diet d/d Cat Food, Hill's Prescription Diet z/d Cat Food\n*   For patients with flatulence: Hill's Prescription Diet Gastrointestinal Biome Cat Food, Hill's Prescription Diet w/d Multi-Benefit Cat Food, Hill's Prescription Diet z/d Cat Food\n*   For patients with anorexia, debility, malnutrition, convalescence, cachexia & weight loss, hypermetabolic states, or recovering from surgery (pre- and post-op): Hill's Prescription Diet a/d Dog/Cat Food\n*   For patients with neoplasia (most forms): Hill's Prescription Diet a/d Dog/Cat Food, Hill's Prescription Diet m/d GlucoSupport Cat Food\n\n| KEY FEATURES                                  |                                                                 | KEY BENEFITS                                                                  |\n| :-------------------------------------------- | :-------------------------------------------------------------- | :---------------------------------------------------------------------------- |\n| Digestibility (Including protein, fat and carbohydrate) | High                                                            | Ensures easy nutrient absorption by the Gl tract.                              |\n| Minerals (P, Mg, Ca)                          | Controlled                                                      | Formulated to help reduce the risk of struvite and oxalate stones.            |\n| Electrolytes and B-Vitamins                   | High                                                            | Helps replace key nutrients lost with diarrhea and vomiting.                 |\n| Clinically Proven Antioxidants                | Added                                                           | Helps support a healthy immune system.                                       |\n| Omega 3 and 6 Fatty Acids                     | Contains                                                        | Helps support healthy skin and luxurious coat.                               |\n| Soluble and insoluble fibers (including prebiotic fiber) | Added                                                           | Promotes healthy stool and helps improve digestion. Supports beneficial gut bacteria activity and digestive health. |\n"
