      "contents": "## Hill's Prescription Diet Metabolic Cat Food\n\nOther products to consider:\n*   For patients with obesity, including those with diabetes: Hill's Prescription Diet m/d GlucoSupport Cat Food, Hill's Prescription Diet c/d Multicare + Metabolic Weight Cat Food, Hill's Prescription Diet c/d Multicare Stress + Metabolic Weight Cat Food, Hill's Prescription Diet r/d Cat Food\n*   For patients requiring a weight maintenance food (obese-prone or post weight loss) or with diabetes at a normal weight or mildly overweight: Hill's Prescription Diet m/d GlucoSupport Cat Food, Hill's Prescription Diet w/d Multi-Benefit Cat Food, Hill's Prescription Diet c/d Multicare + Metabolic Weight Cat Food, Hill's Prescription Diet c/d Multicare Stress + Metabolic Weight Cat Food\n*   For patients requiring weight loss or maintenance with concurrent feline lower urinary tract disease (FLUTD): Hill's Prescription Diet c/d Multicare Stress + Metabolic Weight Cat Food, Hill's Prescription Diet c/d Multicare + Metabolic Weight Cat Food\n\n## Key Features\n\n| Feature                                        | Detail    | Key Benefits                                                                                                  |\n| ---------------------------------------------- | --------- | ------------------------------------------------------------------------------------------------------------- |\n| Proprietary blend of synergistic ingredients and nutrients | Added     | Provides appetite regulation, reduces inflammation, and activates metabolism.                            |\n| Antioxidants                                   | High      | Helps protect against free radical oxidation to help maintain a healthy immune system.                       |\n| Fiber                                            | Increased | Soluble and insoluble fiber to help trigger satiety, control appetite, and maintain gastrointestinal health. |\n| L-Carnitine                                    | High      | Helps cats burn fat while sparing lean muscle mass, resulting in more effective weight loss.                  |\n| Lysine                                           | High      | Helps metabolize fat for energy production and spare lean body mass.                                      |\n\n## Daily Feeding Amounts\n\nThese ranges are a starting point only because cats' needs vary. Adjust feeding amounts to maintain optimal body weight.\n\nAnimal feeding tests using AAFCO procedures substantiate that Hill's Prescription Diet Metabolic Cat Food provides complete and balanced nutrition for maintenance of adult cats.\n\n|             | 6     | 8     | 10    | 12    | 14    |\n| ----------- | ----- | ----- | ----- | ----- | ----- |\n| In Cups     | 3/8   | 1/2   | 5/8   | 2/3   | 3/4   |\n| Minced - 5.5 oz | 3/4   | 1     | 1 1/4 | 1 1/2 | 1 2/3 |\n| Stew - 2.9 oz   | 1 3/4 | 2 1/3 | 2 3/4 | 3 1/4 | 3 1/2 |"
