      "description": "This page contains product information for Hill's Prescription Diet m/d Cat Food, including recommended uses, flavors, and available sizes.",
      "contents": "## Hill's Prescription Diet m/d Cat Food\n\nClinically tested nutrition to manage glucose levels and promote healthy weight loss in cats.\n\n**Food** **Flavour** **Sizes Available**\n\n*   With Chicken 4 LB, 8.5 LB\n*   With Liver 5.5 OZ\n*   Chicken & Liver Stew 2.9 OZ\n\n**Recommended for:**\n\n*Primary Indications:*\n\n*   Diabetes in underweight, normal weight, mildly overweight, or obese cats\n*   Hepatic lipidosis (non-encephalopathic)\n\n*Other Indications:*\n\n*   Weight loss & maintenance (obese-prone or post weight loss)\n*   Mild to moderate stages of heart disease, including asymptomatic\n*   Neoplasia, most forms\n\n**Not recommended for:**\n\n*   Growing kittens, pregnant or nursing cats\n*   Patients with kidney disease, concurrent use of urinary acidifiers, debilitation, or dehydration\n\n**Evidence-Based Clinical Nutrition:**\n\nPrescription Diet m/d GlucoSupport is clinically proven to alter a cat's metabolism for effective weight loss.\n\n*In a clinical study of overweight cats fed m/d GlucoSupport:*\n\n*   75% reached their ideal body weight within 20 weeks\n*   Average weight loss was 25%, consistent with appropriate medical guideline\n*   Lean muscle mass and liver health were maintained during weight loss\n\n*In a clinical study of diabetic cats fed m/d GlucoSupport:*\n\n*   Glucose levels were controlled\n*   Owners reported their pets experienced improved quality of life\n\nIngredients, nutrient profiles, and citations are located at the end of this section.\n"
