      "contents": "## Hill's Prescription Diet w/d Multi-Benefit Cat Food\n\nClinically tested nutrition formulated for multiple benefits: Helps stabilize blood glucose, addresses fiber-responsive GI conditions, manages weight and supports urinary health.\n\n**Recommended for:**\n*   Diabetes in normal weight or mildly overweight cats\n*   Colitis (acute or chronic)\n*   Constipation (motility present)\n*   Fiber responsive enteropathies (large bowel diarrhea)\n*   Flatulence\n*   Struvite uroliths, reduce recurrence\n*   Weight maintenance (obese-prone or post weight loss)\n\n**Not recommended for:**\n*   Growing kittens, pregnant or nursing cats\n*   Patients with concurrent use of urinary acidifiers, debilitation, dehydration, kidney disease or underweight\n\n**Evidence-Based Clinical Nutrition:**\n\nHill's Prescription Diet w/d Multi-Benefit offers low calorie, increased fiber nutrition to help manage glucose in cats prone to obesity.\n\n**Additional information:**\n\nHill's Prescription Diet w/d Multi-Benefit cat food is clinical nutrition specially formulated to help minimize blood glucose fluctuation, which may reduce insulin dosage. It addresses fiber-responsive Gl conditions such as colitis, diarrhea or constipation and is low in fat and calories to help lower lipid levels, avoid weight gain and improve digestion. This therapeutic nutrition is also formulated with balanced minerals and promotes a urinary environment that reduces the risk of developing struvite uroliths.\n\n|        | FLAVOUR        | SIZES AVAILABLE                         |\n| :----- | :------------- | :-------------------------------------- |\n| Dry    | Chicken Flavor | 4 LB, 8.5 LB, 17.6 LB                   |\n| Wet | with Chicken   | 5.5 OZ                                  |\n\nOther products to consider:\n*   For patients with diabetes at a normal weight or mildly overweight: Hill's Prescription Diet m/d GlucoSupport Cat Food, Hill's Prescription Diet Metabolic Cat Food, Hill's Prescription Diet c/d Multicare + Metabolic Weight Cat Food, Hill's Prescription Diet c/d Multicare Stress + Metabolic Weight Cat Food\n*   For patients with colitis (acute or chronic): Hill's Prescription Diet Gastrointestinal Biome Cat Food\n\nIngredients, nutrient profiles, and citations are located at the end of this section.\n"
