      "page_number": 272,
      "document": "Hills.pdf",
      "description": "This page contains a description of Hill's Prescription Diet k/d Early Support Cat Food, including its features, benefits, and other products to consider for cats with kidney disease and other conditions.",
      "contents": "## Hill's Prescription Diet k/d Early Support Cat Food\n\nA prospective study showed that cats transitioned to a therapeutic renal food had stable renal function markers over one year, suggesting the food stabilizes renal function in at-risk cats and those with IRIS Stage 1 or 2 CKD.\n\n**Additional Information:**\n\n*   Prescription Diet k/d Early Support has increased dietary buffering capacity to help counteract metabolic acidosis. Ideal for long-term feeding, dry and canned formulas can be mixed.\n\n**Other products to consider:**\n\n*   For patients with Chronic Kidney Disease (CKD) IRIS Stages 1-2 (non-proteinuric), IRIS Stages 3-4, and all IRIS stages with proteinuria: Hill's Prescription Diet k/d Cat Food, Hill's Prescription Diet k/d + j/d Cat Food\n*   For patients with CKD and concurrent osteoarthritis: Hill's Prescription Diet k/d + j/d Cat Food\n*   For patients with acute kidney insult: Hill's Prescription Diet k/d Cat Food, Hill's Prescription Diet k/d + j/d Cat Food\n*   For patients with mild to moderate stages of heart disease, including asymptomatic: Hill's Prescription Diet c/d Multicare Cat Food, Hill's Prescription Diet d/d Cat Food, Hill's Prescription Diet c/d Multicare Stress Cat Food, Hill's Prescription Diet Gastrointestinal Biome Cat Food, Hill's Prescription Diet m/d GlucoSupport Cat Food\n*   For patients with advanced stages of heart disease: Hill's Prescription Diet c/d Multicare Stress Cat Food, Hill's Prescription Diet c/d Multicare Cat Food, Hill's Prescription Diet d/d Cat Food\n*   For patients with ascites or edema associated with heart disease (heart failure) or primary hypertension: Hill's Prescription Diet d/d Cat Food\n*   For patients with hepatic encephalopathy, including hepatic lipidosis: Hill's Prescription Diet k/d Cat Food\n*   For patients with urate or cystine urolithiasis: Hill's Prescription Diet k/d Cat Food, Hill's Prescription Diet k/d + j/d Cat Food\n\n| KEY FEATURES                   | KEY BENEFITS                                                                   |\n| :----------------------------- | :----------------------------------------------------------------------------- |\n| Phosphorus, Sodium             | Avoids excess                                                                  | Helps slow the progression of chronic kidney disease.                         |\n| ActivBiome+ Kidney Defense     | Added                                                                        | A proprietary blend of prebiotics shown to activate the gut microbiome to reduce uremic toxins. |\n| Provides 13% more high quality, highly digestible protein for cats vs. Hill's Prescription Diet k/d | Added                                                                        | Helps maintain a healthy weight and muscle mass.                               |\n| Enhanced Appetite Trigger (\u0395.\u0391.\u03a4.) for cats | Added                                                                        | Stimulates appetite in cats with kidney disease and increases caloric intake. |\n| Omega-3 fatty acids from fish oil | Added                                                                        | Helps fight renal inflammation.                                               |\n| High levels of essential amino acids | Added                                                                        | More than 160% of daily essential amino acid requirements to help support muscle mass. |\n| L-carnitine                    | Increased                                                                    | Helps improve utilization of fat to avoid muscle breakdown for energy.        |"
