      "description": "This page lists the Hill's Prescription Diet k/d Cat Food varieties, flavors, sizes, and recommendations.",
      "contents": "## Hill's Prescription Diet k/d Cat Food\n\nDelicious, clinically proven nutrition to help protect vital kidney function and build muscle mass.\n\n**S+OX SHIELD**\nReduces the risk of developing struvite and oxalate stones.\n\n**Food Flavors and Sizes Available**\n\n| Food | Flavour | Sizes Available |\n|---|---|---|\n|  | with Chicken | 4 LB, 8.5 LB |\n|  | with Ocean Fish | 4 LB, 8.5 LB |\n|  | P\u00e2t\u00e9 with Chicken | 5.5 OZ |\n|  | P\u00e2t\u00e9 with Tuna | 5.5 OZ |\n|  | Chicken & Vegetable | 2.9 OZ |\n|  | Vegetable & Tuna Stew | 2.9 OZ |\n\n**Recommended for:**\n\nPrimary Indications:\n*   Chronic Kidney Disease (CKD):\n    *   IRIS Stages 3-4\n    *   All IRIS stages with proteinuria\n*   Acute kidney insult\n*   Uremic encephalopathy\n\nOther Indications:\n*   CKD IRIS Stages 1-2 (non-proteinuric)\n*   Urate & cystine urolith management\n*   Hepatic encephalopathy\n*   Hepatic lipidosis (encephalopathic)\n\n**Not recommended for:**\n*   Growing kittens, pregnant or nursing cats\n"
