      "page_number": 275,
      "document": "Hills.pdf",
      "description": "This page provides evidence-based clinical nutrition information and additional information for Hill's Prescription Diet k/d Cat Food, including other products to consider for cats with specific conditions.",
      "contents": "Kidney Care\nPrescription Diet k/d Cat Food\nEvidence-Based Clinical Nutrition:\n- A 2-year clinical study of cats with naturally occurring chronic kidney disease compared the effects of feeding the nutrition of Prescription Diet k/d versus a typical adult grocery food. Cats with IRIS stage 2 and 3 kidney disease (serum creatinine between 2.1-4.5 mg/dL) fed Prescription Diet k/d had no uremic episodes, while 26% of the control group experienced uremic crises. There were significantly less CKD-related deaths in the group of cats fed Prescription Diet k/d (0%) compared with the group of cats fed the maintenance control food (22%).\n- A 6 month clinical study demonstrated that cats with CKD consuming Prescription Diet k/d had a significant increase in body weight and no change in lean body mass, while cats with CKD fed a positive control food had significant loss of body weight and lean body mass. Cats also consumed 23 per cent more calories when fed Prescription Diet k/d as compared with cats fed the positive control food.\u00b2\n- A prospective study involving 128 cats with various stages of CKD fed Prescription Diet k/d for 12 months demonstrated that 94% of cats successfully transitioned onto the food, while 89% of cats moderately or extremely liked the food and 68% of cats were moderately or extremely enthusiastic while eating the food. Markers of kidney function were stable and pet parent assessed quality of life improved.\u00b3\n- A retrospective study demonstrated that cats with CKD fed Prescription Diet k/d dry had significantly longer median survival time and lower serum creatinine levels (18.1 months, 242 umol/l) as compared to cats with CKD fed a non-therapeutic food (8.5 months, 277 umol/l).\n- The only renal solution with breakthrough Enhanced Appetite Trigger (\u0395.\u0391.\u03a4.) for cats, proven to significantly increase appetite in cats with chronic kidney disease. 6.7\n- Cats eating Prescription Diet k/d maintained their body condition and body weight.8\nAdditional information:\n- Prescription Diet k/d has increased dietary buffering capacity. This helps counteract the tendency for metabolic acidosis, a common complication as kidney disease progresses. Ideal for long-term feeding of cats with kidney disease.Dry and canned formulas can be mixed or fed concurrently.\nOther products to consider:\n- For patients with chronic kidney disease (CKD) IRIS Stages 3-4 and all IRIS stages with proteinuria: Prescription Diet k/d + j/d Cat Food\n- For patients with early chronic kidney disease (CKD) IRIS Stages 1-2 (non-proteinuric): Prescription Diet k/d Early Support Cat Food, Prescription Diet k/d + j/d Cat Food\n- For patients with CKD and concurrent osteoarthritis: Prescription Diet k/d + j/d Cat Food\n- For patients with acute kidney insult: Prescription Diet k/d + j/d Cat Food, Prescription Diet k/d Early Support Cat Food\n- For patients with uremic encephalopathy: Prescription Diet k/d + j/d Cat Food\n- For patients with urate or cystine urolithiasis: Prescription Diet k/d Early Support Cat Food, Prescription Diet k/d + j/d Cat Food\n- For patients with hepatic encephalopathy, including hepatic lipidosis: Prescription Diet k/d Early Support Cat Food"
