      "description": "This page describes Hill's Prescription Diet t/d, a dental care cat food.",
      "contents": "## Hill's Prescription Diet t/d Cat Food\nHill's Prescription Diet t/d Cat Dry Food is clinically proven nutrition to reduce plaque, stain and tartar buildup by over 50%. This nutrition has been shown reduce occurrence of gingivitis by up to 48%. Exclusive feeding of Hill's Prescription Diet t/d Cat Dry Food is shown to be more effective than toothbrushing.\n\n## Recommended for:\n*   Gingivitis, Periodontal disease\n*   Oral malodor, tartar, plaque, stain management\n\n## Not recommended for:\n*   Growing kittens, pregnant or nursing cats\n*   Patients with severe periodontal disease without appropriate periodontal assessment and therapy\n*   Patients with concurrent use of urinary acidifiers\n\n## Evidence-Based Clinical Nutrition:\nHill's Prescription Diet t/d is:\n*   Clinically proven to reduce occurrence of gingivitis. 1,2\n*   Clinically proven to reduce buildup of tartar (calculus), plaque and stain. 3, 4, 5\n\n## Additional information:\nThe proprietary fiber matrix resists crumbling and scrubs the entire supragingival tooth surface to reduce bacteria-laden plaque. The larger kibble size increases mechanical cleaning with added lactic acid for dual cleaning action.Note, for maximum benefit, Hill's Prescription Diet t/d should be exclusively fed to cats on a daily basis following dental prophylaxis.Great taste for improved compliance - cats love to eat it and owners love to feed it.Hill's Prescription Diet t/d reduces oral malodor from plaque and oral disease. It has been awarded the Veterinary Oral Health Council (VOHC)* Seal for mechanical control of tartar and plaque. *The VOHC Seal is a trademark of the Veterinary Oral Health Council."
