      "description": "This page describes Hill's Science Diet cat food products for different life stages, including kitten, adult, mature adult, and senior.",
      "contents": "## Products for healthy cats\n\n### KITTEN: <1 YEAR\n\n**Hill's Science Diet Kitten**\n\n*   DHA from fish oil for healthy brain & eye development\n*   High-quality protein for building lean muscles\n*   Promotes healthy digestion with an optimal blend of prebiotics\n*   Balanced minerals for strong bones & teeth\n*   Vitamin E and Omega-6s for healthy skin & coat\n\nNot recommended for:\n\nLong-term feeding to adult cats, unless they have higher than normal energy requirements.\n\n### ADULT: 1-6 YEARS\n\n**Hill's Science Diet Adult**\n\n*   Essential taurine for heart health & balanced minerals to support kidneys & bladder\n*   High-quality protein for lean muscles\n*   Vitamin E, Omega-3s & -6s for beautiful skin & fur\n\nNot recommended for:\n\nKittens and pregnant or nursing cats. During pregnancy or nursing, cats should be switched to Hill's Science Diet Kitten or Hill's Science Diet Kitten Indoor dry cat food. For cats > 6 years, we recommend Science Diet Mature and/or Senior formulations.\n\n### MATURE ADULT: 7+ YEARS\n\n**Hill's Science Diet Mature Adult**\n\n*   Essential taurine for heart health & balanced minerals to support kidneys & bladder\n*   Vitamin E, Omega-3s & -6s for beautiful skin & fur\n*   Easy-to-digest ingredients with natural fibers for healthy digestion\n\nNot recommended for:\n\nKittens and pregnant or nursing cats. During pregnancy or nursing, cats should be switched to Hill's Science Diet Kitten or Hill's Science Diet Kitten Indoor dry cat food. For cats > 10 years, we recommend Science Diet Senior formulations.\n\n### SENIOR: 11+ YEARS\n\n**Hill's Science Diet Senior**\n\n*   Essential taurine for heart health & balanced minerals to support kidneys & bladder\n*   Vitamin E, Omega-3s & -6s for beautiful skin & fur\n*   Easy-to-digest ingredients with natural fibers for healthy digestion\n\nNot recommended for:\n\nKittens and pregnant or nursing cats. During pregnancy or nursing, cats should be switched to Hill's Science Diet Kitten or Hill's Science Diet Kitten Indoor dry cat food."
