      "contents": "## Purina Pro Plan Veterinary Diets UR Urinary Ox/St Canine Formula\n\n**Medical Indications:**\nDiets with these nutritional modifications have been recommended for dogs with the following conditions:\n*   Dissolution of sterile struvite uroliths*\n*   Reducing the risk of calcium oxalate urolith recurrence\n*   Reducing the risk of sterile struvite urolith recurrence*\n\n**Medical Contraindications:**\n*   Hyperlipidemia\n\n*Most struvite uroliths in dogs are caused by urinary tract infections. In the case of non-sterile struvite uroliths, it is important to treat with the appropriate antibiotic in addition to dietary management.\n\n**Available Sizes**\nBags of 6, 16.5, and 25 lbs\nCases of 12 13.3-oz cans\n\n**Feeding and Administration:**\nAnimal feeding tests using AAFCO procedures substantiate that Purina Pro Plan Veterinary Diets UR Urinary Ox/St Canine Formula provides complete and balanced nutrition for maintenance of adult dogs.\n\nThe following feeding program is recommended as a guideline only, with discretionary clinical adjustments for proper weight maintenance.\n\nFEEDING GUIDE\u00b9\n\n| BODY WEIGHT | DRY | CANNED |\n| ----------- | ----------- | ----------- |\n| lbs | kg | Approximate Number Of 8-oz Cups/Day\u00b3 | Approximate Number Of 13.3-oz Cans/Day\u00b3 |\n| 5 | 2.3 | 5/8 |  |\n| 10 | 4.5 | 7/8 |\n| 20 | 9.1 | 1 1/2 | 3/4 |\n| 30 | 13.6 | 2 1/8 | 1 3/4 |\n| 40 | 18.2 | 2 3/8 | 2 |\n| 50 | 22.7 | 2 3/4 | 2 1/2 |\n| 60 | 27.3 | 3 1/8 | 3 |\n| 80 | 36.4 | 3 3/4 | 3 1/4 |\n| 100+ | 45.5 | 4 3/8 | 4 |\n\nCALORIE CONTENT (FED)\u00b2\n\n|                    |           |\n| ------------------ | --------: |\n| 3542 kcal/kg | 1041 kcal/kg |\n| 1607 kcal/lb   | 472 kcal/lb   |\n| 408 kcal/8-oz cup | 392 kcal/13.3-oz can |\n"
