      "contents": "## Purina EN Gastroenteric Dry Kitten Food\nKitten Feeding Amounts (Assumes 4kg/8.8lb Adult Weight)\n\n| Age (Weeks) | Cups/Day |\n|---|---|\n| 4-10 | 1/8-1/3 |\n| 11-18 | 3/8-1/2 |\n| 19-30 | 3/8-5/8 |\n| 31-52 | 1/2-5/8 |\n\n## Purina EN Gastroenteric Canned Kitten Food\nKitten Feeding Amounts (Assumes 4kg/8.8lb Adult Weight)\n\n| Age (Weeks) | Cans/Day |\n|---|---|\n| 4-7 | 3/4 to 1-1/8 |\n| 8-10 | 1-1/4 to 1-3/8 |\n| 11-18 | 1-3/8 to 1-5/8 |\n| 19-30 | 1-5/8 to 1-3/4 |\n| 31-52 | 1-3/4 to 1-7/8 |\n\n## Purina EN Gastroenteric Naturals Dry Kitten Food\nKitten Feeding Amounts (Assumes 4kg/8.8lb Adult Weight)\n\n| Age (Weeks) | Cups/Day |\n|---|---|\n| 4-10 | 1/4-3/8 |\n| 11-18 | 1/3-1/2 |\n| 19-30 | 1/2-5/8 |\n| 31-52 | 1/2-5/8 |\n\n## Purina EN Gastroenteric Naturals Canned Kitten Food\nKitten Feeding Amounts (Assumes 4kg/8.8lb Adult Weight)\n\n| Age (Weeks) | Cans/Day |\n|---|---|\n| 4-7 | 3/4 to 7/8 |\n| 8-10 | 1 to 1-1/8 |\n| 11-18 | 1-1/4 to 1-5/8 |\n| 19-30 | 1-2/3 to 1-3/4 |\n| 31-52 | 1-3/4 to 1-7/8 |\n\n## Purina EN Savory Selects Gastroenteric Canned Kitten Food\nKitten Feeding Amounts (Assumes 4kg/8.8lb Adult Weight)\n\n| Age (Weeks) | Chicken Cans/Day | Salmon Cans/Day |\n|---|---|---|\n| 4-7 | 7/8 to 1-1/8 | 7/8 to 1-1/8 |\n| 8-10 | 1-1/8 to 1-3/8 | 1-1/8 to 1-3/8 |\n| 11-18 | 1-3/8 to 1-3/4 | 1-3/8 to 1-3/4 |\n| 19-30 | 1-3/4 to 2 | 1-3/4 to 2 |\n| 31-52 | 1-7/8 to 2 | 1-7/8 to 2 |\n\n\nAdjustments must be made for environmental conditions, activity level, and body condition. Provide fresh water in a clean container daily.\n\n"
