      "description": "This page provides information about Purina Pro Plan Veterinary Diets Dental Chewz, including clinical considerations, medical indications, treat characteristics, feeding and administration instructions, nutrient content, calorie content and ingredients.",
      "contents": "## Purina Pro Plan Veterinary Diets Dental Chewz\n\n**Clinical Considerations:**\nAn effective dental chew for dogs, these treats are long-lasting, delicious and high in protein.  Dental Chewz have been recognized by the Veterinary Oral Health Council as a product that works effectively to significantly reduce tartar buildup in dogs fed two treats per day and are backed by extensive testing. These treats are a perfect complement to DH Dental Health\u00ae Canine Formulas and a great treat for healthy dogs.\n\n**Medical Indications:**\nDental Chewz are recommended for the following:\n*   Dogs on DH Dental Health\u00ae\n*   Normal healthy dogs on a maintenance diet\n*   Dogs that are prone to tartar accumulation\n\n**Treat Characteristics:**\nDental Chewz have been formulated with the following characteristics:\n*   High protein\n*   Cleans teeth and freshens breath\n\n**Feeding and Administration:**\nGive your adult dog at least two Purina Pro Plan Veterinary Diets Dental Chewz daily to help reduce tartar buildup and help keep his teeth clean.\n\n**AVERAGE NUTRIENT CONTENT**\n\n|                | PER 100 KCAL | AS FED  | DRY MATTER |\n|----------------|--------------|---------|------------|\n| Protein        | 20.40 g      | 82.10%  | 95.02%     |\n| Fat            | 0.11 g      | 0.32%   | 0.37%      |\n| Carbohydrate   | 0.00 g      | 0.00%   | 0.00%      |\n| Crude Fiber    | 0.00 g      | 0.00%   | 0.00%      |\n| Calcium        | 239 mg       | 0.69%   | 0.80%      |\n| Phosphorus     | 10 mg       | 0.03%   | 0.04%      |\n| Potassium      | 10 mg       | 0.01%   | 0.01%      |\n| Sodium         | 287 mg       | 0.83%   | 0.96%      |\n| Chloride       | 350 mg       | 1.00%   | 1.16%      |\n| Magnesium      | 35 mg       | 0.10%   | 0.12%      |\n\n**CALORIE CONTENT (CALCULATED)**\n\n3006 kcal/kg\n1366 kcal/lb\n85 kcal/ounce\n\n**Ingredients (Dental Chewz):**\nBeefhide, maltodextrins, animal digest, hydrolyzed corn protein, potassium sorbate (a preservative), xanthan gum, Yellow 5. E251522"
