      "description": "This page contains medical indications, treat characteristics, feeding and administration guidelines, nutrient content, ingredients, and calorie content for Purina Pro Plan Veterinary Diets Digestive Health Bites Canine Treats.",
      "contents": "## Digestive Health Bites Canine Treats\n\n**Medical Indications:**\nDigestive Health Bites are recommended for the following:\n*   Dogs that may benefit from added prebiotic fiber\n*   Healthy dogs on a maintenance diet\n\n**Treat Characteristics:**\nDigestive Health Bites have been formulated with the following characteristics:\n*   Contains natural prebiotic fiber to help promote digestive health\n*   Vitamins C & E to help support the immune system\n*   Real chicken #1 ingredient\n*   No artificial colors and flavors\n\n**Feeding and Administration:**\nFeed as a treat to your adult dog. This product is a treat and is not intended to be fed as a meal. The caloric intake from treats should not exceed 10% of a dog's total daily caloric requirement. If treats are given, the amount of food should be reduced accordingly.\n\n**AVERAGE NUTRIENT CONTENT**\n\n|                  | PER 100 KCAL | AS FED | DRY MATTER |\n| :--------------- | :----------- | :----- | :--------- |\n| Protein          | 5.64 g       | 14.88% | 20.20%     |\n| Fat              | 2.18 g       | 5.74%  | 7.79%      |\n| Carbohydrate     | 17.59 g      | 46.36% | 62.91%     |\n| Crude Fiber      | 0.85 g       | 2.24%  | 3.04%      |\n| Calcium          | 97 mg        | 0.26%  | 0.35%      |\n| Phosphorus       | 258 mg       | 0.68%  | 0.92%      |\n| Potassium        | 166 mg       | 0.44%  | 0.59%      |\n| Sodium           | 139 mg       | 0.37%  | 0.50%      |\n| Chloride         | 196 mg       | 0.52%  | 0.70%      |\n| Magnesium        | 55 mg        | 0.15%  | 0.20%      |\n\n**CALORIE CONTENT (CALCULATED)**\n\n|                |          |\n| :------------- | :------- |\n| 2636 kcal/kg   |          |\n| 1198 kcal/lb   |          |\n| 8 kcal/piece   |          |\n\n**Ingredients (Digestive Health Bites):**\nChicken, wheat bran, corn gluten meal, ground yellow corn, water, glycerin, wheat flour, ground rice, sugar, dried pumpkin, Vitamin E supplement, salt, malted barley flour, L-ascorbyl-2-polyphosphate (Vitamin C), phosphoric acid, sorbic acid (a preservative), natural hickory smoke flavor, preserved with mixed-tocopherols, calcium propionate (a preservative).\n"
