      "document": "Purina.pdf",
      "description": "This page describes Purina Pro Plan Veterinary Diets Crunchy Bites, including clinical considerations, medical indications, treat characteristics, feeding administration, nutrient content, calorie content, and ingredients.",
      "contents": "## Purina Pro Plan Veterinary Diets Crunchy Bites Croquantes\n\n**Clinical Considerations:**\nEvery client enjoys giving their pet a treat\u2014even cats on weight loss or maintenance diets. At less than 2 kcals per treat, Purina\u00ae Pro Plan\u00ae Veterinary Diets Crunchy Bites feline treats can be used as part of a weight loss or maintenance program, or as a calorie-smart treat with any diet. They also are effective at reducing tartar buildup in cats.\n\n**Medical Indications:**\nCrunchy Bites are recommended for the following:\n*   Cats on a weight loss program\n*   Healthy cats on a maintenance diet\n\n**Treat Characteristics:**\nCrunchy Bites have been formulated with the following characteristics:\n*   Less than 2 kcals per treat\n*   Crunchy texture helps clean teeth, freshen breath, and control tartar\n*   Natural chicken & liver flavors\n*   VOHC Seal of Acceptance: helps control tartar\n\n**Feeding and Administration:**\nFeed as a treat to your adult cat. This product is a treat and is not intended to be fed as a meal. For optimal dental benefit, feed 17 treats daily to adult cats weighing 5 pounds or more. Do not feed to cats that weigh less than 5 pounds. The caloric intake from treats should not exceed 10% of a cat's total daily requirement. If treats are given, the amount of food should be reduced accordingly.\n\n**AVERAGE NUTRIENT CONTENT**\n\n|               | PER 100 KCAL | AS FED | DRY MATTER |\n| :------------ | :----------- | :----- | :--------- |\n| Protein       | 10.26 g      | 35.30% | 38.30%     |\n| Fat           | 3.66 g       | 12.60% | 13.70%     |\n| Carbohydrate  | 9.43 g       | 32.40% | 35.30%     |\n| Crude Fiber   | 1.26 g       | 9.53%  | 10.36%     |\n| Calcium       | 514 mg       | 1.77%  | 1.92%      |\n| Phosphorus    | 425 mg       | 1.46%  | 1.59%      |\n| Potassium     | 110 mg       | 0.38%  | 0.41%      |\n| Sodium        | 111 mg       | 0.38%  | 0.41%      |\n| Chloride      | 34 mg        | 0.12%  | 0.13%      |\n| Magnesium     | 28 mg        | 0.10%  | 0.10%      |\n\n**CALORIE CONTENT (CALCULATED)**\n\n*   3438 kcal/kg\n*   1562 kcal/lb\n*   1.5 kcal/piece\n\n**Ingredients (Crunchy Bites):**\nGround yellow corn, chicken meal, corn gluten meal, animal digest, beef fat preserved with mixed-tocopherols, powdered cellulose, fish meal, natural liver flavor, glycerin, calcium carbonate, natural flavor, dried yeast, Vitamin E supplement, tricalcium phosphate.\n"
