      "description": "This page provides information about Purina Pro Plan Veterinary Diets Urinary Health Treats Feline Treats, including clinical considerations, medical indications, treat characteristics, feeding and administration, average nutrient content, calorie content and ingredients.",
      "contents": "## Purina Pro Plan Veterinary Diets Urinary Health Treats Feline Treats\n\n**Clinical Considerations:**\nClients who own cats with urinary issues are often looking for a variety of ways to help their pets. Purina\u00ae Pro Plan\u00ae Veterinary Diets Urinary Health Treats feline treats support urinary health. And when fed in conjunction with Purina\u00ae Pro Plan\u00ae Veterinary Diets UR Urinary\u00ae St/Ox\u00ae, these treats help reduce the risk of both struvite and calcium oxalate stone recurrence.\n\n**Medical Indications:**\nUrinary Health Treats is recommended for the following:\n*   Cats with a history of feline lower urinary tract disease\n*   Cats eating a urinary diet\n\n**Treat Characteristics:**\nWhen fed in conjunction with Purina Pro Plan Veterinary Diets UR Urinary St/Ox, these treats help reduce the risk of both struvite and calcium oxalate stone recurrence.\n*   High quality protein\n*   1.1 kcal per piece\n*   Supports urinary health\n\n**Feeding and Administration:**\nFeed as a treat to your adult cat in combination with Purina Pro Plan Veterinary Diets UR Urinary St/Ox feline cat food formulas. This product is a treat and is not intended to be fed as a meal. Feed up to 2 treats for each 1 pound of body weight, not to exceed 20 treats per day. The caloric intake from treats should not exceed 10% of a cat's total caloric requirement. If treats are given, the amount of food should be reduced accordingly. Provide adequate fresh water in a clean container daily. For your pet's health see your veterinarian regularly.\n\n**AVERAGE NUTRIENT CONTENT**\n\n|                  | PER 100 KCAL | AS FED | DRY MATTER |\n| ---------------- | ------------ | ------ | ---------- |\n| Protein          | 12.53 g      | 42.48% | 46.38%     |\n| Fat              | 3.39 g       | 11.50% | 12.56%     |\n| Carbohydrate     | 8.12 g       | 27.54% | 30.07%     |\n| Crude Fiber      | 0.63 g       | 2.15%  | 2.35%      |\n| Calcium          | 342 mg       | 1.16%  | 1.27%      |\n| Phosphorus       | 327 mg       | 1.11%  | 1.21%      |\n| Potassium        | 295 mg       | 1.00%  | 1.09%      |\n| Sodium           | 366 mg       | 1.24%  | 1.35%      |\n| Chloride         | 693 mg       | 2.35%  | 2.57%      |\n| Magnesium        | 21.8 mg      | 0.07%  | 0.08%      |\n\n**CALORIE CONTENT (CALCULATED)**\n\n*   3390 kcal/kg\n*   1541 kcal/lb\n*   1.1 kcal/piece\n\n**Ingredients (Urinary Health Treats):**\nCorn gluten meal, chicken, poultry by-product meal, rice, oat hulls, wheat gluten, whole grain corn, beef fat preserved with mixed-tocopherols, salt, liver flavor, phosphoric acid, calcium carbonate, potassium chloride, dried egg product, fish oil, taurine, choline chloride, Vitamin E supplement, niacin (Vitamin B-3), zinc sulfate, thiamine mononitrate, Vitamin A supplement, ferrous sulfate, calcium pantothenate (Vitamin B-5), manganese sulfate, riboflavin supplement (Vitamin B-2), Vitamin B-12 supplement, pyridoxine hydrochloride (Vitamin B-6), folic acid (Vitamin B-9), Vitamin D-3 supplement, copper sulfate, biotin (Vitamin B-7), menadione sodium bisulfite complex (Vitamin K), preserved with mixed-tocopherols, calcium iodate, sodium selenite. A250419"
