      "contents": "## FortiFlora\n\n**Medical Indications:**\nFortiFlora is recommended as a probiotic supplement to help with the following:\n*   Diarrhea associated with microflora imbalance\n*   Acute enteritis\n*   Diarrhea associated with stress, antibiotic therapy, and diet change\n*   Poor fecal quality in puppies\n*   To promote a strong immune system\n*   Flatulence\n*   To enhance palatability\n\n**Medical Contraindications:**\n*   Severely immune compromised dogs\n\n**Gastrointestinal Health:**\n*   Probiotic supplement for the dietary management of puppies and adult dogs with diarrhea\n*   Contains a probiotic proven to promote normal intestinal microflora\n*   Proprietary microencapsulation process for enhanced stability\n*   Contains a guaranteed level of viable microorganisms\n*   Increases levels of the beneficial bacteria Bifidobacteria and Lactobacilli in dogs\n*   When used in combination with metronidazole, diarrhea in dogs is shown to improve faster than with metronidazole alone\n*   Helps reduce flatulence in dogs\n\n**Immune Health:**\n*   Promotes a strong immune system at both the local and systemic levels\n*   Promotes increased fecal IgA levels in adult dogs\n\n**General Health:**\n*   Shown to be safe for use in growing and adult dogs\n*   Easy to feed\n*   Enhances palatability\n\n**AVERAGE NUTRIENT CONTENT**\n\n|                    | AMOUNT PER 1-GRAM SACHET | AS FED   |\n| :----------------- | :------------------------- | :------- |\n| Protein              | 531.41 mg                  | 53.14%   |\n| Fat                  | 117.79 mg                  | 11.78%   |\n| Crude Fiber          | 10.05 mg                   | 1.01%    |\n| Calcium              | 1.00 mg                    | 0.10%    |\n| Phosphorus           | 11.53 mg                   | 1.15%    |\n| Potassium            | 10.39 mg                   | 1.04%    |\n| Sodium               | 7.28 mg                    | 0.73%    |\n| Chloride             | 3.11 mg                    | 0.31%    |\n| Magnesium            | 0.99 mg                    | 0.10%    |\n| Selenium             | 0.002 mg                   | 1.67 mg/kg |\n| Vitamin E            | 0.05 IU                    | 54.27 IU/kg|\n\n**CALORIE CONTENT (CALCULATED)**\n\n3664 kcal/kg\n3.7 kcal/sachet\n\n**Administration:**\nAdminister one packet daily or as directed by your veterinarian.\n\n**Ingredients (Canine):**\nActive Ingredients per sachet* (1 g):\nEnterococcus faecium SF68 1x10^8 CFU\n\nInactive Ingredients:\nLiver flavor, yeast\n\n*Active ingredients are minimum declared levels\nA-9301"
