      "contents": "## Purina Pro Plan Veterinary Supplements FortiFlora Feline Probiotic Supplement\n\n**Medical Indications:**\nFortiFlora is recommended as a probiotic supplement to help with the following:\n*   Diarrhea associated with microflora imbalance\n*   Acute enteritis\n*   Diarrhea associated with stress, antibiotic therapy, and diet change\n*   Poor fecal quality in kittens\n*   To promote a strong immune system\n*   To enhance palatability\n\n**Medical Contraindications:**\n*   Severely immune compromised cats\n\n**Gastrointestinal Health:**\n*   Probiotic supplement for the dietary management of kittens and adult cats with acute and chronic diarrhea\n*   Contains a probiotic proven to promote normal intestinal microflora\n*   Proprietary microencapsulation process for enhanced stability\n*   Contains a guaranteed level of viable microorganisms\n*   Increases level of beneficial bacteria\n*   Decreases the level of Clostridium perfringens in cats\n\n**Immune Health:**\n*   Promotes a strong immune system\n*   Pilot study suggests supplementing Enterococcus faecium SF68\u00ae may decrease the incidence of conjunctivitis associated with feline herpes virus-1\n\n**General Health:**\n*   Shown to be safe for use in growing and adult cats\n*   Easy to feed\n*   Enhances palatability\n\n**AVERAGE NUTRIENT CONTENT**\n\n|                  | AMOUNT PER 1-GRAM SACHET | AS FED    |\n| :--------------- | :----------------------- | :-------- |\n| Protein          | 531.97 mg                | 53.20%    |\n| Fat              | 117.06 mg                | 11.71%    |\n| Crude Fiber      | 10.01 mg                 | 1.00%     |\n| Calcium          | 1.00 mg                  | 0.10%     |\n| Phosphorus       | 11.47 mg                 | 1.15%     |\n| Potassium        | 10.34 mg                 | 1.03%     |\n| Sodium           | 7.23 mg                  | 0.72%     |\n| Chloride         | 3.09 mg                  | 0.31%     |\n| Magnesium        | 0.98 mg                  | 0.10%     |\n| Selenium         | 0.002 mg                 | 1.66 mg/kg|\n| Vitamin E        | 0.05 IU                  | 54.27 IU/kg|\n| Taurine          | 6.06 mg                  | 0.61%     |\n\n**CALORIE CONTENT (CALCULATED)**\n3663 kcal/kg\n3.7 kcal/sachet\n\n**Administration:**\nAdminister one packet daily or as directed by your veterinarian.\n\n**Ingredients (Feline):**\nActive Ingredients per sachet* (1 g):\nEnterococcus faecium SF68 1x108 CFU\nTaurine 5 mg\nInactive Ingredients:\nLiver flavor, yeast\n\n*Active ingredients are minimum declared levels\nA-9302"
