      "contents": "## Purina FortiFlora Chewable Tablet\n\n**Medical Indications:**\nFortiFlora is recommended as a probiotic supplement to help with:\n*   Diarrhea associated with microflora imbalance\n*   Acute enteritis\n*   Diarrhea associated with stress, antibiotic therapy, and diet change\n*   Poor fecal quality in puppies\n*   To promote a strong immune system\n\n**Medical Contraindications:**\n*   Severely immune compromised dogs\n\n**Gastrointestinal Health:**\n*   Probiotic supplement for the dietary management of puppies and adult dogs with diarrhea\n*   Contains a probiotic proven to promote normal intestinal microflora\n*   Proprietary microencapsulation process for enhanced stability\n*   Contains a guaranteed level of viable microorganisms\n*   Increases levels of the beneficial bacteria Bifidobacteria and Lactobacilli in dogs\n*   Contains a probiotic that when used in combination with metronidazole, improves diarrhea in dogs faster than with metronidazole alone\n\n**Immune Health:**\n*   Contains a probiotic that promotes a strong immune system at both the local and systemic levels\n*   Promotes increased fecal IgA levels in adult dogs\n\n**General Health:**\n*   Safe for use in growing and adult dogs\n*   Easy to feed\n\n**AVERAGE NUTRIENT CONTENT**\n\n|                | AMOUNT PER TABLET | AS FED   |\n|----------------|-------------------|----------|\n| Protein          | 314.15 mg         | 17.95%   |\n| Fat              | 100.25 mg         | 5.73%    |\n| Crude Fiber      | 225.29 mg         | 12.87%   |\n| Calcium          | 5.87 mg           | 0.34%    |\n| Phosphorus       | 6.02 mg           | 0.34%    |\n| Potassium        | 8.29 mg           | 0.47%    |\n| Sodium           | 18.16 mg          | 1.04%    |\n| Chloride         | 10.48 mg          | 0.60%    |\n| Magnesium        | 0.55 mg           | 0.03%    |\n| Selenium         | 0.003 mg          | 1.76%    |\n| Vitamin E        | 21.37 IU          | 12,211%  |\n| Vitamin C        | 21.41 mg          | 12,231%  |\n\n**CALORIE CONTENT (CALCULATED)**\n1696 kcal/kg\n2.9 kcal/piece\n\n**Feeding and Administration:**\nFeed one tablet to your dog daily or as directed by your veterinarian.\n\n**Guarantee:**\nEach tablet contains a minimum of 1x10^8 CFU/g Enterococcus faecium SF68\u00ae.\n\n**Ingredients (Canine):**\nGum arabic, liver flavor, microcrystalline cellulose, dried Enterococcus faecium fermentation product, L-ascorbyl-2-polyphosphate (Vitamin C), brewers dried yeast, hydroxypropyl cellulose, Vitamin E supplement, zinc proteinate, beta-Carotene, salt, manganese proteinate, magnesium stearate, ferrous sulfate, copper proteinate, calcium iodate, sodium selenite. C252021"
