      "contents": "## Purina FortiFlora PRO Synbiotic Action Canine Supplement\n\n**Medical Indications:**\n*   Chronic enteritis\n*   To increase microbial diversity\n*   Diarrhea associated with microflora imbalance\n*   Diarrhea associated with stress and antibiotic therapy\n*   Poor fecal quality in dogs\n*   To promote a strong immune system\n*   To enhance palatability\n\n**Medical Contraindications:**\n*   Severely immune-compromised canines\n\n**Gastrointestinal Microbiome Health:**\n*   Synbiotic action of probiotics and prebiotic fiber for the management of dogs with diarrhea and to support a healthy intestinal microbiome when fed daily\n*   Contains prebiotic fiber to increase gastrointestinal microbial diversity\n*   Contains prebiotic fiber (psyllium) to stimulate the growth of specific bacteria, including *Lactobacillus* and *Bifidobacterium* species\n\n**Immune Health:**\n*   Supports a strong immune system\n*   Contains the same probiotic strain in FortiFlora\u00ae, which promotes increased fecal IgA levels in adult dogs\n\n**Gastrointestinal Health:**\n*   Contains the same probiotic strain in FortiFlora\u00ae, proven to promote normal intestinal microflora\n*   Probiotic supplement for the dietary management of puppies and adult dogs with diarrhea\n*   Proprietary microencapsulation of probiotic for enhanced stability\n*   Contains a guaranteed level of live microorganisms\n*   Contains a probiotic that when used in combination with metronidazole, is shown to improve diarrhea in dogs faster than with metronidazole alone\n\n**General Health:**\n*   Safe for use in growing and adult dogs\n*   Easy to feed\n*   Excellent palatability\n\n**Average Nutrient Content:**\n\n|                 | Amount per 2-gram sachet | As Fed    |\n|-----------------|--------------------------|-----------|\n| Protein         | 575.30 mg                | 28.77%    |\n| Fat             | 139.14 mg                | 6.96%     |\n| Crude Fiber     | 66.63 mg                 | 3.33%     |\n| Calcium         | 1.08 mg                  | 0.05%     |\n| Phosphorus      | 11.18 mg                 | 0.56%     |\n| Potassium       | 11.41 mg                 | 0.57%     |\n| Sodium          | 5.37 mg                  | 0.27%     |\n| Chloride        | 2.58 mg                  | 0.13%     |\n| Magnesium       | 1.15 mg                  | 0.06%     |\n| Selenium        | 0.001 mg                 | 0.62 mg/kg|\n| Vitamin E       | 0.04 IU                  | 20.92 IU/kg|\n\n**Calorie Content (Calculated):**\n3376 kcal/kg\n3.4 kcal/sachet\n\n**Administration:**\nAdminister one packet daily or as directed by your veterinarian.\n\n**Ingredients (Canine):**\nActive Ingredients per sachet* (2 g):\nEnterococcus faecium SF68\u00ae 1x108 CFU\nPsyllium husk 1.0 g\n\nInactive Ingredients:\nLiver flavor, yeast\n\n*Active ingredients are minimum declared levels\nA-9304"
