      "contents": "## Purina FortiFlora PRO Synbiotic Action\n\n**Medical Indications:**\n*   Chronic enteritis\n*   Feline constipation\n*   To increase microbial diversity\n*   Diarrhea associated with microflora imbalance\n*   Diarrhea associated with stress and antibiotic therapy\n*   Poor fecal quality in cats\n*   To promote a strong immune system\n*   To enhance palatability\n\n**Medical Contraindications:**\n*   Severely immune compromised felines\n\n**Gastrointestinal Microbiome Health:**\n*   Synbiotic action of prebiotic fiber and probiotics for the management of cats with diarrhea and to support a healthy intestinal microbiome\n*   Contains prebiotic fiber to increase gastrointestinal microbial diversity\n*   Contains prebiotic fiber (psyllium) to stimulate the growth of specific bacteria, including *Lactobacillus* and *Bifidobacterium* species\n\n**Immune Health:**\n*   Supports a strong immune system\n\n**Gastrointestinal Health:**\n*   Probiotic supplement for the dietary management of kittens and adult cats with diarrhea\n*   Contains a guaranteed level of beneficial microorganisms\n*   Proprietary microencapsulation of probiotic for enhanced stability\n\n**General Health:**\n*   Safe for use in growing and adult cats\n*   Easy to feed\n*   Excellent palatability\n\n**AVERAGE NUTRIENT CONTENT**\n\n|               | AMOUNT PER 1.5-GRAM SACHET | AS FED    |\n| :------------ | :--------------------------- | :-------- |\n| Protein       | 566.13 mg                    | 37.74%    |\n| Fat           | 133.15 mg                    | 8.88%     |\n| Crude Fiber   | 38.72 mg                     | 2.58%     |\n| Calcium       | 1.05 mg                      | 0.07%     |\n| Phosphorus    | 11.21 mg                     | 0.75%     |\n| Potassium     | 10.48 mg                     | 0.70%     |\n| Sodium        | 6.50 mg                      | 0.43%     |\n| Chloride      | 2.89 mg                      | 0.19%     |\n| Magnesium     | 1.02 mg                      | 0.07%     |\n| Selenium      | 0.002 mg                     | 1.00 mg/kg|\n| Vitamin E     | 0.05 IU                      | 32.43 IU/kg|\n| Taurine       | 8.36 mg                      | 0.56%     |\n\n**CALORIE CONTENT (CALCULATED)**\n\n3488 kcal/kg\n\n3.5 kcal/sachet\n\n**Administration:**\n\nAdminister one packet daily or as directed by your veterinarian.\n\n**Ingredients (Feline):**\n\nActive Ingredients per sachet* (1.5 g):\nEnterococcus faecium SF68\u00ae 1x10^8 CFU\nPsyllium husk 0.5 g\nTaurine 7.5 mg\nInactive Ingredients:\nLiver flavor, yeast\n\n*Active ingredients are minimum declared levels\nA-9303"
