      "document": "Purina.pdf",
      "description": "This page contains information about Purina Pro Plan Veterinary Supplements Calming Care, including medical and behavioral indications, average nutrient content, administration instructions, and ingredients.",
      "contents": "## Calming Care\n\n**Medical Indications:**\nCalming Care is recommended as a probiotic supplement to help dogs with the following:\n*   Anxiety\n*   Fear\n*   Stress\n\n**Behavioral Health:**\n*   Proprietary use of probiotic strain BL999 to help dogs maintain calm behavior\n*   Improvement shown in dogs displaying anxious behaviors such as excessive vocalization, jumping, pacing, and spinning\n*   Helps dogs cope with external stressors like separation, unfamiliar visitors, novel sounds, or changes in routine and location\n*   Helps dogs maintain positive cardiac activity during stressful events, promoting a positive emotional state\n*   Helps blunt cortisol response to anxious events and supports a healthy immune system\n\n**General Health:**\n*   Excellent palatability\n\n**AVERAGE NUTRIENT CONTENT**\n\n|               | AMOUNT PER 1-GRAM SACHET | AS FED |\n| :------------ | :----------------------- | :----- |\n| Protein       | 540.00 mg                | 54.00% |\n| Fat           | 133.20 mg                | 13.32% |\n| Carbohydrate  | 228.00 mg                | 22.80% |\n| Crude Fiber   | 0.90 mg                  | 0.09%  |\n| Calcium       | 1.07 mg                  | 0.11%  |\n| Phosphorus    | 10.60 mg                 | 1.06%  |\n| Sodium        | 9.01 mg                  | 0.90%  |\n| Chloride      | 3.35 mg                  | 0.34%  |\n| Magnesium     | 0.79 mg                  | 0.08%  |\n\n**CALORIE CONTENT (CALCULATED)**\n\n3822 kcal/kg\n3.8 kcal/sachet\n\n**Administration:**\nAdminister one packet daily or as directed by your veterinarian.\n\n**Ingredients (Canine):**\nActive Ingredients per sachet* (1 g):\nBifidobacterium longum BL999 1x10^9 CFU\n\nInactive Ingredients:\nLiver flavor, Maltodextrin\n\n*Active ingredients are minimum declared levels\nB-2519"
