      "contents": "## Purina Pro Plan Veterinary Diets GI Diets\n\n**Purina Pro Plan Veterinary Diets EL Elemental**\n*   Elimination diet trial\n*   Adverse food reaction\n*   Food allergic dermatitis\n*   Food allergic gastroenteritis\n*   Food intolerance\n*   Inflammatory bowel disease\n*   Idiopathic chronic enteropathy\n*   Protein-losing enteropathy\n*   Short bowel syndrome\n\n**Purina Pro Plan Veterinary Diets HA Hydrolyzed**\n*   Elimination diet trial\n*   Food allergic gastroenteritis\n*   Food intolerance\n*   Inflammatory bowel disease (IBD)\n*   Lymphangiectasia\n*   Protein-losing enteropathy\n*   Pancreatitis\n*   Exocrine pancreatic insufficiency (EPI)\n*   Malabsorption\n\n**Purina Pro Plan Veterinary Diets EN Gastroenteric**\n*   Vomiting and diarrhea (acute and chronic)\n*   Gastritis and enteritis\n*   Malabsorption and maldigestion\n*   Pancreatitis\n*   Exocrine pancreatic insufficiency (EPI)\n*   Inflammatory bowel disease (IBD)\n*   Hepatic disease not associated with encephalopathy\n\n**Purina Pro Plan Veterinary Diets EN Gastroenteric Low Fat**\n*   Hyperlipidemia\n*   Lymphangiectasia\n*   Pancreatitis\n*   Protein-losing enteropathy\n*   Inflammatory bowel disease (IBD)\n*   Exocrine pancreatic Insufficiency (EPI)\n*   Vomiting and diarrhea\n\n**Purina Pro Plan Veterinary Diets EN Gastroenteric Fiber Balance**\n*   Fiber responsive colitis\n*   Large bowel diarrhea\n*   Constipation\n*   Diabetes mellitus\n\n**Purina Pro Plan Veterinary Supplements FortiFlora**\n*   Diarrhea associated with microflora imbalance\n    *   Acute enteritis\n*   Diarrhea associated with stress, antibiotic therapy, and diet change\n*   Poor fecal quality in puppies\n*   Promotes a strong immune system\n*   Flatulence\n*   To enhance palatability\n\n**Purina Pro Plan Veterinary Supplements FortiFlora PRO**\n*   Chronic enteritis\n*   To increase microbial diversity\n*   Constipation (Feline only)\n*   Diarrhea associated with microflora imbalance\n*   Diarrhea associated with stress and antibiotic therapy\n*   To promote a strong immune system\n*   To enhance palatability"
