      "page_number": 130,
      "document": "Purina.pdf",
      "description": "This page describes the DISHAA acronym and diagnostic criteria for Cognitive Dysfunction Syndrome (CDS) in dogs.",
      "contents": "## DISHAA - Cognitive Dysfunction Syndrome\n\n**What is DISHAA?**\nDISHAA is a tool to help veterinarians and owners assess the mental acuity of a dog, and for veterinarians to potentially diagnose Cognitive Dysfunction Syndrome (CDS).\n\nThe prevalence of CDS increases with age:\n8-10 years: 3.4%\n10-12 years: 5%\n12-14 years: 23.3%\n>14 years: 41%\n\nCognitive Dysfunction Syndrome may be diagnosed using the DISHAA questionnaire. In order for a dog to be diagnosed with CDS, owners must observe their dog exhibiting signs across several DISHAA categories.\n\n*   **D - Disorientation**\n    *   Gets stuck, difficulty getting around objects, goes to hinge side of door\n    *   Stares blankly at walls, floor, or into space\n    *   Does not recognize familiar people/familiar pets\n    *   Gets lost in home or yard\n    *   Less reactive to visual (sights) or auditory (sounds) stimuli\n*   **I - Social Interactions**\n    *   More irritable/fearful/aggressive with visitors, family or other animals\n    *   Decreased interest in approaching, greeting or affection/petting\n*   **S - Sleep/Wake Cycles**\n    *   Pacing/restless/sleeps less/waking at night\n    *   Vocalization at night\n*   **H - Housesoiling, Learning and Memory**\n    *   Less able to learn new tasks or respond to previously learned commands/name/work\n    *   Indoor soiling of urine or stool/decreased signaling to go out\n    *   Difficulty getting dog's attention/increased distraction/decreased focus\n*   **A - Activity**\n    *   Decrease in exploration or play with toys, family members, other pets\n    *   Increased activity including aimless pacing or wandering\n    *   Repetitive behaviors, e.g., circling, chewing, licking, star gazing\n*   **A - Anxiety**\n    *   Increased anxiety when separated from owners\n    *   More reactive/fearful to visual (sights) or auditory (sounds) stimuli\n    *   Increased fear of places/locations (e.g., new environments/going outdoors)\n\n**Reference**\nSalvin, H. E., McGreevy, P. D., Sachdev, P. S., & Valenzuela, M. J. (2010). Under diagnosis of canine cognitive dysfunction: a cross-sectional survey of older companion dogs. Veterinary Journal (London, England: 1997), 184(3), 277-81. doi:10.1016/j.tvjl.2009.11.007"
