      "contents": "INGREDIENT GLOSSARY\n\nAdded color: Added color is any dye, pigment, or other substance that can impart color to food. It adds variety and richness to the appearance and appeal of foods.\n\nAmino acids: Building blocks of proteins. Amino acids can be classified as essential, non-essential, and conditionally essential. Examples include alanine, arginine, asparagine, aspartate, cysteine, glutamate, glutamine, glycine, histidine, isoleucine, leucine, lysine, methionine, phenylalanine, proline, serine, taurine, threonine, tryptophan, tyrosine, and valine.\n\nAnimal digest: Animal digest is created from protein sources such as the muscle and soft tissue of pork and poultry. It's highly palatable and used to enhance the taste of pet food.\n\nAnimal fat preserved with mixed-tocopherols: Pork, beef, or poultry fat preserved with mixed-tocopherols.\n\nAnimal liver flavor: Animal liver flavor enhances flavor and aids in palatability.\n\nAscorbic acid: Source of vitamin C, an antioxidant.\n\nBarley: Cereal grain providing a high-quality carbohydrate source.\n\nBeef: High-quality protein source that provides essential amino acids.\n\nBeta-Carotene: Member of the carotenoid family; from plants such as carrots and pumpkins. A source of vitamin A in dogs (cats cannot convert carotenoids to vitamin A); helps support healthy vision.\n\nBHA: Butylated hydroxytoluene; a preservative used in pet foods and also approved by the FDA for use in human foods.\n\nBifidobacterium longum BL999: Bacterium found in the gut of many animals, including dogs and humans. Used in probiotics, can be helpful in nutritionally managing dogs/cats with anxious behaviors.\n\nBiotin: Vitamin B-7; a coenzyme involved in the synthesis of fatty acids and the catabolism of amino acids; plays a role in gluconeogenesis.\n\nBrewer's dried yeast: High-quality protein source rich in amino acids.\n\nBrewer's rice: Whole and broken grains of rice, a digestible grain, acts as a high-quality carbohydrate source providing energy.\n\nBy-product: Poultry by-products may include heads, feet, and viscera, but may not include feathers or feces. Meat by-products may include organs, blood and bone, but may not include hair, horns, hooves, teeth or feces."
