      "contents": "Ingredient Glossary:\n\nCalcium carbonate: Source of calcium; supports strong teeth and bones\n\nCalcium gluconate: The calcium salt of gluconic acid; source of calcium. Supports strong bones and teeth\n\nCalcium iodate: Source of calcium, to support strong bones and teeth, and iodine, to promote proper thyroid function\n\nCalcium pantothenate: Source of vitamin B-5 (pantothenic acid), which helps metabolize and utilize carbohydrate, protein, and fat for energy\n\nCalcium phosphate: Source of the essential minerals, calcium and phosphorus, which function in skeletal formation, muscle contractions, nerve impulse transmission and blood coagulation\n\nCalcium sulfate: Source of calcium to support strong bones and teeth\n\nCanola meal: High-quality protein source rich in amino acids, vitamins and essential minerals\n\nCanola oil: Energy-packed oil containing both omega-6 and omega-3 fatty acids\n\nCaramel color: Provides a rich color to the food\n\nCarrageenan: Seaweed extract used to thicken or modify the texture of foods\n\nCassava root flour: High-quality source of carbohydrate that provides energy\n\nCellulose: Derived from fiber-rich plants. An insoluble fiber that contributes to fecal bulk and improves stool quality. It also helps minimize the formation of hairballs\n\nChicken: The clean flesh and skin, with or without bone, derived from the parts of whole carcasses of poultry. A source of protein and essential amino acids\n\nChicken meal: The dry, rendered form of ground chicken, and an excellent source of protein and essential minerals\n\nCholine chloride: Source of choline; essential in supporting your pet's proper liver function and metabolism\n\nCoconut oil: Oil extracted from the kernel of mature coconuts. Provides medium-chain triglycerides to the diet; a highly digestible source of energy\n\nColostrum: Source of proteins (immunoglobulins) and many other nutrients derived from milk to help support immune and GI health"
