      "contents": "Ingredient Glossary\n\n| Ingredient                       | Description                                                                                                                                                                                            |\n| -------------------------------- | ------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------- |\n| Fish meal                        | Fish meal is made up of fish that has been ground and cooked, reducing the fat content. A source of protein that is rich in omega-3 fatty acids                                                     |\n| Fish oil                         | Oil obtained from the tissues of oily fish, like menhaden. Rich in EPA, an omega-3 fatty acid, it promotes healthy joints, and skin and coat health. It also supports a healthy immune system. Plus, the DHA from fish oil contributes to healthy vision and brain development in puppies and kittens                                           |\n| Folic acid                       | Vitamin B-9; a form of folate which is necessary for amino acid metabolism and cell membrane integrity                                                                                             |\n| Garlic oil/powder                | Palatability enhancer                                                                                                                                                                                  |\n| Glycerin                         | Used as a softening agent to make the texture of wet/dry kibble soft or chewy                                                                                                                       |\n| Ground wheat                     | Source of energy, amino acids, linoleic acid, vitamins and minerals                                                                                                                                |\n| Guar gum                         | Natural, highly soluble carbohydrate source used as a thickener and stabilizer                                                                                                                       |\n| Gum Arabic                       | Hardened sap of various species of the acacia tree or other botanical sources. It is used in pet food to provide texture                                                                             |\n| Hydrolyzed chicken or chicken liver | Chicken or chicken liver that has been enzymatically digested to produce smaller peptides; nutrition is maintained but body does not recognize the protein as an allergen                          |\n| Hydrolyzed salmon                | Salmon that has been enzymatically digested to produce smaller peptides; nutrition is maintained but body does not recognize the protein as an allergen                                                |\n| Hydrolyzed soy protein isolate   | Product resulting from hydrolysis of dehulled soybeans after the non-protein components have been removed. High-quality protein source                                                               |\n| Inulin                           | Polysaccharide product obtained from plant sources such as chicory, agave, and Jerusalem artichoke by hot water extraction. It is intended as a source of soluble, fermentable fiber                   |\n| L-ascorbyl-2-polyphosphate     | Source of vitamin C                                                                                                                                                                                    |\n| L-carnitine                      | Amino acid complex that helps convert fat into energy more efficiently, promoting a healthy weight in your pet                                                                                        |\n| Lecithin                         | Mixture of phospholipids a major source is soybean oil; enriches fat and protein and helps to improve pelletization                                                                                    |"
