      "contents": "Ingredient Glossary:\n\n| Ingredient               | Description                                                                                                                                                                   |\n| ------------------------ | ----------------------------------------------------------------------------------------------------------------------------------------------------------------------------- |\n| Liver                    | Source of protein, vitamins and minerals                                                                                                                                        |\n| Liver flavor             | Highly palatable, natural flavoring sourced from pork and poultry                                                                                                                 |\n| L-lysine monohydrochloride | Source of lysine, an essential amino acid which aids in protein synthesis                                                                                                      |\n| Locust bean gum          | Vegetable gum extracted from the seeds of the carob tree. Used as a thickening agent                                                                                             |\n| Long grain rice          | Whole and broken grains of rice that give pets a source of carbohydrate that provides energy                                                                                    |\n| Magnesium                | Important for cell energy production. It influences calcium levels inside cells, helps transport sodium and potassium across cell membranes, and aids bone growth. It also helps transmit electrical impulses across nerves and muscles, which generates a neuromuscular contraction causing muscles to flex                                                                                                                                                                                                                                                                                         |\n| Magnesium oxide          | Source of magnesium essential for overall body health including heart health, muscle contraction and strong bones                                                                |\n| Magnesium sulfate        | Source of magnesium essential for overall body health including heart health, muscle contraction and strong bones                                                                |\n| Malted barley flour      | Form of barley which has undergone the malting process (germination)                                                                                                           |\n| Maltodextrins            | Carbohydrates derived from the partial hydrolysis of starch                                                                                                                      |\n| Manganese                | Manganese is a micromineral and functions as a component of several cell enzymes that catalyze metabolic reactions. Manganese is necessary for normal bone development, joint health and reproduction                                                                                                                     |\n| Manganese proteinate     | Source of the mineral manganese, which is essential in overall nutrient metabolism, nervous system function and normal bone development, joint health, and reproduction         |\n| Manganese sulfate        | Source of the mineral manganese, which is essential in overall nutrient metabolism, nervous system function and normal bone development, joint health, and reproduction         |\n| Meat by-products         | Non-rendered clean parts, other than meat, derived from mammals. It can include lungs, spleen, kidneys, livers, and blood. It does not include hair, horns, hooves, teeth, or feces |\n"
