      "description": "This page contains an ingredient glossary describing the source and purpose of various ingredients in pet food.",
      "contents": "## INGREDIENT GLOSSARY\n\n**Medium-chain triglyceride vegetable oil**\nMedium-chain triglycerides (MCTs) are brain-supporting nutrients sourced from palm and coconut oils. They are the product of vegetable origin obtained by extracting the oil from seeds or fruits which are commonly processed for edible purposes. They consist predominantly of glyceride esters of fatty acids and contain no additions of free fatty acids\n\n**Menadione sodium bisulfite complex**\nSource of vitamin K activity for pet food and treats\n\n**Methionine**\nSee DL-methionine\n\n**Mixed-tocopherols**\nTocopherols are a mixture of vitamin E isomers. They provide a potent preservative, which also supplies a small amount of the benefits of dietary vitamin E\n\n**Mono and dicalcium phosphate**\nMono and dicalcium phosphate is a source of calcium and phosphorus \u2013 essential minerals that help strengthen teeth and bones\n\n**Natural and artificial flavors**\nProprietary flavor blend for enhanced palatability\n\n**Natural smoke flavor**\nNatural liquid smoke flavor added to impart taste and aroma\n\n**Niacin supplement**\nNiacin is an essential B vitamin that can be found naturally in ingredients like meat, poultry and fish. It is essential in helping properly metabolize carbohydrates, protein and fat\n\n**Oat fiber/Oat hulls**\nOat fiber is a more concentrated source of dietary fiber than oat bran\n\n**Oat meal**\nOat meal is made of rolled oats. It's a natural source of carbohydrates that helps provide fuel for a healthy energy level. It is also a nutrient-dense source of fiber for healthy digestion and a source of protein for strong muscles\n\n**Ocean whitefish**\nContains fish such as cod, pollock, haddock, sole and halibut and is an excellent source of protein\n\n**Omega-3 fatty acids**\nFamily of fatty acids found in fat sources such as flaxseed and fish oil. Flaxseed is a good source of alpha-linolenic acid (18:3n-3), while fish oils are a good source of eicosapentaenoic acid (EPA, 20:5n-3) and docosahexaenoic acid (DHA, 22:6n-3)\n\n**Omega-6 fatty acids**\nFamily of fatty acids found in fat sources such as chicken fat and vegetable oils. Linoleic acid (18:2n-6) is an essential fatty acid for dogs and cats that is important to help maintain a healthy skin and coat\n\n**Pea fiber**\nPea fiber is derived from cleaned and processed pea hulls. Pea fiber is a good source of both insoluble and soluble fiber that helps support normal bowel health"
