      "contents": "Pyridoxine hydrochloride: Source of the B vitamin pyridoxine, also known as vitamin B-6, which is necessary for overall metabolism and amino acid synthesis in the body\n\nRed 3: Food color recognized as safe by the FDA for use in both human foods and pet foods\n\nRiboflavin supplement: Riboflavin (vitamin B-2) is a water-soluble vitamin. Vitamin B-2 is essential for the normal release of energy from carbohydrate, protein and fat in food. It is important for normal growth and development, the production of and regulation of certain hormones, and eye pigment formation\n\nRice: Rice is a natural source of carbohydrate that helps make food more digestible. It also has the added benefit of being a high-quality source of energy\n\nRice bran: The combination of aleurone and pericarp of rice. Rice bran provides many different nutrients, including dietary fiber and essential fatty acids\n\nRice flour: Finely ground meal from the milling of rice, which consists primarily of the starch and gluten fractions. Rice flour provides an excellent source of highly digestible carbohydrate for energy\n\nRice starch: Concentrated carbohydrate source with minimal protein content\n\nSalmon: Salmon is a marine and freshwater fish high in protein and long-chain omega-3 fatty acids\n\nSalmon meal: Salmon meal is made up of salmon that has been ground and cooked, reducing the fat content to create a protein-rich ingredient. Also rich in omega-3 fatty acids\n\nSalt: Source of the essential nutrients sodium and chloride, helps regulate proper blood pH levels, water balance, kidney function, and enhances palatability\n\nSelenium: Essential trace mineral. It is a major antioxidant and works with vitamin E to maintain cell membranes. Selenium also helps preserve tissue elasticity\n\nSodium: Sodium is the principle positively charged ion in the extracellular fluids of the body. It is an electrolyte that is critical to the maintenance of fluid balance, nerve transmissions and muscle contractions\n\nSodium ascorbate: Sodium ascorbate is a non-acidic form of vitamin C\n\nSodium bicarbonate: Alkalinizing agent; helps with processing"
