      "contents": "## Ingredient Glossary\n\n**Thiamine mononitrate:** Thiamine (vitamin B-1) is a water-soluble vitamin also known as thiamin or thiamine hydrochloride. It is required for normal functioning of all body cells, especially nerves, and peristaltic movement in the GI tract. Vitamin B-1 is involved in numerous body processes that convert food into energy and support heart muscle.\n\n**Tricalcium phosphate:** Source of calcium and phosphorus-essential minerals that help strengthen your pet's teeth and bones.\n\n**Trout:** Trout is a freshwater fish that is naturally sourced from rivers and lakes. It's a high-quality source of protein and amino acids.\n\n**Turkey:** Turkey is the clean combination of flesh and skin with or without accompanying bone, derived from the parts or whole carcasses of turkey or a combination thereof - exclusive of feathers, heads, feet, and entrails.\n\n**Vegetable oil:** The product of vegetable origin obtained by extracting the oil from seeds or fruits. Can include corn oil, soybean oil, coconut oil, etc.\n\n**Vitamin A acetate:** Vitamin A is a family of compounds that may also be referred to as retinol, retinal, retinyl, or retinoic acid. Vitamin A also helps develop and maintain the cornea in the eye, all mucous membranes, the digestive tract, the urinary tract, the reproductive tract, the skin and the lungs. It is important for normal body growth and the formation of bones and soft tissue. This vitamin also helps support the immune system.\n\n**Vitamin A supplement:** Fat-soluble vitamin which supports normal vision, a healthy immune system, bone and muscle growth, maintenance of healthy skin and hair coat, reproduction, etc.\n\n**Vitamin B-12 supplement:** Vitamin B-12 (also known as cobalamin or cyanocobalamin) is the largest, most complex, and most potent water-soluble compound essential to animals. It is essential in blood formation and carbohydrate metabolism.\n\n**Vitamin D-3 supplement:** Vitamin D-3 is a fat-soluble vitamin also known as cholecalciferol. It is the major active substance in vitamin D. Its main function is to stimulate the absorption of calcium and phosphorus, aiding in the formation of normal bones and teeth. It also helps to maintain a healthy nerve and muscle system by regulating the level of calcium in the blood.\n\n**Vitamin E supplement:** Fat-soluble vitamin and antioxidant that protects fat and vitamin A from destruction by free radicals.\n\n**Wheat bran:** The course outer covering of the wheat kernel as separated from wheat in commercial milling. A high-quality fiber source."
