      "description": "This page is a product description for Royal Canin Urinary SO, including benefits, feeding recommendations, and ingredients.",
      "contents": "## Royal Canin Urinary SO\n\n### Product Name\nRoyal Canin Urinary SO\n\n### Packaging & Sizes\nAvailable in a 135 can\n\n### Recommended For\n* Lower urinary tract disease\n* Dissolution of pure struvite uroliths\n* Prevention of struvite urolithiasis\n* Prevention of calcium oxalate urolithiasis\n\n### Not Recommended For\n* Growth\n* Reproduction\n* Concurrent use of urinary acidifiers\n\n### Nutritional Benefits\n* Struvite Dissolution: Provides nutrition that aids in the management of pure struvite uroliths.\n* Low RSS: Relative Supersaturation (RSS) methodology predicts the crystallization of RSS. RSS is used to develop diets that lower the concentration of ions contributing to struvite and calcium oxalate crystals.\n* Urine Dilution: Increasing the urine volume reduces the saturation of urine with calcium oxalate and struvite crystals.\n* Controlled Magnesium: Reduced level of magnesium, a natural component of struvite crystals.\n\n### Additional Benefits\nS/O Index\n\n### Daily Feeding Recommendations\n(Table with body weight and can amounts)\n\n### Guaranteed Analysis\n(Analysis values table)\n\n### Ingredients\n(Ingredients list)\n\n### Nutrition Statement\nRoyal Canin Urinary SO is formulated to meet the nutritional levels established by the AAFCO Dog Food Nutrient Profiles for maintenance.\n\n### General Feeding Instructions\n* Daily feeding recommendations may be divided into two to four meals\n* Fresh water should be available at all times\n* Individual requirements may vary depending on breed, age, gender, environment, activity level, spay/neuter status and any health conditions that may be present.\n* Please note that all indications throughout this book are for dietary support of the listed conditions and do not replace appropriate medical management. Recommendations are not all-inclusive. For all questions, please contact our Nutritional Advisors 888-213-4486."
