      "page_number": 15,
      "document": "Royal_Canin.pdf",
      "description": "This page contains information about Royal Canin Urinary SO Dry Dog Food, including recommended uses, nutritional benefits, feeding recommendations, ingredients, and a guaranteed analysis.",
      "contents": "## Royal Canin Urinary SO\u2122 Dry\n\nAvailable in a 6.6 lb, 17.6 lb and 25.3 lb bag.\n\n**RECOMMENDED FOR:**\n*   Lower urinary tract disease\n*   Dissolution of pure struvite uroliths\n*   Prevention of struvite urolithiasis\n*   Prevention of calcium oxalate urolithiasis\n\n**NOT RECOMMENDED FOR:**\n*   Growth\n*   Reproduction\n*   Concurrent use of urinary acidifiers\n\n**NUTRITIONAL BENEFITS:**\n\n*   **STRUVITE DISSOLUTION**\n    Provides nutrition that aids in the management of pure struvite uroliths\n*   **LOW RSS**\n    Relative Supersaturation (RSS) methodology predicts the crystallization potential of urine. RSS is used to develop diets that lower the concentration of ions contributing to struvite and calcium oxalate urolithiasis\n*   **URINE DILUTION**\n    Increasing the urine volume reduces the saturation of urine with calcium oxalate and struvite crystals\n*   **CONTROLLED MAGNESIUM**\n    Reduced level of magnesium, a natural component of struvite stones\n\n**ADDITIONAL BENEFITS:**\n\n*   This diet promotes a urinary environment unfavorable to the development of both struvite and calcium oxalate crystals\n*   RSS methodology predicts the crystallization potential and is used to develop diets that help prevent struvite and calcium oxalate stones. Low RSS values for struvite and calcium oxalate indicate that the diet can help prevent both struvite and calcium oxalate crystals and stones, as well as help dissolve pure struvite stones\n*   Promotes dilute urine undersaturated for struvite to help dissolve existing pure struvite stones and crystals and to help prevent new ones from forming\n*   Promotes dilute urine metastable for calcium oxalate to help prevent new calcium oxalate stones and crystals from forming\n*   Moderately increased sodium chloride content to increase thirst and promote formation of dilute urine\n*   Enriched with eicosapentaenoic and docosahexaenoic acids (EPA and DHA), long chain omega-3 fatty acids that help minimize clinical signs of inflammation\n*   Enriched with a blend of antioxidants to help maintain a healthy immune system and to reduce DNA damage associated with cell aging\n*   Chelated minerals improve digestive and metabolic utilization of trace elements\n\n**NOTES:**\n*   As a result of increased thirst, dogs will need free access to fresh water and access to areas that permit appropriate urination\n*   Diet can be complemented with ROYAL CANIN\u00ae Urinary Canine Treats at 10% or less of total daily calories\n\n**DAILY FEEDING RECOMMENDATIONS:**\n\n| Body Weight (lb) | Body Weight (kg) | Tendency to Become Overweight Cups | Tendency to Become Overweight Grams | Ideal Weight Cups | Ideal Weight Grams |\n| :---------------: | :---------------: | :---------------------------------: | :----------------------------------: | :---------------: | :---------------: |\n|        4.4        |         2         |                 1/2                 |                  41                  |        1/2        |         47        |\n|        6.6        |         3         |                 5/8                 |                  55                  |       3/4       |         64        |\n|        8.8        |         4         |                 3/4                 |                  68                  |       7/8       |         79        |\n|        11         |         5         |                 7/8                 |                  81                  |         1         |         94        |\n|        13         |         6         |                  1                  |                  93                  |       1 1/4      |        107        |\n|        22         |        10         |                1 1/2                |                 136                 |       1 3/4      |        158        |\n|        26         |        12         |                1 3/4                |                 156                 |         2         |        181        |\n|        35         |        16         |                2 1/8                |                 194                 |       2 1/2      |        224        |\n|        44         |        20         |                2 5/8                |                 229                 |         3         |        265        |\n|        55         |        25         |                  3                  |                 271                 |       3 1/2      |        313        |\n|        66         |        30         |                3 1/2                |                 310                 |         4         |        359        |\n|        77         |        35         |                3 7/8                |                 348                 |       4 1/2      |        403        |\n|        88         |        40         |                4 3/8                |                 385                 |         5         |        446        |\n|       110        |        50         |                5 1/8                |                 455                 |       5 7/8      |        527        |\n|       132        |        60         |                5 7/8                |                 522                 |       6 3/4      |        604        |\n\n**Guaranteed Analysis**\n\n| Guaranteed Analysis | Dry % Min | Guaranteed Analysis | Dry % Max |\n| :------------------ | :-------: | :------------------ | :-------: |\n|       Protein       |    17.0   |       Calcium       |   0.  75  |\n|         Fat         |    15.0   |     Phosphorus      |    0.7    |\n|        Fiber        |    3.7    |       Sodium        |   1.68   |\n|       Moisture      |   10.0    |     Magnesium     |   0.08   |\n|         EPA         |    0.08   |      Vitamin E      |  350.0   |\n|         DHA         |    0.05   |       Lutein*       |    5.0    |\n\n*Not recognized as an essential nutrient by the AAFCO Dog Food Nutrient Profiles.\n\n|   Bag Size   | Cups per Bag |\n| :----------: | :----------: |\n|  6.6 lb (3 kg) |      32      |\n| 17.6 lb (8 kg) |      87      |\n| 25.3 lb (11.5 kg) |     126      |\n\n**INGREDIENTS:**\nRoyal Canin Canine URINARY SO\u2122 dry\nBrewers rice, corn, chicken fat, chicken by-product meal, brewers rice flour, corn gluten meal, natural flavors, salt, powdered cellulose, potassium chloride, vegetable oil, calcium sulfate, fish oil, monocalcium phosphate, DL-methionine, fructooligosaccharides, L-lysine, choline chloride, taurine, vitamins [DL-alpha tocopherol acetate (source of vitamin E), biotin, D-calcium pantothenate, vitamin A acetate, niacin supplement, pyridoxine hydrochloride (vitamin B6), thiamine mononitrate (vitamin B1), vitamin B12 supplement, riboflavin supplement, vitamin D3 supplement, folic acid], trace minerals [zinc proteinate, zinc oxide, ferrous sulfate, manganese proteinate, manganous oxide, copper sulfate, calcium iodate, sodium selenite, copper proteinate], marigold extract (Tagetes erecta L.), L-tryptophan, rosemary extract, preserved with mixed tocopherols and citric acid.\n\n**NUTRITION STATEMENT:**\nROYAL CANIN\u00ae Canine URINARY SO\u2122 dry is formulated to meet the nutritional levels established by the AAFCO Dog Food Nutrient Profiles for maintenance. "
