      "contents": "## Royal Canin Urinary SO\u2122 Moderate Calorie\n\n**Available in a 12.5 oz can (thin slices in gravy).**\n\n**RECOMMENDED FOR:**\n*   Lower urinary tract disease in dogs predisposed to weight gain\n*   Dissolution of pure struvite uroliths\n*   Prevention of struvite urolithiasis\n*   Prevention of calcium oxalate urolithiasis\n\n**NOT RECOMMENDED FOR:**\n*   Growth\n*   Reproduction\n*   Concurrent use of urinary acidifiers\n\n**NUTRITIONAL BENEFITS:**\n\n*   **Struvite Dissolution:** Provides nutrition that aids in the management of pure struvite uroliths.\n*   **Moderate Calorie:** Moderate calorie content, 12% less than Canine Urinary SO thin slices in gravy, to help maintain ideal weight.\n*   **Urine Dilution:** Increasing the urine volume reduces the saturation of urine with calcium oxalate and struvite crystals.\n*   **Low RSS:** Relative Supersaturation (RSS) methodology predicts the crystallization potential of urine. RSS is used to develop diets that lower the concentration of ions contributing to struvite and calcium oxalate urolithiasis.\n\n**ADDITIONAL BENEFITS:**\n\n*   This diet promotes a urinary environment unfavorable to the development of both struvite and calcium oxalate crystals.\n*   RSS methodology predicts the crystallization potential and is used to develop diets that help prevent struvite and calcium oxalate stones. Low RSS values for struvite and calcium oxalate indicate that the diet can help prevent both struvite and calcium oxalate crystals and stones, as well as help dissolve pure struvite stones.\n*   Promotes dilute urine undersaturated for struvite to help dissolve existing pure struvite stones and crystals and to help prevent new ones from forming\n*   Promotes dilute urine metastable for calcium oxalate to help prevent new calcium oxalate stones and crystals from forming\n*   Enriched with eicosapentaenoic and docosahexaenoic acids (EPA and DHA), long chain omega-3 fatty acids that help minimize clinical signs of inflammation.\n\n**NOTES:**\n*   As a result of increased thirst, dogs will need free access to fresh water and access to areas that permit appropriate urination\n*   Diet can be complemented with ROYAL CANIN\u00ae Urinary Canine Treats at 10% or less of total daily calories\n\n**DAILY FEEDING RECOMMENDATIONS:**\n\n| Body Weight (lb) | Body Weight (kg) | Tendency to Become Overweight (Cans) | Tendency to Become Overweight (Grams) | Ideal Weight (Cans) | Ideal Weight (Grams) |\n|---|---|---|---|---|---|\n| 4.4 | 2 | 1/2 | 152 | 1/2 | 181 |\n| 6.6 | 3 | 1/2 | 206 | 3/4 | 245 |\n| 8.8 | 4 | 3/4 | 256 | 3/4 | 304 |\n| 11 | 5 | 3/4 | 302 | 1 | 359 |\n| 13 | 6 | 1 | 347 | 1 1/4 | 412 |\n| 22 | 10 | 1 1/2 | 508 | 1 3/4 | 604 |\n| 26 | 12 | 1 3/4 | 583 | 2 | 692 |\n| 35 | 16 | 2 | 723 | 2 1/2 | 859 |\n| 44 | 20 | 2 1/2 | 855 | 2 3/4 | 1015 |\n| 55 | 25 | 2 3/4 | 1011 | 3 1/2 | 1200 |\n| 66 | 30 | 3 1/4 | 1159 | 4 | 1376 |\n| 77 | 35 | 3 3/4 | 1301 | 4 1/4 | 1545 |\n| 88 | 40 | 4 | 1438 | 4 3/4 | 1707 |\n| 110 | 50 | 4 3/4 | 1700 | 5 3/4 | 2018 |\n| 132 | 60 | 5 1/2 | 1949 | 6 1/2 | 2314 |\n\n**Guaranteed Analysis**\n\n| Ingredient | Can |\n|---|---|\n| Protein (% Min) | 6.5 |\n| Fat (% Min) | 2.5 |\n| Fiber (% Max) | 1.7 |\n| Moisture (% Max) | 82.5 |\n| EPA  (% Min) | 0.02 |\n| DHA (% Min) | 0.01 |\n\n**INGREDIENTS:**\n\nCanine URINARY SO\u2122 MODERATE CALORIE thin slices in gravy\n\nWater sufficient for processing, chicken, pork by-products, pork liver, chicken by-products, wheat flour, modified corn starch, powdered cellulose, wheat gluten, pork plasma, salt, natural flavors, fish oil, calcium sulfate, sodium bisulfate, potassium chloride, carob bean gum, guar gum, sodium tripolyphosphate, taurine, vitamins [DL-alpha tocopherol acetate (source of vitamin E), thiamine mononitrate (vitamin B1), biotin, niacin supplement, D-calcium pantothenate, riboflavin supplement, pyridoxine hydrochloride (vitamin B6), vitamin B12 supplement, folic acid, vitamin D3 supplement], choline chloride, marigold extract (Tagetes erecta L.), L-carnitine, trace minerals [zinc oxide, ferrous sulfate, zinc proteinate, copper sulfate, calcium iodate, manganous oxide, sodium selenite].\n\n**NUTRITION STATEMENT:**\n\nROYAL CANIN\u00ae Canine URINARY SO\u2122 MODERATE CALORIE thin slices in gravy is formulated to meet the nutritional levels established by the AAFCO Dog Food Nutrient Profiles for maintenance.\n"
