      "page_number": 27,
      "document": "Royal_Canin.pdf",
      "description": "This page describes Royal Canin Urinary S/O + Satiety, including its benefits, feeding recommendations, ingredients, and guaranteed analysis.",
      "contents": "## Royal Canin Urinary S/O\u2122 + Satiety\n\nAvailable in a 13.5 oz can (loaf in sauce).\n\n**RECOMMENDED FOR:**\n*   Lower urinary tract disease\n*   Dissolution of pure struvite uroliths\n*   Prevention of struvite urolithiasis\n*   Prevention of calcium oxalate urolithiasis\n*   Weight loss in overweight or obese dogs\n\n**NOT RECOMMENDED FOR:**\n*   Growth\n*   Reproduction\n*   Concurrent use of urinary acidifiers\n\n**NUTRITIONAL BENEFITS:**\n\n*   **Struvite Dissolution:** Provides nutrition that aids in the management of pure struvite uroliths.\n*   **Low RSS:** Relative Supersaturation (RSS) methodology predicts the crystallization potential of urine. RSS is used to develop diets that lower the concentration of ions contributing to struvite and calcium oxalate urolithiasis.\n*   **Weight Management:** Formulated to support safe weight loss, control begging and help limit weight regain.\n*   **Satietogenic Effect:** Formulated with a special blend of fibers to promote satiety and reduce the spontaneous consumption of food.\n\n**ADDITIONAL BENEFITS:**\n\n*   This diet promotes a urinary environment unfavorable to the development of both struvite and calcium oxalate crystals.\n*   RSS methodology predicts the crystallization potential of urine and is used to develop diets that help manage the recurrence of struvite and calcium oxalate stones. Low RSS values for struvite and calcium oxalate indicate that the diet can help prevent both struvite and calcium oxalate crystals and stones, as well as help dissolve pure struvite stones.\n*   Promotes dilute urine undersaturated for struvite to help dissolve existing pure struvite stones and crystals and to help prevent new ones from forming.\n*   Promotes dilute urine metastable for calcium oxalate to help prevent new calcium oxalate stones and crystals from forming.\n*   High protein and high fiber formulation helps pets feel full between meals and helps reduce begging and vocalization behaviors.\n*   Supplemented with L-carnitine to help facilitate healthy weight loss and maintain lean body mass.\n*   Enriched with eicosapentaenoic and docosahexaenoic acids (EPA and DHA), long chain omega-3 fatty acids that help minimize clinical signs of inflammation.\n*   Enriched with a blend of antioxidants to help maintain a healthy immune system and to reduce DNA damage associated with cell aging.\n\n**Notes:**\n*   As a result of increased thirst, dogs will need free access to fresh water and access to areas that permit appropriate urination.\n*   Diet can be complemented with ROYAL CANIN\u00ae URINARY Canine Treats at 10% or less of total daily calories.\n\n**DAILY FEEDING RECOMMENDATIONS:**\n\n| Target Weight (lb) | Target Weight (kg) | Weight Loss (Cans) | Weight Loss (Grams) | Post Weight-Loss Maintenance (Cans) | Post Weight-Loss Maintenance (Grams) |\n| ------------- |-------------|-------------|-------------|-------------|------------- |\n| 4.4 | 2 | 1/2 | 195-167 | 1/2 | 183 |\n| 6.6 | 3 | 3/4-1/2 | 264-226 | 3/4 | 249 |\n| 8.8 | 4 | 3/4 | 327-281 | 3/4 | 309 |\n| 11 | 5 | 1-3/4 | 387-332 | 1 | 365 |\n| 13 | 6 | 1 1/4-1 | 444-380 | 1 | 418 |\n| 22 | 10 | 1 3/4-1 1/2 | 651-558 | 1 1/2 | 613 |\n| 26 | 12 | 2-1 3/4 | 746-639 | 1 3/4 | 703 |\n| 35 | 16 | 2 1/2-2 | 926-793 | 2 1/4 | 873 |\n| 44 | 20 | 2 3/4-2 1/2 | 1094-938 | 2 3/4 | 1032 |\n| 55 | 25 | 3 1/4-3 | 1294-1109 | 3 1/4 | 1220 |\n| 66 | 30 | 3 3/4-3 1/4 | 1483-1271 | 3 3/4 | 1398 |\n| 77 | 35 | 4 1/4-3 3/4 | 1665-1427 | 4 | 1570 |\n| 88 | 40 | 4 3/4-4 | 1840-1577 | 4 1/2 | 1735 |\n| 110 | 50 | 5 3/4-4 3/4 | 2176-1865 | 5 1/4 | 2051 |\n| 132 | 60 | 6 1/2-5 1/2 | 2494-2138 | 6 | 2352 |\n\n*The individual feeding amount should be determined and may need to be adjusted during the weight-loss program.\n\n**Guaranteed Analysis**\n\n| Ingredient | % | \n| ----------- | ----------- |\n| Protein | 6.5 Min |\n| Fat | 1.0 Min |\n| Fiber | 0.9 Min |\n| Fiber | 3.9 Max |\n| Moisture | 85.0 Max |\n| EPA | 0.03 Min |\n| DHA | 0.01 Min |\n| Calcium | 0.28 Max |\n| Phosphorus | 0.3 Max |\n| Sodium | 0.22 Max |\n| Magnesium | 0.02 Max |\n| Vitamin E | 53 IU/kg Min |\n| Taurine* | 0.05 Min |\n| L-Carnitine* | 42 mg/kg Min |\n| Glucosamine* | 51 mg/kg Min |\n| Chondroitin Sulfate* | 15 mg/kg Min |\n\n*Not recognized as an essential nutrient by the AAFCO Dog Food Nutrient Profiles.\n\n**INGREDIENTS:**\n\nRoyal Canin Canine URINARY S/O\u2122 + SATIETY loaf in sauce\n\nWater sufficient for processing, pork by-products, pork liver, chicken by-products, powdered cellulose, wheat flour, wheat gluten, carob bean gum, carrageenan, calcium sulfate, fish oil, guar gum, pork plasma, natural flavors, salt, sodium silico aluminate, sodium tripolyphosphate, potassium chloride, taurine, DL-methionine, citric acid, sodium carbonate, L-carnitine, vitamins [DL-alpha tocopherol acetate (source of vitamin E), thiamine mononitrate (vitamin B1), biotin, niacin supplement, D-calcium pantothenate, riboflavin supplement, folic acid, pyridoxine hydrochloride (vitamin B6), vitamin B12 supplement, vitamin D3 supplement], magnesium oxide, glucosamine hydrochloride, marigold extract (Tagetes erecta L.), chondroitin sulfate, trace minerals [zinc oxide, ferrous sulfate, zinc proteinate, copper sulfate, calcium iodate, manganous oxide, sodium selenite].\n\n**NUTRITION STATEMENT:**\n\nROYAL CANIN\u00ae Canine URINARY S/O\u2122 + SATIETY loaf in sauce is formulated to meet the nutritional levels established by the AAFCO Dog Food Nutrient Profiles for maintenance. "
