      "contents": "## ROYAL CANIN URINARY SOT\u2122 MODERATE CALORIE\n\nAvailable in a 3.3 lb, 6.6 lb and 17.6 lb bag.\n\n**RECOMMENDED FOR:**\n*   Lower urinary tract disease in cats predisposed to weight gain\n*   Dissolution of pure struvite uroliths\n*   Prevention of struvite urolithiasis\n*   Prevention of calcium oxalate urolithiasis\n\n**NOT RECOMMENDED FOR:**\n*   Growth\n*   Reproduction\n\n**NUTRITIONAL BENEFITS:**\n\n**STRUVITE DISSOLUTION**\nProvides nutrition that aids in the management of pure struvite uroliths\n\n**MODERATE CALORIE**\nModerate calorie content, 10% less than Feline URINARY SOT\u2122 dry, to help maintain ideal weight.\n\n**URINE DILUTION**\nIncreasing the urine volume simultaneously reduces the saturation of urine with calcium oxalate and struvite crystals\n\n**LOW RSS**\nRelative Super Saturation (RSS) methodology predicts the crystallization potential of urine; RSS is used to develop diets that lower the concentration of ions contributing to struvite and calcium oxalate urolithiasis\n\n**ADDITIONAL BENEFITS:**\n\n[s/0\nLINDEX] This diet promotes a urinary environment unfavorable to the development of both struvite and calcium oxalate crystals\n\n*   RSS methodology predicts the crystallization potential and is used to develop diets that help prevent struvite and calcium oxalate stones. Low RSS values for struvite and calcium oxalate indicate that the diet can help prevent both struvite and calcium oxalate crystals and stones, as well as help dissolve pure struvite stones\n*   Promotes dilute urine undersaturated for struvite to help dissolve existing pure struvite stones and crystals and to help prevent new ones from forming\n*   Promotes dilute urine metastable for calcium oxalate to help prevent new calcium oxalate stones and crystals from forming\n*   Moderately increased sodium chloride content to increase thirst and promote formation of dilute urine\n*   Enriched with a blend of antioxidants to help maintain a healthy immune system and to reduce DNA damage associated with cell aging\n*   Enriched with eicosapentaenoic and docosahexaenoic acids (EPA and DHA), long chain omega-3 fatty acids that help minimize clinical signs of inflammation\n\n**NOTES:**\n*   As a result of increased thirst, cats will need free access to fresh water and access to areas that permit appropriate urination\n*   Diet can be complemented with ROYAL CANIN\u00ae Urinary Feline Treats at 10% or less of total daily calories\n\n**DAILY FEEDING RECOMMENDATIONS:**\n\n| Body Weight | Tendency to Become Overweight | Ideal Weight |\n| ----------- | ----------------------------- | ------------ |\n| lb    | kg    | Cups | Grams | Cups | Grams |\n| 4.4   | 2     | 3/8  | 29    | 3/8  | 36    |\n| 5.5   | 2.5   | 3/8  | 34    | 1/2  | 43    |\n| 6.6   | 3     | 1/2  | 39    | 5/8  | 49    |\n| 7.7   | 3.5   | 1/2  | 43    | 5/8  | 54    |\n| 8.8   | 4     | 5/8  | 48    | 3/4  | 60    |\n| 9.9   | 4.5   | 5/8  | 52    | 3/4  | 65    |\n| 11    | 5     | 5/8  | 56    | 7/8  | 70    |\n| 12    | 5.5   | 3/4  | 60    | 7/8  | 75    |\n| 13    | 6     | 3/4  | 64    | 1    | 80    |\n| 14    | 6.5   | 3/4  | 67    | 1    | 84    |\n| 15    | 7     | 7/8  | 71    | 1    | 89    |\n| 17    | 7.5   | 7/8  | 75    | 1 1/8| 93    |\n| 18    | 8     | 7/8  | 78    | 1 1/8| 98    |\n| 19    | 8.5   | 1    | 81    | 1 1/4| 102   |\n\n**Guaranteed Analysis**\n\n|             | % Min | Dry   |             | % Max | Dry   |\n| :---------- | :---- | :---- | :---------- | :---- | :---- |\n| Protein     |       | 32.0  | Calcium     |       | 1.4   |\n| Fat         |       | 9.0   | Phosphorus  |       | 1.3   |\n| Fiber       |       | 9.3   | Sodium      |       | 1.68  |\n| Moisture    |       | 8.0   | Magnesium   |       | 0.08  |\n| EPA         |       | 0.12  | Vitamin E   |       | 38    |\n| DHA         |       | 0.07  |\n\n| Bag Size          | Cups per Bag |\n| :---------------- | :----------- |\n| 3.3 lb (1.5 kg)   | 16           |\n| 6.6 lb (3 kg)     | 33           |\n| 17.6 lb (8 kg)    | 90           |\n\n**INGREDIENTS:**\nFeline URINARY SO\u2122 MODERATE CALORIE dry\nChicken by-product meal, brewers rice, corn, corn gluten meal, powdered cellulose, wheat gluten, natural flavors, chicken fat, salt, fish oil, potassium chloride, calcium sulfate, egg product, sodium bisulfate, vegetable oil, sodium pyrophosphate, DL-methionine, fructooligosaccharides, monocalcium phosphate, choline chloride, vitamins [DL-alpha tocopherol acetate (source of vitamin E), niacin supplement, biotin, riboflavin supplement, D-calcium pantothenate, pyridoxine hydrochloride (vitamin B6), vitamin A acetate, thiamine mononitrate (vitamin B1), vitamin B12 supplement, folic acid, vitamin D3 supplement], taurine, trace minerals [zinc proteinate, zinc oxide, manganese proteinate, ferrous sulfate, manganous oxide, copper sulfate, calcium iodate, sodium selenite, copper proteinate), marigold extract (Tagetes erecta L.), L-carnitine, rosemary extract, preserved with mixed tocopherols and citric acid.\n\n**NUTRITION STATEMENT:**\nFeline URINARY SOT\u2122 MODERATE CALORIE dry is formulated to meet the nutritional levels established by the AAFCO Cat Food Nutrient Profiles for maintenance."
