      "description": "This page contains information for Royal Canin Urinary SO + Hydrolyzed Protein including recommended uses, ingredients, nutritional information, and feeding recommendations.",
      "contents": "## Royal Canin Urinary SO + Hydrolyzed Protein\n\n**Available in a 12 oz, 6.6 lb and 17.6 lb bag.**\n\n**Recommended for:**\n*   Lower urinary tract disease\n*   Dissolution of pure struvite uroliths\n*   Prevention of struvite urolithiasis\n*   Prevention of calcium oxalate urolithiasis\n*   Dietary elimination trial\n*   Adverse food reactions with dermatological and/or gastrointestinal signs\n\n**Not Recommended for:**\n*   Growth\n*   Reproduction\n\n**Nutritional Benefits:**\n\n*   **Urine Dilution:** Increasing the urine volume reduces the saturation of urine with calcium oxalate and struvite crystals.\n*   **Low RSS:** Relative Supersaturation (RSS) methodology predicts the crystallization potential of urine. RSS is used to develop diets that lower the concentration of ions contributing to struvite and calcium oxalate urolithiasis.\n*   **Hydrolyzed Protein:** Hydrolyzed soy protein, composed of low molecular weight peptides, is highly digestible and supports gastrointestinal and dermatological health.\n*   **Skin Barrier:** Formulated to support the skin's natural protective barrier for optimal skin health.\n\n**Additional Benefits:**\n\n*   This diet promotes a urinary environment unfavorable to the development of both struvite and calcium oxalate crystals\n*   RSS methodology predicts the crystallization potential and is used to develop diets that help prevent struvite and calcium oxalate stones. Low RSS values for struvite and calcium oxalate indicate that the diet can help prevent both struvite and calcium oxalate crystals and stones, as well as help dissolve pure struvite stones\n*   Promotes dilute urine undersaturated for struvite to help dissolve existing pure struvite stones and crystals and to help prevent new ones from forming\n*   Promotes dilute urine metastable for calcium oxalate to help prevent new calcium oxalate stones and crystals from forming\n*   Enriched with long chain omega-3 fatty acids, eicosapentaenoic and docosahexaenoic acids (EPA and DHA) that help minimize clinical signs of inflammation\n*   Single protein source (soy hydrolysate), single starch source (rice)\n*   Highly digestible with exceptional palatability\n\n**Notes:**\n*   As a result of increased thirst, cats will need free access to fresh water and access to areas that permit appropriate urination\n\n**Daily Feeding Recommendations:**\n\n| Body Weight (lb) | Body Weight (kg) | Tendency to Become Overweight (Cups) | Tendency to Become Overweight (Grams) | Ideal Weight (Cups) | Ideal Weight (Grams) |\n|---|---|---|---|---|---|\n| 4.4 | 2 | 1/4 | 27 | 3/8 | 34 |\n| 5.5 | 2.5 | 3/8 | 31 | 3/8 | 39 |\n| 6.6 | 3 | 3/8 | 36 | 1/2 | 45 |\n| 7.7 | 3.5 | 3/8 | 40 | 1/2 | 50 |\n| 8.8 | 4 | 1/2 | 44 | 5/8 | 55 |\n| 9.9 | 4.5 | 1/2 | 48 | 5/8 | 60 |\n| 11 | 5 | 1/2 | 51 | 3/4 | 64 |\n| 12 | 5.5 | 5/8 | 55 | 3/4 | 69 |\n| 13 | 6 | 5/8 | 59 | 3/4 | 73 |\n| 14 | 6.5 | 5/8 | 62 | 7/8 | 78 |\n| 15 | 7 | 3/4 | 65 | 7/8 | 82 |\n| 17 | 7.5 | 3/4 | 69 | 7/8 | 86 |\n| 18 | 8 | 3/4 | 72 | 1 | 90 |\n| 19 | 8.5 | 3/4 | 75 | 1 | 94 |\n\n**Guaranteed Analysis (Dry):**\n\n|        | %        |\n|----------------|-----------|\n| Protein        | Min 25.0 |\n| Fat            | Min 14.0 |\n| Fiber          | Max 7.1  |\n| Moisture       | Max 7.5  |\n| Calcium        | Max 0.84 |\n| Phosphorus     | Max 0.76 |\n| Magnesium      | Max 0.05 |\n| EPA          | Min 0.13 |\n| DHA          | Min .01  |\n| Sodium         | Max 1.69 |\n|Pantothenic Acid| Min 104  |\n| Niacin         | Min 340.9|\n\n**Bag Size:**\n\n| Bag Size         | Cups per Bag |\n|-----------------|--------------|\n| 12 oz (0.34 kg) | 3            |\n| 6.6 lb (3 kg)   | 30           |\n| 17.6 lb (8 kg)  | 82           |\n\n**Ingredients:**\n\nFeline Royal Canin Urinary SO + Hydrolyzed Protein Dry:\nBrewers rice, hydrolyzed soy protein, chicken fat, powdered cellulose, natural flavors, vegetable oil, dried chicory root, salt, calcium sulfate, fish oil, potassium chloride, sodium pyrophosphate, choline chloride, monocalcium phosphate, calcium carbonate, DL-methionine, sodium bisulfate, sodium aluminosilicate, fructooligosaccharides, vitamins [DL-alpha tocopherol acetate (source of vitamin E), niacin supplement, D-calcium pantothenate, biotin, pyridoxine hydrochloride (vitamin B6), riboflavin supplement, thiamine mononitrate (vitamin B1), vitamin A acetate, vitamin B12 supplement, folic acid, vitamin D3 supplement], taurine, GLA safflower oil, marigold extract (Tagetes erecta L.), trace minerals [zinc proteinate, zinc oxide, manganese proteinate, manganous oxide, copper sulfate, ferrous sulfate, sodium selenite, copper proteinate, calcium iodate], rosemary extract, preserved with mixed tocopherols and citric acid.\n\n**Nutrition Statement:**\n\nRoyal Canin Feline Urinary SO + Hydrolyzed Protein dry is formulated to meet the nutritional levels established by the AAFCO Cat Food Nutrient Profiles for maintenance."
