      "contents": "## Royal Canin Hydrolyzed Protein Canine Treats\n\n**Nutritional Benefits:**\n*   Skin Health: Supports the health of dogs with food sensitivities\n\n**Additional Benefits:**\n*   Promotes a urinary environment unfavorable to the development of both struvite and calcium oxalate crystals\n*   Single protein source (soy hydrolysate), single starch (rice)\n*   Highly digestible with exceptional palatability\n*   Formulated with a specific blend of nutrients to help strengthen the barrier effect of the skin\n*   Enriched with a blend of soluble and insoluble fibers to help manage digestive problems\n*   CALORIES: Only 5.8 kcal/treat\n\n**Most Appropriate for Dogs Fed:**\n*   Hydrolyzed Protein HP\n*   Hydrolyzed Protein PS\n*   Hydrolyzed Protein Moderate Calorie\n*   Hydrolyzed Protein Small Dog\n\n**May Also Be Appropriate for Dogs Fed:**\n*   Selected Protein PD, PR, PV, PW\n*   Skin Support\n*   Calm\n*   Glycobalance\u2122\n*   Multifunction Urinary SO + Hydrolyzed Protein\n*   Multifunction Satiety + Hydrolyzed Protein\n*   Advanced Mobility Support\n\n**Daily Feeding Recommendations:**\nTreats are intended to comprise no more than 10% of the daily caloric needs\n\n| Body Weight (lb) | Body Weight (kg) | Recommended Maximum Number of Treats Per Day |\n|---|---|---|\n| 4.4 | 2 | 3 |\n| 6.6 | 3 | 4 |\n| 8.8 | 4 | 5 |\n| 11 | 5 | 5 |\n| 13 | 6 | 6 |\n| 22 | 10 | 9 |\n| 26 | 12 | 10 |\n| 35 | 16 | 13 |\n| 44 | 20 | 15 |\n| 55 | 25 | 18 |\n| 66 | 30 | 21 |\n| 77 | 35 | 23 |\n| 88 | 40 | 26 |\n| 110 | 50 | 31 |\n| 132 | 60 | 35 |\n\n**Guaranteed Analysis:**\n\n|          | Dry (% Min) | Can  (% Max) |\n| -------- | ----------- | ----------- |\n| Protein  | 22.0        |             |\n| Fat      | 14.0        |             |\n| Fiber    |             | 2.6         |\n| Moisture |             | 10.0        |\n\n**Ingredients:**\nROYAL CANIN\u00ae Hydrolyzed Protein Canine Treats dry\nBrewers rice, hydrolyzed soy protein, chicken fat, natural flavors, vegetable oil, dried plain beet pulp, sodium silico aluminate, calcium sulfate, salt, fish oil, monocalcium phosphate, fructooligosaccharides, potassium chloride, calcium carbonate, sodium tripolyphosphate, DL-methionine, taurine, vitamins [DL-alpha tocopherol acetate (source of vitamin E), niacin supplement, L-ascorbyl-2-polyphosphate (source of vitamin C), D-calcium pantothenate, biotin, pyridoxine hydrochloride (vitamin B6), riboflavin supplement, thiamine mononitrate (vitamin B1), vitamin A acetate, vitamin B12 supplement, folic acid], choline chloride,trace minerals [zinc proteinate, zinc oxide, manganese proteinate, manganous oxide, copper sulfate, ferrous sulfate, sodium selenite, copper proteinate, calcium iodate], GLA safflower oil, marigold extract (Tagetes erecta L.), magnesium oxide, rosemary extract, preserved with mixed tocopherols and citric acid.\n\n**Nutrition Statement:**\nROYAL CANIN\u00ae Hydrolyzed Protein Canine Treats are intended for intermittent or supplemental feeding only."
