      "contents": "## Royal Canin Selected Protein PW\n\nAvailable in 7.7 lb and 30.8 lb bags.\n\n**RECOMMENDED FOR:**\n*   Dietary elimination trial\n*   Adverse food reactions with dermatological and/or gastrointestinal signs\n\n**NOT RECOMMENDED FOR:**\n*   Growth\n*   Reproduction\n\n**NUTRITIONAL BENEFITS:**\n\n*   **SELECTED PROTEIN PW:** The protein in the diet is provided by potato and fish which are appropriate for dogs with certain food sensitivities\n*   **SKIN BARRIER:** Formulated to support the skin's natural protective barrier for optimal skin health\n*   **EPA AND DHA:** Eicosapentaenoic and docosahexaenoic acids are long chain omega-3 fatty acids that promote a healthy skin and coat\n*   **DIGESTIVE HEALTH:** Helps regulate intestinal transit and supports a balanced digestive flora\n*   **ADDITIONAL BENEFITS:**\n    *   Enriched with a blend of antioxidants to help maintain a healthy immune system and to reduce DNA damage associated with cell aging\n    *   Enriched with long chain omega-3 fatty acids, eicosapentaenoic acid and docosahexaenoic acid (EPA and DHA) to help modulate inflammatory reactions\n    *   Chelated minerals improve digestive and metabolic utilization of trace elements\n\n**DAILY FEEDING RECOMMENDATIONS:**\n\n| Body Weight (lb) | Body Weight (kg) | Tendency to Become Overweight (Cups) | Tendency to Become Overweight (Grams) | Ideal Weight (Cups) | Ideal Weight (Grams) |\n| :---------------- | :---------------- | :----------------------------------- | :------------------------------------ | :---------------- | :------------------ |\n| 4.4               | 2                 | 1/2                                | 43                                    | 5/8               | 50                  |\n| 6.6               | 3                 | 5/8                                | 59                                    | 3/4               | 68                  |\n| 8.8               | 4                 | 7/8                                | 73                                    | 1                 | 84                  |\n| 11                | 5                 | 1                                  | 86                                    | 1 1/8             | 100                 |\n| 13                | 6                 | 1 1/8                              | 99                                    | 1 1/4             | 114                 |\n| 22                | 10                | 1 5/8                              | 145                                   | 1 7/8             | 168                 |\n| 26                | 12                | 1 7/8                              | 166                                   | 2 1/8             | 192                 |\n| 35                | 16                | 2 3/8                              | 206                                   | 2 3/4             | 239                 |\n| 44                | 20                | 2 3/4                              | 244                                   | 3 1/8             | 282                 |\n| 55                | 25                | 3 1/4                              | 288                                   | 3 3/4             | 334                 |\n| 66                | 30                | 3 3/4                              | 330                                   | 4 3/8             | 383                 |\n| 77                | 35                | 4 1/8                              | 371                                   | 4 7/8             | 429                 |\n| 88                | 40                | 4 5/8                              | 410                                   | 5 3/8             | 475                 |\n| 110               | 50                | 5 1/2                              | 485                                   | 6 3/8             | 561                 |\n| 132               | 60                | 6 1/4                              | 556                                   | 7 1/4             | 643                 |\n\n**Guaranteed Analysis (Dry Matter Basis):**\n\n| Nutrient           | % Min | % Max |\n| :----------------- | :---- | :---- |\n| Protein            | 22.0  |       |\n| Fat                | 12.0  |       |\n| Fiber              |       | 5.0   |\n| Moisture           |       | 10.0  |\n| EPA + DHA          | 0.27  |       |\n| Omega-3 fatty acids | 0.52  |       |\n\n*Not recognized as an essential nutrient by the AAFCO Dog Food Nutrient Profiles.\n\n**Bag Size:**\n\n*   7.7 lb (3.5 kg): 37 cups per bag\n*   30.8 lb (14 kg): 149 cups per bag\n\n**INGREDIENTS:**\nCanine SELECTED PROTEIN PW dry\nPotato, fish meal, potato protein, chicken fat, natural flavors, powdered cellulose, calcium carbonate, fish oil, monocalcium phosphate, choline chloride, fructooligosaccharides, sodium tripolyphosphate, vitamins [DL-alpha tocopherol acetate (source of vitamin E), niacin supplement, D-calcium pantothenate, biotin, pyridoxine hydrochloride (vitamin B6), riboflavin supplement, thiamine mononitrate (vitamin B1), vitamin A acetate, folic acid, vitamin B12 supplement, menadione sodium bisulfite complex, vitamin D3 supplement], taurine, DL-methionine, trace minerals [zinc proteinate, zinc oxide, ferrous sulfate, manganese proteinate, manganous oxide, copper sulfate, copper proteinate, calcium iodate], rosemary extract, preserved with mixed tocopherols and citric acid.\n\n**NUTRITION STATEMENT:**\nROYAL CANIN\u00ae Canine SELECTED PROTEIN PW dry is formulated to meet the nutritional levels established by the AAFCO Dog Food Nutrient Profiles for maintenance.\n\n**NOTES:**\n*   The duration of a dermatologic dietary elimination trial is 6-8 weeks and ideally up to 12 weeks. In most cases, improvement occurs in the first 6-8 weeks, while maximum improvement and resolution of clinical signs may take 12 weeks or occasionally longer\n*   Clinicians may choose to complement this diet with Royal Canin\u00ae Hydrolyzed Protein Canine Treats at 10% or less of total daily calories\n*   Do not offer treats other than Royal Canin\u00ae Hydrolyzed Protein Canine Treats. Do not offer snacks, human foods, flavored medications or foods to hide medications, flavored toothpaste or nutritional supplements during the dietary elimination trial\n*   In cases of chronic disease, it may be necessary or beneficial to feed this diet for the rest of the pet's life or until other conditions require a dietary change\n*   A thorough diet history is needed to select a novel protein diet for an individual patient\n"
