      "description": "This page provides information about Royal Canin Hydrolyzed Protein HP, including recommended uses, nutritional benefits, feeding recommendations, ingredients, and guaranteed analysis.",
      "contents": "## Royal Canin Hydrolyzed Protein HP\n\n**Available in:** 12 oz, 7.7 lb and 17.6 lb bags.\n\n**Recommended for:**\n*   Dietary elimination trial\n*   Adverse food reactions with dermatological and/or gastrointestinal signs\n\n**Not recommended for:**\n*   Growth\n*   Reproduction\n\n**Nutritional Benefits:**\n\n*   **Hydrolyzed Protein:** Hydrolyzed soy protein, composed of low molecular weight peptides, is highly digestible and supports gastrointestinal and dermatological health.\n*   **Skin Barrier:** Formulated to support the skin's natural protective barrier.\n*   **EPA and DHA:** Enriched with EPA+DHA fatty acids to help maintain a healthy skin & digestion.\n*   **Digestive Health:** Helps regulate intestinal transit and supports a balanced digestive flora.\n\n**Additional Benefits:**\n\n*   This diet promotes a urinary environment unfavorable to the development of both struvite and calcium oxalate crystals.\n*   Single protein source (soy hydrolysate), single starch source (rice)\n*   Highly digestible with exceptional palatability\n*   Enriched with a blend of antioxidants to help maintain a healthy immune system and to help reduce DNA damage associated with cell aging\n*   Formulated with a specific blend of nutrients to help strengthen the barrier effect of the skin\n*   Chelated minerals improve digestive and metabolic utilization of trace elements\n\n**Daily Feeding Recommendations:**\n\n| Body Weight (lb) | Body Weight (kg) | Tendency to Become Overweight (Cups) | Tendency to Become Overweight (Grams) | Ideal Weight (Cups) | Ideal Weight (Grams) |\n|---|---|---|---|---|---|\n| 4.4 | 2 | 1/4 | 25 | 3/8 | 31 |\n| 5.5 | 2.5 | 3/8 | 29 | 1/2 | 37 |\n| 6.6 | 3 | 3/8 | 33 | 1/2 | 42 |\n| 7.7 | 3.5 | 1/2 | 37 | 1/2 | 47 |\n| 8.8 | 4 | 1/2 | 41 | 5/8 | 51 |\n| 9.9 | 4.5 | 1/2 | 44 | 5/8 | 56 |\n| 11 | 5 | 5/8 | 48 | 3/4 | 60 |\n| 12 | 5.5 | 5/8 | 51 | 3/4 | 64 |\n| 13 | 6 | 5/8 | 55 | 3/4 | 68 |\n| 14 | 6.5 | 3/4 | 58 | 7/8 | 72 |\n| 15 | 7 | 3/4 | 61 | 7/8 | 76 |\n| 17 | 7.5 | 3/4 | 64 | 1 | 80 |\n| 18 | 8 | 3/4 | 67 | 1 | 84 |\n| 19 | 8.5 | 7/8 | 70 | 1 | 88 |\n\n**Guaranteed Analysis:**\n\n|          | Dry %Min |\n|----------|--------|\n| Protein  | 24.1   |\n| Fat      | 18.0   |\n| Fiber    | 5.9    |\n| Moisture | 7.5    |\n\n**Guaranteed Analysis:**\n\n|                     | Dry %Min |\n|---------------------|--------|\n| EPA + DHA             | 0.20   |\n| Omega-3 fatty acids* | 0.44   |\n| Ascorbic Acid*       | 160 mg/kg   |\n| Vitamin E             | 434 IU/kg   |\n\n*Not recognized as an essential nutrient by the AAFCO Cat Food Nutrient Profiles.\n\n**Bag Size**\n\n| Bag Size          | Cups per Bag |\n|-----------------|--------------|\n| 7.7 lb (3.5 kg) | 39           |\n| 17.6 lb (8 kg)  | 90           |\n\n**Ingredients:**\n\nBrewers rice, hydrolyzed soy protein, chicken fat, powdered cellulose, natural flavors, dried plain beet pulp, calcium sulfate, fish oil, potassium chloride, vegetable oil, DL-methionine, monocalcium phosphate, sodium pyrophosphate, salt, sodium aluminosilicate, fructooligosaccharides, calcium carbonate, choline chloride, vitamins [DL-alpha tocopherol acetate (source of vitamin E), niacin supplement, L-ascorbyl-2-polyphosphate (source of vitamin C), D-calcium pantothenate, biotin, pyridoxine hydrochloride (vitamin B6), riboflavin supplement, thiamine mononitrate (vitamin B1), vitamin A acetate, vitamin B12 supplement, folic acid, vitamin D3 supplement], taurine, GLA safflower oil, marigold extract (Tagetes erecta L.), trace minerals [zinc proteinate, zinc oxide, manganese proteinate, manganous oxide, copper sulfate, ferrous sulfate, sodium selenite, copper proteinate, calcium iodate], magnesium oxide, rosemary extract, preserved with mixed tocopherols and citric acid.\n\n**Nutrition Statement:**\n\nRoyal Canin Feline Hydrolyzed Protein HP dry is formulated to meet the nutritional levels established by the AAFCO Cat Food Nutrient Profiles for maintenance.\n\n**Notes:**\n\n*   The duration of a dermatologic dietary elimination trial is 6-8 weeks and ideally up to 12 weeks. In most cases, improvement occurs in the first 6-8 weeks while maximum improvement and resolution of clinical signs may take 12 weeks or occasionally longer\n*   Diet can be complemented with Royal Canin\u00ae Hydrolyzed Protein Feline Treats at 10% or less of total daily calories\n*   Do not offer treats other than Royal Canin\u00ae Hydrolyzed Protein Feline Treats. Do not offer snacks, human foods, flavored medications or foods to hide medications, flavored toothpaste or nutritional supplements during the dietary elimination trial\n*   In cases of chronic disease, it may be necessary or beneficial to feed this diet for the rest of the pet's life or until other conditions require a dietary change"
