      "description": "This page provides information about Royal Canin Hydrolyzed Protein Feline Treats, including nutritional benefits, ingredients, and feeding recommendations.",
      "contents": "## Royal Canin Hydrolyzed Protein Feline Treats\n\n**Nutritional Benefits:**\n*   Skin Health: Supports the health of cats with food sensitivities\n\n**Additional Benefits:**\n*   This product promotes a urinary environment unfavorable to the development of both struvite and calcium oxalate crystals.\n*   Specific nutrient blend to help regulate intestinal transit and to help support digestive flora.\n*   Single protein source (soy hydrolysate), single starch (rice).\n*   Highly digestible with exceptional palatability.\n*   Formulated with a specific blend of nutrients to help strengthen the barrier effect of the skin.\n*   CALORIES: Only 1.6 kcal/treat\n\n**Most appropriate for cats fed:**\n*   Hydrolyzed Protein HP\n\n**May also be appropriate for cats fed:**\n*   Selected Protein PD, PR, PV\n*   Calm\n*   Glycobalance\n*   Multifunction Urinary SO + Hydrolyzed Protein\n*   Multifunction Satiety + Hydrolyzed Protein\n\n**Daily Feeding Recommendations:**\nTreats are intended to comprise no more than 10% of the daily caloric needs\n\n| Body Weight (lb) | Body Weight (kg) | Recommended Maximum Number of Treats Per Day |\n|---|---|---|\n| 3.3 | 1.5 | 5 |\n| 4.4 | 2 | 6 |\n| 5.5 | 2.5 | 7 |\n| 6.6 | 3 | 8 |\n| 7.7 | 3.5 | 9 |\n| 8.8 | 4 | 10 |\n| 9.9 | 4.5 | 11 |\n| 11 | 5 | 12 |\n| 12 | 5.5 | 13 |\n| 13 | 6 | 14 |\n| 14 | 6.5 | 14 |\n| 15 | 7 | 15 |\n| 17 | 7.5 | 16 |\n| 18 | 8 | 17 |\n| 19 | 8.5 | 17 |\n\n**Guaranteed Analysis (Dry):**\n| Nutrient | % |\n|---|---|\n| Protein | Min 23.5 |\n| Fat | Min 18.0 |\n| Fiber | Max 5.7 |\n| Moisture | Max 8.0 |\n\n**Ingredients:**\nRoyal Canin\u00ae Hydrolyzed Protein Feline Treats dry\nBrewers rice, hydrolyzed soy protein, chicken fat, powdered cellulose, natural flavors, dried plain beet pulp, calcium sulfate, fish oil, potassium chloride, monocalcium phosphate, vegetable oil, DL-methionine, sodium pyrophosphate, sodium silico aluminate, salt, fructooligosaccharides, choline chloride, taurine, calcium carbonate, vitamins [DL-alpha tocopherol acetate (source of vitamin E), niacin supplement, L-ascorbyl-2-polyphosphate (source of vitamin C), D-calcium pantothenate, biotin, pyridoxine hydrochloride (vitamin B6), riboflavin supplement, thiamine mononitrate (vitamin B1), vitamin A acetate, vitamin B12 supplement, folic acid], trace minerals [zinc proteinate, zinc oxide, manganese proteinate, manganous oxide, copper sulfate, ferrous sulfate, sodium selenite, copper proteinate, calcium iodate], marigold extract (Tagetes erecta L.), magnesium oxide, rosemary extract, preserved with mixed tocopherols and citric acid.\n\n**Nutrition Statement:**\nRoyal Canin\u00ae Hydrolyzed Protein Feline Treats are intended for intermittent or supplemental feeding only."
