      "contents": "## Royal Canin SELECTED PROTEIN PV\n\n**Recommended for:**\n*   Dietary elimination trial\n*   Adverse food reaction with dermatological and/or gastrointestinal signs\n*   Growth\n\n**Nutritional Benefits:**\n*   **Selected Protein:** The protein in the diet is provided by peas, venison and hydrolyzed soy which are appropriate for cats with certain food sensitivities\n*   **Skin Barrier:** Formulated to support the skin's natural protective barrier for optimal skin health\n*   **EPA and DHA:** Eicosapentaenoic and docosahexaenoic acids are long chain omega-3 fatty acids that promote a healthy skin and coat\n*   **Digestive Health:** Formulated with a precise combination of nutrients for digestive health\n*   **Additional Benefits:** Enriched with antioxidants to help maintain a healthy immune system and to reduce DNA damage associated with cell aging. Chelated minerals improve digestive and metabolic utilization of trace elements.\n\n**Daily Feeding Recommendations:**\n\n| Body Weight (lb) | Body Weight (kg) | Tendency to Become Overweight (Cups) | Tendency to Become Overweight (Grams) | Ideal Weight (Cups) | Ideal Weight (Grams) |\n|-------------------|-------------------|---------------------------------------|-----------------------------------------|----------------------|------------------------|\n| 4.4               | 2                 | 1/4                                   | 27                                      | 3/8                  | 34                     |\n| 5.5               | 2.5               | 3/8                                   | 32                                      | 3/8                  | 40                     |\n| 6.6               | 3                 | 3/8                                   | 37                                      | 1/2                  | 46                     |\n| 7.7               | 3.5               | 1/2                                   | 41                                      | 1/2                  | 51                     |\n| 8.8               | 4                 | 1/2                                   | 45                                      | 5/8                  | 56                     |\n| 9.9               | 4.5               | 1/2                                   | 49                                      | 5/8                  | 61                     |\n| 11                | 5                 | 5/8                                   | 53                                      | 3/4                  | 66                     |\n| 12                | 5.5               | 5/8                                   | 56                                      | 3/4                  | 70                     |\n| 13                | 6                 | 5/8                                   | 60                                      | 3/4                  | 75                     |\n| 14                | 6.5               | 5/8                                   | 63                                      | 7/8                  | 79                     |\n| 15                | 7                 | 3/4                                   | 67                                      | 7/8                  | 84                     |\n| 17                | 7.5               | 3/4                                   | 70                                      | 1                    | 88                     |\n| 18                | 8                 | 3/4                                   | 73                                      | 1                    | 92                     |\n| 19                | 8.5               | 7/8                                   | 77                                      | 1                    | 96                     |\n\n**Guaranteed Analysis (Dry Matter Basis):**\n\n| Nutrient          | % Min | Nutrient             | % Min  |\n|-------------------|-------|----------------------|--------|\n| Protein           | 30.0  | EPA + DHA            | 0.12   |\n| Fat               | 11.0  | Omega-3 fatty acids* | 0.29   |\n| Fiber             | 5.7   | Ascorbic Acid*       | 160 mg/kg |\n| Moisture          | 8.0   | Vitamin E            | 350 IU/kg |\n\n*Not recognized as an essential nutrient by the AAFCO Cat Food Nutrient Profiles.\n\n**Ingredients:**\nPeas, pea protein, venison meal, coconut oil, natural flavors, hydrolyzed soy protein, vegetable oil, sodium bisulfate, DL-methionine, calcium sulfate, fish oil, choline chloride, sodium pyrophosphate, salt, potassium chloride, taurine, vitamins [DL-alpha tocopherol acetate (source of vitamin E), L-ascorbyl-2-polyphosphate (source of vitamin C), niacin supplement, biotin, riboflavin supplement, D-calcium pantothenate, pyridoxine hydrochloride (vitamin B6), vitamin A acetate, thiamine mononitrate (vitamin B1), vitamin B12 supplement, folic acid, vitamin D3 supplement], monocalcium phosphate, trace minerals [zinc proteinate, zinc oxide, manganese proteinate, ferrous sulfate, manganous oxide, copper sulfate, sodium selenite, calcium iodate, copper proteinate), rosemary extract, preserved with mixed tocopherols and citric acid.\n\n**Nutrition Statement:**\nROYAL CANIN Feline SELECTED PROTEIN PV dry is formulated to meet the nutritional levels established by the AAFCO Cat Food Nutrient Profiles for growth and maintenance.\n\n**Notes:**\n*   The duration of a dermatologic dietary elimination trial is 6-8 weeks and ideally up to 12 weeks. In most cases, improvement occurs in the first 6-8 weeks while maximum improvement and resolution of clinical signs may take 12 weeks or occasionally longer\n*   Clinicians may choose to complement this diet with Royal Canin\u00ae Hydrolyzed Protein Feline Treats at 10% or less of total daily calories\n*   Do not offer treats other than Royal Canin\u00ae Hydrolyzed Protein Feline Treats. Do not offer snacks, human foods, flavored medications or foods to hide medications, flavored toothpaste or nutritional supplements during the dietary elimination trial\n*   In cases of chronic disease, it may be necessary or beneficial to feed this diet for the rest of the pet's life or until other conditions require a dietary change\n*   A thorough diet history is needed to select a novel protein diet for an individual patient."
