      "contents": "## Royal Canin Feline SATIETY\u2122 SUPPORT WEIGHT MANAGEMENT\n\nAvailable in 12 oz, 7.7 lb and 18.7 lb bags.\n\n**RECOMMENDED FOR:**\n*   Weight loss in overweight or obese adult cats\n*   Weight maintenance after weight loss\n*   Fiber-responsive gastrointestinal disease\n\n**NOT RECOMMENDED FOR:**\n*   Growth\n*   Reproduction\n\n**NUTRITIONAL BENEFITS:**\n\n*   **EFFECTIVE WEIGHT MANAGEMENT**\n    Provides safe weight loss and helps avoid weight regain. 97% of cats lost weight in 3 months.\n*   **BEGGING CONTROL**\n    High natural fiber level keeps cats satisfied between meals. Helps control begging in 82% of cats during weight loss.\n*   **MUSCLE MASS MAINTENANCE**\n    High protein content helps support healthy weight loss while maintaining muscle mass.\n\n**ADDITIONAL BENEFITS:**\n\n*   This diet promotes a urinary environment unfavorable to the development of both struvite and calcium oxalate crystals.\n*   High protein and high fiber formulation helps cats feel full between meals and helps reduce begging and vocalization behaviors.\n*   Supplemented with L-carnitine to help promote fat metabolism.\n*   Enriched with a blend of antioxidants to help maintain a healthy immune system and to reduce DNA damage associated with cell aging.\n*   Chelated minerals improve digestive and metabolic utilization of trace elements.\n\n**DAILY FEEDING RECOMMENDATIONS:**\n\n| Target Weight (lb) | Target Weight (kg) | Weight Loss (Cups) | Weight Loss (Grams) | Post Weight-loss Maintenance (Cups) | Post Weight-loss Maintenance (Grams) |\n|---|---|---|---|---|---|\n| 4.4 | 2 | 3/8 | 28 | 3/8 | 30 |\n| 5.5 | 2.5 | 3/8 | 33 | 1/2 | 35 |\n| 6.6 | 3 | 1/2 | 38 | 1/2 | 40 |\n| 7.7 | 3.5 | 1/2 | 42 | 5/8 | 45 |\n| 8.8 | 4 | 5/8 | 46 | 5/8 | 49 |\n| 9.9 | 4.5 | 5/8 | 50 | 5/8 | 53 |\n| 11 | 5 | 5/8 | 54 | 3/4 | 57 |\n| 12 | 5.5 | 3/4 | 58 | 3/4 | 61 |\n| 13 | 6 | 3/4 | 62 | 7/8 | 65 |\n| 14 | 6.5 | 7/8 | 65 | 7/8 | 69 |\n| 15 | 7 | 7/8 | 69 | 7/8 | 73 |\n| 17 | 7.5 | 7/8 | 72 | 1 | 77 |\n| 18 | 8 | 1 | 76 | 1 | 80 |\n| 19 | 8.5 | 1 | 79 | 1 | 84 |\n\n**Guaranteed Analysis:**\n\n| Nutrient | % Min/Max | Dry Matter Basis |\n|---|---|---|\n| Protein | 32.0% Min |  |\n| Fat | 8.6% Min / 10.0% Max |  |\n| Fiber | 12.1% Min / 16.1% Max |  |\n| Moisture | 8.0% Max |  |\n| Vitamin E | 525 IU/kg Min |  |\n| Ascorbic acid* | 240 mg/kg Min |  |\n| L-carnitine* | 140 mg/kg Min |  |\n| Glucosamine* | 371.3 mg/kg Min |  |\n| Chondroitin sulfate* | 4 mg/kg Min |  |\n\n*Not recognized as an essential nutrient by the AAFCO Cat Food Nutrient Profiles.\n\n**Bag Size**\n\n| Bag Size | Cups per Bag |\n|---|---|\n| 12 oz (340 g) | 4 |\n| 7.7 lb (3.5 kg) | 41 |\n| 18.7 lb (8.5 kg) | 101 |\n\n**INGREDIENTS:**\n\nRoyal Canin Feline SATIETY\u2122 SUPPORT WEIGHT MANAGEMENT dry\n\nChicken by-product meal, powdered cellulose, tapioca, wheat, wheat gluten, corn gluten meal, natural flavors, dried chicory root, chicken fat, potassium chloride, psyllium seed husk, calcium sulfate, sodium bisulfate, fish oil, sodium pyrophosphate, monocalcium phosphate, choline chloride, vitamins [DL-alpha tocopherol acetate (source of vitamin E), L-ascorbyl-2-polyphosphate (source of vitamin C), niacin supplement, biotin, riboflavin supplement, D-calcium pantothenate, pyridoxine hydrochloride (vitamin B6), vitamin A acetate, thiamine mononitrate (vitamin B1), vitamin B12 supplement, folic acid, vitamin D3 supplement), taurine, marigold extract (Tagetes erecta L.), salt, trace minerals [zinc proteinate, zinc oxide, manganese proteinate, ferrous sulfate, manganous oxide, copper sulfate, calcium iodate, sodium selenite, copper proteinate], glucosamine hydrochloride, L-carnitine, chondroitin sulfate, rosemary extract, preserved with mixed tocopherols and citric acid.\n\n**NUTRITION STATEMENT:**\n\nROYAL CANIN\u00ae Feline SATIETY\u2122 SUPPORT WEIGHT MANAGEMENT dry is formulated to meet the nutritional levels established by the AAFCO Cat Food Nutrient Profiles for maintenance."
