      "description": "This page provides information about Royal Canin Satiety Feline Treats, including nutritional benefits, feeding recommendations, ingredients, and guaranteed analysis.",
      "contents": "## SATIETY\u2122 FELINE TREATS\n\n![Royal Canin Satiety Feline Treats Image] Available in a 7.7 oz (220 g) bag.\n\n**MOST APPROPRIATE FOR CATS FED:**\n*   Satiety\u2122 Support Weight Management\n\n**MAY ALSO BE APPROPRIATE FOR CATS FED:**\n*   Calm\n*   Glycobalance\n*   Multifunction Urinary + Satiety\n\n**NUTRITIONAL BENEFITS:**\n\n*   LOW CALORIE\n    Only 0.9 kcal per treat to support a healthy weight\n\n**ADDITIONAL BENEFITS:**\n\n*   This product promotes a urinary environment unfavorable to the development of both struvite and calcium oxalate crystals.\n*   High protein and high fiber formulation helps pets feel full between meals and helps reduce begging\n*   Supplemented with L-carnitine to help promote fat metabolism\n*   Nutrients to help support healthy bones and joints placed under stress by excess body weight\n\n**DAILY FEEDING RECOMMENDATIONS:**\nTreats are intended to comprise no more than 10% of the daily caloric needs\n\n+-----------------+-------------+--------------------------+\n| Target Weight   |             | Daily Feeding            |\n+-----------------+-------------+--------------------------+\n| lb              | kg          | Weight Loss   | Post Weight-loss |\n|                 |             | Treats        | Maintenance      |\n|                 |             |               | Treats           |\n+-----------------+-------------+---------------+------------------+\n| 4.4             | 2           | 8             | 8                |\n+-----------------+-------------+---------------+------------------+\n| 5.5             | 2.5         | 9             | 9                |\n+-----------------+-------------+---------------+------------------+\n| 6.6             | 3           | 10            | 10               |\n+-----------------+-------------+---------------+------------------+\n| 7.7             | 3.5         | 12            | 12               |\n+-----------------+-------------+---------------+------------------+\n| 8.8             | 4           | 13            | 13               |\n+-----------------+-------------+---------------+------------------+\n| 9.9             | 4.5         | 14            | 14               |\n+-----------------+-------------+---------------+------------------+\n| 11              | 5           | 15            | 15               |\n+-----------------+-------------+---------------+------------------+\n| 12              | 5.5         | 16            | 16               |\n+-----------------+-------------+---------------+------------------+\n| 13              | 6           | 17            | 17               |\n+-----------------+-------------+---------------+------------------+\n| 14              | 6.5         | 18            | 18               |\n+-----------------+-------------+---------------+------------------+\n| 15              | 7           | 19            | 19               |\n+-----------------+-------------+---------------+------------------+\n| 17              | 7.5         | 20            | 20               |\n+-----------------+-------------+---------------+------------------+\n| 18              | 8           | 21            | 21               |\n+-----------------+-------------+---------------+------------------+\n| 19              | 8.5         | 22            | 22               |\n+-----------------+-------------+---------------+------------------+\n\n**Guaranteed Analysis**\n\n|               | Dry     |\n| :------------ | :------ |\n| Protein       | 32% Min |\n| Fat           | 7.0% Min|\n| Fiber         | 16.1% Max|\n| Moisture      | 8.0% Max |\n\n|                    | Dry        |\n| :----------------- | :--------- |\n| L-carnitine*       | 140 mg/kg Min|\n| Glucosamine*       | 371.3 mg/kg Min|\n| Chondroitin sulfate* | 4 mg/kg Min  |\n\n*Not recognized as an essential nutrient by the AAFCO Cat Food Nutrient Profiles.\n\n**INGREDIENTS:**\nROYAL CANIN SATIETY\u2122 FELINE TREATS dry\nChicken by-product meal, powdered cellulose, tapioca, wheat, wheat gluten, corn gluten meal, natural flavors, dried chicory root, chicken fat, potassium chloride, psyllium seed husk, calcium sulfate, sodium bisulfate, fish oil, sodium pyrophosphate, monocalcium phosphate, choline chloride, vitamins [DL-alpha tocopherol acetate (source of vitamin E), L-ascorbyl-2-polyphosphate (source of vitamin C), niacin supplement, biotin, riboflavin supplement, D-calcium pantothenate, pyridoxine hydrochloride (vitamin B6), vitamin A acetate, thiamine mononitrate (vitamin B1), vitamin B12 supplement, folic acid, vitamin D3 supplement], taurine, marigold extract (Tagetes erecta L.), salt, trace minerals [zinc proteinate, zinc oxide, manganese proteinate, ferrous sulfate, manganous oxide, copper sulfate, calcium iodate, sodium selenite, copper proteinate], glucosamine hydrochloride, L-carnitine, chondroitin sulfate, rosemary extract, preserved with mixed tocopherols and citric acid.\n\n**NUTRITION STATEMENT:**\nROYAL CANIN SATIETY\u2122 Feline Treats are intended for intermittent or supplemental feeding only.\n"
