      "page_number": 129,
      "document": "Royal_Canin.pdf",
      "description": "This page provides information about Royal Canin Gastrointestinal Puppy food, including its recommended uses, nutritional benefits, guaranteed analysis, ingredients, and nutrition statement.",
      "contents": "## Royal Canin Gastrointestinal Puppy\n\n**Recommended for:**\n*   Acute and chronic diarrhea in puppies\n*   Convalescence\n*   Gastroenteritis\n*   Colitis\n*   Puppies with poor body condition scores\n*   Intestinal parasites\n*   Gestation/lactation\n\n**Not recommended for:**\n*   Pancreatitis\n*   Hyperlipidemia\n\n**Nutritional Benefits:**\n*   Optimal Growth: High energy formula with adapted levels of nutrients (including protein and calcium) to meet the needs of a growing puppy\n*   Digestive Support: A combination of highly digestible proteins, balanced fibers including prebiotics and EPA+DHA helps to support digestive health\n*   Easy Rehydration: Kibble that can be easily rehydrated to facilitate food intake in puppies with decreased appetites and help transition from milk to solid food\n\n**Additional Benefits:**\n*   Eicosapentaenoic acid and docosahexaenoic acid (EPA and DHA) help modulate inflammation and support optimal learning and development in puppies\n*   A precise blend of antioxidants helps support a healthy immune system\n*   Enriched with a blend of soluble and insoluble fibers to help manage digestive problems such as diarrhea\n*   Highly digestible ingredients help ensure optimal absorption of nutrients\n\n**Notes:**\n*   The immature digestive systems of puppies make them more prone to digestive sensitivities\n*   In cases of acute disease, nutritional management may need to continue until the patient's gastrointestinal signs have completely resolved\n*   In order to optimize digestive transit, the recommended daily intake should be divided into several small meals\n*   This product is also suitable for mothers during gestation and lactation\n\n**Guaranteed Analysis:**\n\n|          | % Min | Dry  |\n|----------|-------|------|\n| Protein  | % Min | 27.0 |\n| Fat      | % Min | 20.0 |\n| Fiber    | % Max | 3.6  |\n| Moisture | % Max | 10.0 |\n| EPA + DHA| % Min | 0.2  |\n\n|                | % Min | Dry  |\n|----------------|-------|------|\n| Calcium        | % Min | 1.08 |\n| Potassium     | % Min | 0.6  |\n| Sodium         | % Min | 0.4  |\n| Vitamin E      | IU/kg Min  | 350  |\n| Ascorbic acid* | mg/kg Min | 320  |\n\n*Not recognized as an essential nutrient by the AAFCO Dog Food Nutrient Profiles.\n\n**Bag Size**\n\n| Size          | Cups per Bag |\n|---------------|--------------|\n| 8.8 lb (4 kg) | 35           |\n| 22 lb (10 kg)| 88           |\n\n**Ingredients:**\nCanine GASTROINTESTINAL PUPPY dry\nBrewers rice, chicken by-product meal, chicken fat, corn gluten meal, natural flavors, dried plain beet pulp, wheat gluten, egg product, sodium silico aluminate, monocalcium phosphate, fish oil, vegetable oil, pea fiber, potassium chloride, taurine, salt, powdered psyllium seed husk, fructooligosaccharides, hydrolyzed yeast (source of betaglucans), DL-methionine, calcium carbonate, vitamins [DL-alpha tocopherol acetate (source of vitamin E), L-ascorbyl-2-polyphosphate (source of vitamin C), biotin, D-calcium pantothenate, vitamin A acetate, niacin supplement, pyridoxine hydrochloride (vitamin B6), thiamine mononitrate (vitamin B1), vitamin B12 supplement, riboflavin supplement, vitamin D3 supplement, folic acid], choline chloride, L-lysine, trace minerals [zinc proteinate, manganese proteinate, zinc oxide, ferrous sulfate, manganous oxide, copper sulfate, calcium iodate, sodium selenite, copper proteinate], marigold extract (Tagetes erecta L.), carotene, rosemary extract, preserved with mixed tocopherols and citric acid.\n\n**Nutrition Statement:**\nROYAL CANIN\u00ae Canine GASTROINTESTINAL PUPPY dry is formulated to meet the nutritional levels established by the AAFCO Dog Food Nutrient Profiles for growth, including growth of large size dogs (70 lb. or more as an adult), gestation and lactation."
