      "contents": "## Royal Canin Gastrointestinal Low Fat\n\n**Recommended for:**\n*   Gastroenteritis\n*   Colitis\n*   Lymphangiectasia\n*   Hyperlipidemia\n*   Acute and chronic vomiting and/or diarrhea\n*   Acute and chronic pancreatitis\n*   Inflammatory bowel disease/chronic enteropathy\n*   Protein-losing enteropathy\n*   Exocrine pancreatic insufficiency\n\n**Not Recommended for:**\n*   Growth\n*   Reproduction\n\n**Nutritional Benefits:**\n*   Low Fat: For the nutritional management of dogs needing a fat-restricted diet\n*   Fiber Balance: Adapted fiber level to provide appropriate energy levels for weight maintenance despite fat restriction\n*   Digestive Support: A combination of highly digestible proteins, balanced fibers including prebiotics and EPA+DHA helps to support digestive health\n\n**Additional Benefits:**\n*   Highly digestible ingredients help ensure optimal absorption of nutrients\n*   Enriched with a blend of soluble and insoluble fibers to help manage digestive problems such as diarrhea\n*   Chelated minerals improve digestive and metabolic utilization of trace elements\n\n**Daily Feeding Recommendations:**\n\n| Body Weight (lb) | Body Weight (kg) | Underweight (Cups) | Underweight (Grams) | Ideal Weight (Cups) | Ideal Weight (Grams) |\n|---|---|---|---|---|---|\n| 4.4 | 2 | 3/4 | 61 | 3/4 | 54 |\n| 6.6 | 3 | 1 1/8 | 83 | 1 | 73 |\n| 8.8 | 4 | 1 3/8 | 102 | 1 1/8 | 90 |\n| 11 | 5 | 1 5/8 | 121 | 1 3/8 | 107 |\n| 13 | 6 | 1 3/4 | 139 | 1 5/8 | 122 |\n| 22 | 10 | 2 5/8 | 204 | 2 3/8 | 179 |\n| 26 | 12 | 3 | 233 | 2 5/8 | 205 |\n| 35 | 16 | 3 3/4 | 290 | 3 3/8 | 255 |\n| 44 | 20 | 4 1/2 | 342 | 3 7/8 | 301 |\n| 55 | 25 | 5 1/4 | 405 | 4 5/8 | 356 |\n| 66 | 30 | 6 | 464 | 5 3/8 | 408 |\n| 77 | 35 | 6 3/4 | 521 | 6 | 458 |\n| 88 | 40 | 7 1/2 | 576 | 6 5/8 | 507 |\n| 110 | 50 | 8 7/8 | 681 | 7 3/4 | 599 |\n| 132 | 60 | 10 1/8 | 780 | 9 | 687 |\n\n**Guaranteed Analysis (Dry):**\n\n| Nutrient | % Min/Max |\n|---|---|\n| Protein | 20.0% Min |\n| Fat | 5.5% Min |\n| Fat | 8.5% Max |\n| Fiber | 3.9% Max |\n| Moisture | 10.0% Max |\n| EPA + DHA | 0.09% Min |\n| Potassium | 0.6% Min |\n| Sodium | 0.25% Min |\n| Vitamin E | 315 IU/kg Min |\n| Ascorbic acid* | 240 mg/kg Min |\n\n*Not recognized as an essential nutrient by the AAFCO Dog Food Nutrient Profiles.\n\n**Bag Size:**\n\n| Bag Size | Cups per Bag |\n|---|---|\n| 1.5 lb (700 g) | 8 |\n| 6.6 lb (3 kg) | 36 |\n| 17.6 lb (8 kg) | 98 |\n| 26.4 lb (12 kg) | 147 |\n| 28.6 lb (13 kg) | 159 |\n\nAvailable in 1.5 lb, 6.6 lb, 17.6 lb and 28.6 lb bags. (26.4 lb Kennel Pack available)\n\n**Ingredients:**\nBrewers rice, chicken by-product meal, wheat, barley, natural flavors, dried plain beet pulp, chicken fat, salt, fish oil, calcium carbonate, monocalcium phosphate, potassium chloride, psyllium seed husk, sodium silico aluminate, fructooligosaccharides, hydrolyzed yeast, taurine, vitamins [DL-alpha tocopherol acetate (source of vitamin E), L-ascorbyl-2-polyphosphate (source of vitamin C), biotin, D-calcium pantothenate, vitamin A acetate, pyridoxine hydrochloride (vitamin B6), niacin supplement, folic acid, thiamine mononitrate (vitamin B1), vitamin B12 supplement, riboflavin supplement, vitamin D3 supplement), DL-methionine, choline chloride, L-lysine, marigold extract (Tagetes erecta L.), trace minerals [zinc proteinate, zinc oxide, ferrous sulfate, manganese proteinate, manganous oxide, copper sulfate, calcium iodate, sodium selenite, copper proteinate], rosemary extract, preserved with mixed tocopherols and citric acid.\n\n**Nutrition Statement:**\nRoyal Canin Canine Gastrointestinal Low Fat dry is formulated to meet the nutritional levels established by the AAFCO Dog Food Nutrient Profiles for maintenance.\n\n**Notes:**\n*   The recommended feeding duration can vary depending on the severity of gastrointestinal signs\n*   In cases of acute disease, nutritional management may need to continue until the patient's gastrointestinal signs have completely resolved\n*   In order to optimize digestive transit, the recommended daily intake should be divided into several small meals\n"
