      "description": "This page provides information on Royal Canin Hepatic, including nutritional benefits, daily feeding recommendations, guaranteed analysis, ingredients, and a nutrition statement.",
      "contents": "## HEPATIC\n\n**RECOMMENDED FOR:**\n*   Certain liver diseases\n*   Hepatic encephalopathy\n*   Copper metabolism disorders\n\n**NOT RECOMMENDED FOR:**\n*   Growth\n*   Reproduction\n\n**NUTRITIONAL BENEFITS:**\n\n*   LOW COPPER: Low level of copper to help minimize its accumulation in liver cells\n*   ADAPTED ENERGY: Adapted energy content to reduce meal volume and decrease intestinal load\n*   ADAPTED PROTEIN CONTENT: Adapted levels of highly digestible vegetable proteins help support healthy liver function\n\n**ADDITIONAL BENEFITS:**\n\n*   Highly digestible complex carbohydrates\n*   Enriched with a blend of soluble and insoluble fibers to help manage digestive problems such as diarrhea\n*   Supplemented with L-carnitine to help promote fat metabolism and meet the high energy needs of the liver\n*   Enriched with long-chain omega-3 fatty acids, eicosapentaenoic acid, and docosahexaenoic acid (EPA and DHA) to help modulate inflammatory reactions\n\n**NOTES:**\n*   The feeding duration varies depending on the pathology and on the regenerative ability of the hepatic tissue\n*   In cases of chronic disease, it may be necessary or beneficial to feed this diet for the rest of the pet's life or until other conditions require a dietary change\n*   It is recommended to divide the daily feeding amount into several small meals\n\n**DAILY FEEDING RECOMMENDATIONS:**\n\n| Body Weight (lb) | Body Weight (kg) | Underweight (Cans) | Underweight (Grams) | Ideal Weight (Cans) | Ideal Weight (Grams) |\n| :---------------- | :--------------- | :----------------- | :----------------- | :------------------- | :------------------- |\n| 4.4               | 2                | 1/4                | 140                | 1/4                  | 123                  |\n| 6.6               | 3                | 1/2                | 190                | 1/2                  | 167                  |\n| 8.8               | 4                | 1/2                | 235                | 1/2                  | 207                  |\n| 11                | 5                | 3/4                | 278                | 1/2                  | 245                  |\n| 13                | 6                | 3/4                | 319                | 3/4                  | 281                  |\n| 22                | 10               | 1 1/4              | 468                | 1                    | 412                  |\n| 26                | 12               | 1 1/4              | 536                | 1 1/4                | 472                  |\n| 35                | 16               | 1 1/2              | 665                | 1 1/2                | 585                  |\n| 44                | 20               | 2                  | 787                | 1 3/4                | 692                  |\n| 55                | 25               | 2 1/4              | 930                | 2                    | 818                  |\n| 66                | 30               | 2 1/2              | 1066               | 2 1/4                | 938                  |\n| 77                | 35               | 3                  | 1197               | 2 1/2                | 1053                 |\n| 88                | 40               | 3 1/4              | 1323               | 2 3/4                | 1164                 |\n| 110               | 50               | 3 3/4              | 1564               | 3 1/4                | 1376                 |\n| 132               | 60               | 4 1/4              | 1793               | 3 3/4                | 1578                 |\n\n**Guaranteed Analysis**\n\n|              | % Min | Can   |\n| :----------- | :---- | :---- |\n| Protein      | 5.0   |       |\n| Fat          | 2.5   |       |\n| Fiber        | 1.6   |       |\n| Moisture     | 66.5  |       |\n| EPA + DHA    |       | 0.07  |\n| Copper       |       | 2.4   |\n| L-carnitine* |       | 84    |\n\n*Not recognized as an essential nutrient by the AAFCO Dog Food Nutrient Profiles.\n\n**INGREDIENTS:**\nRoyal Canin Canine HEPATIC loaf\n\nWater sufficient for processing, pork by-products, brewers rice, corn flour, corn grits, chicken liver, vegetable oil, powdered cellulose, natural flavors, hydrolyzed chicken liver, fish oil, calcium carbonate, potassium chloride, dried plain beet pulp, tricalcium phosphate, taurine, carob bean gum, carrageenan, guar gum, sodium tripolyphosphate, vitamins [L-ascorbyl-2-polyphosphate (source of vitamin C), DL-alpha tocopherol acetate (source of vitamin E), thiamine mononitrate (vitamin B1), biotin, niacin supplement, D-calcium pantothenate, riboflavin supplement, pyridoxine hydrochloride (vitamin B6), vitamin B12 supplement, folic acid, vitamin D3 supplement, menadione sodium bisulfite complex], choline chloride, citric acid, L-carnitine, magnesium oxide, trace minerals [zinc proteinate, ferrous sulfate, manganous oxide, sodium selenite, calcium iodate], marigold extract (Tagetes erecta L.).\n\n**NUTRITION STATEMENT:**\nROYAL CANIN\u00ae Canine HEPATIC loaf is intended for intermittent or supplemental feeding only."
