      "page_number": 144,
      "document": "Royal_Canin.pdf",
      "description": "This page provides information and feeding recommendations for Royal Canin Recovery Liquid, a liquid food for cats and dogs recovering from illness or surgery.",
      "contents": "## Royal Canin Recovery Liquid\n\nAvailable in a 4-pack of 8 fl oz bottles.\n\n**Recommended for:**\n*   Malnutrition\n*   Tube feeding\n*   Convalescence\n*   Post-surgery and intensive care\n*   Refeeding for cats and dogs with anorexia or hyporexia\n\n**Not recommended for:**\n*   Fat-sensitive disorders in dogs\u00b9\n*   Hepatic encephalopathy\u00b2\n*   Kidney disease\u00b2\n*   Growth\n*   Reproduction\n\n**Nutritional Benefits:**\n*   **High Protein:** High protein level to help maintain muscle mass during hospitalization and convalescence.\n*   **Adapted Energy:** High energy density that provides daily energy requirements in a reduced feeding volume.\n*   **Antioxidant Complex:** Synergistic antioxidant blend of vitamin C, vitamin E, lutein, and taurine to help manage oxidative stress.\n*   **Easy Tube Feeding:** Liquid formula with adapted viscosity for easy uses.\n\n**Additional Benefits:**\n*   Special innovative cap design that helps ICU staff tube feed patients easily and efficiently.\n*   Contains fish oil, a source of EPA and DHA, to help minimize clinical signs of inflammation.\n\n**Daily Feeding Recommendations for Canine Resting Energy Requirements:**\n\n| Body Weight | Daily Feeding |\n| :---------- | :------------ |\n| lb    | kg   | ml per day | Bottles per day |\n| 4.4   | 2    | 110        | 1/2             |\n| 6.6   | 3    | 150        | 3/4             |\n| 8.8   | 4    | 190        | 3/4             |\n| 11    | 5    | 220        | 1               |\n| 13    | 6    | 255        | 1               |\n| 22    | 10   | 375        | 1 1/2           |\n| 26    | 12   | 430        | 1 3/4           |\n| 35    | 16   | 530        | 2 1/4           |\n| 44    | 20   | 630        | 2 3/4           |\n| 55    | 25   | 745        | 3 1/4           |\n| 66    | 30   | 850        | 3 1/2           |\n| 77    | 35   | 955        | 4               |\n| 88    | 40   | 1055       | 4 1/2           |\n| 110   | 50   | 1250       | 5 1/4           |\n| 132   | 60   | 1430       | 6               |\n\n**Guaranteed Analysis:**\n\n|             | % Min | Liquid |\n| :---------- | :---- | :----- |\n| Protein     | % Min | 6.5    |\n| Fat         | % Min | 3.5    |\n| Fiber       | % Max | 0.1    |\n| Moisture    | % Max | 83.0   |\n| EPA + DHA   | % Min | 0.08   |\n| Vitamin E   | IU/kg Min | 120    |\n| Taurine     | % Min | 0.1    |\n| Lutein      | % Min | 1.02   |\n| Ascorbic acid* | mg/kg Min | 80     |\n\n*Not recognized as an essential nutrient by the AAFCO Dog Food Nutrient Profiles.\n\n**Ingredients:**\nRoyal Canin Feline and Canine RECOVERY\u00ae LIQUID\nWater, dried milk protein, maltodextrins, vegetable oil, soy protein, fish oil, trace minerals [dicalcium phosphate, calcium citrate, potassium chloride, ferrous sulfate, magnesium oxide, zinc sulfate, sodium selenite, copper sulfate, manganese sulfate, potassium iodide), L-arginine, dipotassium phosphate, potassium citrate, taurine, choline chloride, mono- and diglycerides of fatty acids, sodium citrate, vitamins [ascorbic acid, vitamin E supplement, niacinamide, vitamin B12, vitamin A palmitate, calcium pantothenate, thiamine hydrochloride, pyridoxine hydrochloride, biotin, vitamin D3 supplement, riboflavin supplement, folic acid), salt, carrageenan, potassium hydroxide, cysteine, modified corn starch, marigold extract (Tagetes erecta L.).\n\n**Nutrition Statement:**\nRoyal Canin Feline and Canine RECOVERY\u00ae LIQUID is formulated to meet the nutritional levels established by the AAFCO Dog and Cat Food Nutrient Profiles for maintenance.\n\n\u00b9Use GI Low Fat Liquid\n\n\u00b2Use Renal Support Liquid"
