      "description": "This page describes Royal Canin Gastrointestinal Feline Treats, including its benefits, feeding recommendations, ingredients, and nutritional information.",
      "contents": "## GASTROINTESTINAL FELINE TREATS\n\n![Royal Canin Treats/G\u00e2teries](image)\n\nAvailable in a 7.7 oz (220 g) bag.\n\nMOST APPROPRIATE FOR CATS FED:\n*   Gastrointestinal Fiber Response\n*   Gastrointestinal\n*   Gastrointestinal Moderate Calorie\n\nMAY ALSO BE APPROPRIATE FOR CATS FED:\n*   Calm\n*   Glycobalance\n\n\nNUTRITIONAL BENEFITS:\n\n**DIGESTIVE HEALTH**\nSpecific nutrients to support digestive health\n\nADDITIONAL BENEFITS:\n\nThis product promotes a urinary environment unfavorable to the development of both struvite and calcium oxalate crystals\n\n*   Enhanced with a blend of soluble and insoluble fibers to help reduce digestive problems such as diarrhea and constipation\n*   A precise blend of antioxidants helps support a healthy immune system\n*   Chelated minerals improve digestive and metabolic utilization of trace elements\n*   CALORIES: Only 1.0 kcal/treat\n\nDAILY FEEDING RECOMMENDATIONS:\nTreats are intended to comprise no more than 10% of the daily caloric needs\n\n| Body Weight (lb) | Body Weight (kg) | Recommended Maximum Number of Treats Per Day |\n|-------------------|-------------------|---------------------------------------------------|\n| 4.4               | 2                 | 9                                                   |\n| 5.5               | 2.5               | 11                                                  |\n| 6.6               | 3                 | 12                                                  |\n| 7.7               | 3.5               | 14                                                  |\n| 8.8               | 4                 | 15                                                  |\n| 9.9               | 4.5               | 16                                                  |\n| 11                | 5                 | 18                                                  |\n| 12                | 5.5               | 19                                                  |\n| 13                | 6                 | 20                                                  |\n| 14                | 6.5               | 21                                                  |\n| 15                | 7                 | 22                                                  |\n| 17                | 7.5               | 23                                                  |\n| 18                | 8                 | 25                                                  |\n| 19                | 8.5               | 26                                                  |\n\n| Guaranteed Analysis | Dry  |\n|----------------------|------|\n| Protein (% Min)       | 33.0 |\n| Fat (% Min)           | 11.0 |\n| Fiber (% Max)         | 7.3  |\n| Moisture (% Max)      | 8.0  |\n\n| Guaranteed Analysis | Dry        |\n|----------------------|------------|\n| Vitamin E (IU/kg Min) | 385        |\n| Ascorbic acid* (mg/kg Min)   | 160        |\n\n*Not recognized as an essential nutrient by the AAFCO Cat Food Nutrient Profiles.\n\nINGREDIENTS:\nROYAL CANIN\u00ae Gastrointestinal Feline Treats dry\nBrewers rice, chicken by-product meal, corn gluten meal, wheat gluten, powdered cellulose, natural flavors, chicken fat, egg product, dried plain beet pulp, fish oil, vegetable oil, potassium chloride, sodium silico aluminate, calcium sulfate, sodium pyrophosphate, sodium bisulfate, monocalcium phosphate, powdered psyllium seed husk, DL-methionine, fructooligosaccharides, choline chloride, taurine, hydrolyzed yeast, vitamins [DL-alpha tocopherol acetate (source of vitamin E), L-ascorbyl-2-polyphosphate (source of vitamin C), biotin, niacin supplement, D-calcium pantothenate, riboflavin supplement, pyridoxine hydrochloride (vitamin B6), vitamin A acetate, thiamine mononitrate (vitamin B1), folic acid, vitamin B12 supplement, vitamin D3 supplement], trace minerals [zinc proteinate, zinc oxide, manganese proteinate, ferrous sulfate, manganous oxide, copper sulfate, calcium iodate, sodium selenite, copper proteinate], marigold extract (Tagetes erecta L.), rosemary extract, preserved with mixed tocopherols and citric acid.\n\nNUTRITION STATEMENT:\nROYAL CANIN\u00ae Gastrointestinal Feline Treats are intended for intermittent or supplemental feeding only."
