      "contents": "## KITTEN MIXED DAILY FEEDING RECOMMENDATIONS:\nRoyal Canin Gastrointestinal Kitten dry mixed with Royal Canin Gastrointestinal Kitten ultra soft mousse in sauce\n\n| Target Adult Cat Weight | Cans of Wet | Age of Kitten in Months                                                                                                                                |\n| :---------------------- | :---------- | :---------------------------------------------------------------------------------------------------------------------------------------------------- |\n| lb                      | kg          | 2             | 4             | 6             | 8             | 10            | 12            |\n|                         |             | Cans + Cups   | Cups Grams    | Cups Grams    | Cups Grams    | Cups Grams    | Cups Grams    |\n| 6.6                     | 3           | 1/2 + 1/8     | 1/4 21        | 1/4 35        | 1/4 35        | 1/4 30        | 1/8 21        |\n| 8.8                     | 4           | 1/2 + 1/4     | 3/8 27        | 3/8 44        | 3/8 45        | 1/4 34        | 1/4 30        |\n| 11                      | 5           | 1/2 + 1/4     | 1/2 34        | 1/2 56        | 1/2 57        | 3/8 43        | 3/8 38        |\n\n## GESTATING/LACTATING CAT MIXED DAILY FEEDING RECOMMENDATIONS:\nRoyal Canin Gastrointestinal Kitten dry mixed with Royal Canin Gastrointestinal Kitten ultra soft mousse in sauce\n\n| Adult Weight | Cans of wet | Gestation Minimum | Gestation Maximum | Lactation |\n| :----------- | :---------- | :---------------- | :---------------- | :-------- |\n| lb           | kg          | Cans + Cups       | Cups Grams        | Cups Grams        |           |\n| 6.6          | 3           | 1/2 + 1/4         | 1/4 35            | 1/2 60            | ad libitum |\n| 8.8          | 4           | 1/2 + 3/8         | 3/8 50            | 3/4 85            | ad libitum |\n| 11           | 5           | 1/2 + 5/8         | 5/8 70            | 1 110             | ad libitum |\n\nThis is a range. Feed to maintain body condition as best as possible. Feed closer to the minimum early in gestation and closer to the maximum in late gestation."
