      "document": "Royal_Canin.pdf",
      "description": "This page contains information about Royal Canin Renal Support F (Flavorful) dog food, including nutritional benefits, feeding recommendations, guaranteed analysis, ingredients, and nutrition statement.",
      "contents": "## Royal Canin Renal Support F (Flavorful)\n\n**Available in 6 lb and 17.6 lb bags.**\n\n**RECOMMENDED FOR:**\n*   Dogs with IRIS Stages 2-4 chronic kidney disease (CKD)\n*   Renal proteinuria\n\n**NOT RECOMMENDED FOR:**\n*   Growth\n*   Reproduction\n\n**NUTRITIONAL BENEFITS:**\n\n*   **RENAL SUPPORT:** Formulated with low phosphorus and restricted amounts of high quality protein to support renal function, helping to improve the dog's quality of life.\n*   **ADAPTED ENERGY:** Adapted energy content to reduce meal volume and help compensate for a decreased appetite.\n*   **AROMATIC CHOICE:** A specific aromatic profile with a dedicated kibble shape to help stimulate the dog's appetite, particularly in cases prone to food aversion.\n\n**ADDITIONAL BENEFITS:**\n\n*   Moderately restricted sodium to help benefit patients with concurrent hypertension.\n*   Enriched with long chain omega-3 fatty acids, eicosapentaenoic and docosahexaenoic acids (EPA and DHA) to help modulate inflammatory reactions.\n*   Enriched with a blend of antioxidants to help maintain a healthy immune system and to reduce DNA damage associated with cell aging.\n*   Enriched with a blend of soluble and insoluble fibers to help manage digestive problems.\n\n**NOTES:**\n*   Feeding a renal diet can help reduce the incidence of uremic crises and may help prolong survival in dogs with CKD (Jacob et al. 2002).\n*   Each RENAL SUPPORT diet can be fed independently, or the 3 dry foods and 3 wet foods can be combined for a total of 9 mixed-texture feeding options. This can be beneficial to help stimulate the dog's appetite.\n\n**DAILY FEEDING RECOMMENDATIONS:**\n\n| Body Weight (lb) | Body Weight (kg) | Underweight (Cups) | Underweight (Grams) | Ideal Weight (Cups) | Ideal Weight (Grams) |\n|---|---|---|---|---|---|\n| 4.4 | 2 | 5/8 | 53 | 1/2 | 47 |\n| 6.6 | 3 | 3/4 | 72 | 5/8 | 64 |\n| 8.8 | 4 | 1 | 90 | 7/8 | 79 |\n| 11 | 5 | 1 1/8 | 106 | 1 | 93 |\n| 13 | 6 | 1 1/4 | 121 | 1 1/8 | 107 |\n| 22 | 10 | 1 7/8 | 178 | 1 5/8 | 157 |\n| 26 | 12 | 2 1/8 | 204 | 1 7/8 | 180 |\n| 35 | 16 | 2 3/4 | 253 | 2 3/8 | 223 |\n| 44 | 20 | 3 1/4 | 300 | 2 7/8 | 264 |\n| 55 | 25 | 3 3/4 | 354 | 3 3/8 | 312 |\n| 66 | 30 | 4 3/8 | 406 | 3 7/8 | 357 |\n| 77 | 35 | 4 7/8 | 456 | 4 1/4 | 401 |\n| 88 | 40 | 5 3/8 | 504 | 4 3/4 | 443 |\n| 110 | 50 | 6 3/8 | 596 | 5 5/8 | 524 |\n| 132 | 60 | 7 1/4 | 683 | 6 3/8 | 601 |\n\n**Guaranteed Analysis (Dry):**\n\n| Nutrient | % Min/Max | Value |\n|---|---|---|\n| Protein | % Min | 11.5 |\n| Fat | % Min | 14.0 |\n| Fiber | % Max | 3.9 |\n| Moisture | % Max | 10.0 |\n| EPA + DHA | % Min | 0.27 |\n| Phosphorus | % Max | 0.45 |\n| Sodium | % Max | 0.5 |\n| Vitamin E | IU/kg Min | 350 |\n| Ascorbic acid* | mg/kg Min | 160 |\n\n*Not recognized as an essential nutrient by the AAFCO Dog Food Nutrient Profiles.\n\n**Bag Size**|**Cups per Bag**\n---|---\n6 lb (2.72 kg)| 27\n17.6 lb (8 kg)| 81\n\n**INGREDIENTS:**\n\nCanine RENAL SUPPORT F dry\n\nBrewers rice, corn, chicken fat, chicken by-product meal, dried plain beet pulp, natural flavors, wheat gluten, fish oil, vegetable oil, calcium carbonate, salt, potassium chloride, powdered psyllium seed husk, sodium silico aluminate, DL-methionine, fructooligosaccharides, L-lysine, choline chloride, taurine, potassium citrate, vitamins [DL-alpha tocopherol acetate (source of vitamin E), L-ascorbyl-2-polyphosphate (source of vitamin C), biotin, D-calcium pantothenate, vitamin A acetate, niacin supplement, pyridoxine hydrochloride (vitamin B6), thiamine mononitrate (vitamin B1), vitamin B12 supplement, riboflavin supplement, vitamin D3 supplement, folic acid], N-butyric acid, magnesium oxide, trace minerals [zinc proteinate, zinc oxide, ferrous sulfate, manganese proteinate, manganous oxide, copper sulfate, sodium selenite, calcium iodate, copper proteinate], L-tryptophan, marigold extract (Tagetes erecta L.), rosemary extract, preserved with mixed tocopherols and citric acid.\n\n**NUTRITION STATEMENT:**\n\nROYAL CANIN\u00ae Canine RENAL SUPPORT F dry is intended for intermittent or supplemental feeding only."
