      "description": "This page provides information about Royal Canin Renal Support Liquid, including its benefits, feeding recommendations, guaranteed analysis, ingredients, and nutrition statement.",
      "contents": "## Royal Canin Renal Support Liquid\n\nAvailable in a 4-pack of 8 fl oz (237 ml) bottles.\n\n**RECOMMENDED FOR:**\n*   Management of all stages of chronic kidney disease (CKD)\n*   Hepatic encephalopathy\n*   Tube feeding\n\n**NOT RECOMMENDED FOR:**\n*   Hyperlipidemia\n*   Growth\n*   Reproduction\n\n**NUTRITIONAL BENEFITS:**\n\n*   **NUTRITION TO SUPPORT RENAL HEALTH**\n    Formulated with optimal nutrient levels, including low protein and phosphorus, and EPA/DHA.\n*   **HIGH ENERGY**\n    High energy density that provides daily energy requirements in a reduced feeding volume.\n*   **ANTIOXIDANT COMPLEX**\n    Synergistic antioxidant blend of vitamin C, vitamin E, lutein, and taurine to help manage oxidative stress.\n*   **EASY TUBE FEEDING**\n    Liquid formula with adapted viscosity for easy use.\n\n**ADDITIONAL BENEFITS:**\n\n*   Special innovative cap design that helps ICU staff tube feed patients easily and efficiently.\n*   Contains fish oil, a source of EPA and DHA, to help minimize clinical signs of inflammation.\n\n**DAILY FEEDING RECOMMENDATIONS:**\n\n| Body Weight (lb) | Body Weight (kg) | Bottles per day | ml per day |\n| ---------------- | ---------------- | --------------- | ---------- |\n| 4.4              | 2                | 1/2             | 109        |\n| 5.5              | 2.5              | 1/2             | 129        |\n| 6.6              | 3                | 1/2             | 148        |\n| 7.7              | 3.5              | 3/4             | 166        |\n| 8.8              | 4                | 3/4             | 184        |\n| 9.9              | 4.5              | 3/4             | 201        |\n| 11               | 5                | 1               | 218        |\n| 12               | 5.5              | 1               | 234        |\n| 13               | 6                | 1               | 249        |\n| 14               | 6.5              | 1               | 265        |\n| 15               | 7                | 1 1/4           | 280        |\n| 17               | 7.5              | 1 1/4           | 295        |\n| 18               | 8                | 1 1/4           | 309        |\n| 19               | 8.5              | 1 1/4           | 324        |\n\n**GUARANTEED ANALYSIS:**\n\n| Guaranteed Analysis | Liquid | Guaranteed Analysis | Liquid    |\n| ------------------- | ------ | ------------------- | --------- |\n| Protein (% Min)     | 5.2    | Phosphorus (% Max)  | 0.13      |\n| Protein (% Max)     | 7.7    | Vitamin E (IU/kg Min) | 120       |\n| Fat (% Min)         | 3.8    | Taurine* (% Min)    | 0.1       |\n| Fiber (% Max)       | 0.1    | Ascorbic acid* (mg/kg Min) | 80        |\n| Moisture (% Max)    | 83.0   | Lutein* (mg/kg Min)   | 0.96      |\n| EPA + DHA (% Min)   | 0.13   |                     |           |\n\n*Not recognized as an essential nutrient by the AAFCO Cat Food Nutrient Profiles.\n\n**INGREDIENTS:**\n\nRoyal Canin Feline Renal Support Liquid\n\nWater, maltodextrins, dried milk protein, vegetable oil, soy protein, fish oil, potassium citrate, trace minerals [dicalcium phosphate, calcium citrate, potassium chloride, ferrous sulfate, magnesium oxide, zinc sulfate, sodium selenite, copper sulfate, manganese sulfate, potassium iodide], taurine, choline chloride, mono- and diglycerides of fatty acids, vitamins [vitamin E supplement, niacinamide, vitamin B12, vitamin A palmitate, calcium pantothenate, thiamine hydrochloride, pyridoxine hydrochloride, biotin, vitamin D3 supplement, riboflavin supplement, folic acid, ascorbic acid], dipotassium phosphate, carrageenan, potassium hydroxide, modified corn starch, marigold extract (Tagetes erecta L.).\n\n**NUTRITION STATEMENT:**\n\nRoyal Canin Feline RENAL SUPPORT LIQUID is intended for intermittent or supplemental feeding only.\n\n**NOTES:**\n\nIn cases of anorexia of less than 3 days, start progressive feeding over 3 days:\n\n| Day   | Percent of RER |\n| ----- | -------------- |\n| 1     | 33%            |\n| 2     | 67%            |\n| 3     | 100%           |\n\nIn cases of prolonged anorexia of 3 or more days, start progressive feeding over 5 days:\n\n| Day   | Percent of RER |\n| ----- | -------------- |\n| 1     | 25%            |\n| 2     | 50%            |\n| 3     | 67%            |\n| 4     | 75%            |\n| 5     | 100%           |"
