      "contents": "## Royal Canin Dental Small Dog\n\nAvailable in 8.8 lb bags.\n\n**RECOMMENDED FOR:**\n*   Healthy adult dogs <22 lbs\n*   Tendency to form dental plaque and calculus\n\n**NOT RECOMMENDED FOR:**\n*   Growth\n*   Reproduction\n\n**NUTRITIONAL BENEFITS:**\n\n**TARTAR CONTROL**\nClinically proven to efficiently reduce tartar build-up\n\n**BRUSHING EFFECT**\nSpecific kibble shape and size help reduce plaque accumulation and tartar build-up by promoting a brushing effect while chewing\n\n**URINE DILUTION**\nThis diet promotes a diluted urine which helps reduce the risk of crystal formation.\n\n**ADDITIONAL BENEFITS:**\n*   Features specific kibble size & texture for brushing effect\n*   Contains calcium and phosphorus to help support healthy teeth\n*   Contains targeted levels of sodium, magnesium and calcium\n*   Enriched with a blend of soluble and insoluble fibers to help manage digestive problems\n*   Chelated minerals improve digestive and metabolic utilization of trace elements\n\n**NOTES:**\n*   Do not add water to Royal Canin Veterinary Health Nutrition Canine Dental Small Dog\n*   Royal Canin\u00ae Veterinary Health Nutrition Canine Dental Small Dog should be fed as a complete meal; the efficacy when used as treats is not known\n\n\n**DAILY FEEDING RECOMMENDATIONS:**\n\n| Body Weight (lb) | Body Weight (kg) | Tendency to Become Overweight (Cups) | Tendency to Become Overweight (Grams) | Ideal Weight (Cups) | Ideal Weight (Grams) |\n|---|---|---|---|---|---|\n| 4.4 | 2 | 1/2 | 41 | 1/2 | 48 |\n| 6.6 | 3 | 5/8 | 56 | 3/4 | 64 |\n| 8.8 | 4 | 3/4 | 69 | 7/8 | 80 |\n| 11 | 5 | 7/8 | 82 | 1 1/8 | 95 |\n| 13 | 6 | 1 1/8 | 94 | 1 1/4 | 108 |\n| 22 | 10 | 1 5/8 | 137 | 1 7/8 | 159 |\n\n**Guaranteed Analysis**\n\n| Guaranteed Analysis | Dry % |\n|---|---|\n| Protein | Min 20.0 |\n| Fat | Min 15.0 |\n| Fiber | Max 4.8 |\n| Moisture | Max 10.0 |\n| Calcium | Min 0.58|\n| Calcium | Max 0.98 |\n| Phosphorus | Min 0.36 |\n| Sodium | Max 0.98|\n| Magnesium | Max 0.13|\n\n**Bag Size**\n8.  8 lb (4 kg)\n\n**Cups per Bag**\n43\n\n**INGREDIENTS:**\nCanine DENTAL SMALL DOG dry\nBrewers rice, corn, chicken by-product meal, chicken fat, wheat gluten, dried chicory root, pea fiber, natural flavors, fish oil, salt, calcium carbonate, potassium chloride, sodium tripolyphosphate, vegetable oil, sodium silico aluminate, fructooligosaccharides, vitamins [DL-alpha tocopherol acetate (source of vitamin E), L-ascorbyl-2-polyphosphate (source of vitamin C), niacin supplement, D-calcium pantothenate, biotin, pyridoxine hydrochloride (vitamin B6), riboflavin supplement, thiamine mononitrate (vitamin B1), vitamin A acetate, vitamin B12 supplement, folic acid, vitamin D3 supplement), choline chloride, taurine, DL-methionine, trace minerals [zinc proteinate, zinc oxide, ferrous sulfate, manganese proteinate, manganous oxide, copper sulfate, sodium selenite, calcium iodate, copper proteinate], marigold extract (Tagetes erecta L.), N-butyric acid, green tea extract, magnesium oxide, L-carnitine, rosemary extract, preserved with mixed tocopherols and citric acid.\n\n**NUTRITION STATEMENT:**\nROYAL CANIN\u00ae Canine DENTAL SMALL DOG dry is formulated to meet the nutritional levels established by the AAFCO Dog Food Nutrient Profiles for maintenance."
