      "description": "This page provides information about Royal Canin Calm, including its recommended uses, nutritional benefits, feeding recommendations, ingredients, and guaranteed analysis.",
      "contents": "## Royal Canin Calm\n\n**Recommended for:**\n*   Stress or anxiety-related conditions\n\n**Not recommended for:**\n*   Growth\n*   Reproduction\n\n**Nutritional Benefits:**\n\n*   **Calming Support:** Contains hydrolyzed milk protein and L-tryptophan to help manage cats exhibiting fearful behaviors in stressful environments and social situations.\n*   **Hairball Complex:** A specific blend of fibers, including psyllium, helps control hairball formation by eliminating ingested hair through the stools.\n*   **Skin Barrier:** Formulated to support the skin's natural protective barrier for optimal skin health.\n\n**Additional Benefits:**\n\n*   This diet promotes a urinary environment unfavorable to the development of both struvite and calcium oxalate crystals\n*   Appeasing nutrients from hydrolyzed milk protein and enriched with L-tryptophan\n*   Soluble and insoluble fibers, including psyllium, support digestive health\n*   Controlled levels of magnesium, calcium and phosphorus to support urinary health\n*   Chelated minerals improve digestive and metabolic utilization of trace elements\n\n**Notes:**\n\n*   Calm may be fed long-term if desired\n*   The animal should be fed Calm at least ten days before any foreseeable stressful event (leaving on vacation, moving, arrival of a baby, home renovation, etc.)\n\n**Daily Feeding Recommendations:**\n\n| Body Weight (lb) | Body Weight (kg) | Tendency to Become Overweight (Cups) | Tendency to Become Overweight (Grams) | Ideal Weight (Cups) | Ideal Weight (Grams) |\n| :----------------- | :----------------- | :-----------------------------------: | :------------------------------------: | :-----------------: | :-----------------: |\n| 4.4                | 2                  | 1/2                                   | 27                                    | 1/2                | 34                 |\n| 5.5                | 2.5                | 1/2                                   | 32                                    | 1/2                | 40                 |\n| 6.6                | 3                  | 1/2                                   | 37                                    | 1/2                | 46                 |\n| 7.7                | 3.5                | 1/2                                   | 41                                    | 1/2                | 51                 |\n| 8.8                | 4                  | 1/2                                   | 45                                    | 1/2                | 56                 |\n| 9.9                | 4.5                | 1/2                                   | 49                                    | 1/2                | 61                 |\n| 11                 | 5                  | 1/2                                   | 53                                    | 1                   | 66                 |\n| 12                 | 5.5                | 1/2                                   | 56                                    | 1                   | 71                 |\n| 13                 | 6                  | 1/2                                   | 60                                    | 1                   | 75                 |\n| 14                 | 6.5                | 1/2                                   | 63                                    | 1                   | 79                 |\n| 15                 | 7                  | 1                                     | 67                                    | 1                   | 84                 |\n| 17                 | 7.5                | 1                                     | 70                                    | 1                   | 88                 |\n| 18                 | 8                  | 1                                     | 74                                    | 1                   | 92                 |\n| 19                 | 8.5                | 1                                     | 77                                    | 1                   | 96                 |\n\n**Guaranteed Analysis (Dry Matter Basis):**\n\n| Nutrient     | % Min |\n| :----------- | :----: |\n| Protein      | 34.0  |\n| Fat          | 9.0   |\n| Fiber        | 5.6   |\n| Moisture     | 8.0   |\n| Tryptophan   | 0.27  |\n| Calcium      | 1.44  |\n| Phosphorus   | 1.14  |\n| Magnesium    | 0.14  |\n\n**Bag Size:**\n\n*   4.4 lb (2 kg) - 19 Cups per Bag\n*   8.8 lb (4 kg) - 39 Cups per Bag\n\n**Ingredients:**\n\nFeline CALM dry\nChicken by-product meal, corn, brewers rice, corn gluten meal, wheat, wheat gluten, natural flavors, dried plain beet pulp, chicken fat, pea fiber, powdered cellulose, calcium sulfate, fish oil, salt, potassium chloride, DL-methionine, sodium pyrophosphate, vegetable oil, powdered psyllium seed husk, fructooligosaccharides, monocalcium phosphate, vitamins [DL-alpha tocopherol acetate (source of vitamin E), niacin supplement, L-ascorbyl-2-polyphosphate (source of vitamin C), D-calcium pantothenate, biotin, pyridoxine hydrochloride (vitamin B6), riboflavin supplement, thiamine mononitrate (vitamin B1), vitamin A acetate, vitamin B12 supplement, folic acid, vitamin D3 supplement], choline chloride, L-lysine, taurine, dried hydrolyzed casein, trace minerals [zinc proteinate, manganese proteinate, zinc oxide, ferrous sulfate, manganous oxide, copper sulfate, sodium selenite, calcium iodate, copper proteinate], L-tryptophan, GLA safflower oil, marigold extract (Tagetes erecta L.), L-carnitine, rosemary extract, preserved with mixed tocopherols and citric acid.\n\n**Nutrition Statement:**\n\nROYAL CANIN\u00ae Feline CALM dry is formulated to meet the nutritional levels established by the AAFCO Cat Food Nutrient Profiles for maintenance."
