      "contents": "## Royal Canin Dental Dry Cat Food\n\n**Recommended for:**\n* Healthy adult cats\n* Tendency to form dental plaque and calculus\n\n**Not recommended for:**\n* Growth\n* Reproduction\n\n**Nutritional Benefits:**\n*Plaque Control* Clinically proven to efficiently reduce plaque build-up.\n*Brushing Effect* Specific kibble shape and size help reduce plaque accumulation and tartar build-up by promoting a brushing effect while chewing.\n*Hairball Complex* A specific blend of fibers, including psyllium, helps control hairball formation by eliminating ingested hair through the stools.\n*S/O Index* This diet promotes a urinary environment unfavorable to the development of both struvite and calcium oxalate crystals.\n* Contains calcium and phosphorus to help support healthy teeth\n* Soluble and insoluble fibers, including psyllium, support digestive health\n* Contains a blend of antioxidants to help maintain a healthy immune system and to reduce DNA damage associated with cell aging\n* Enriched with long chain omega-3 fatty acids, eicosapentaenoic acid and docosahexaenoic acid (EPA and DHA) to help modulate inflammatory reactions\n\n**Daily Feeding Recommendations:**\n\n| Body Weight (lb) | Body Weight (kg) | Tendency to Become Overweight (Cups) | Tendency to Become Overweight (Grams) | Ideal Weight (Cups) | Ideal Weight (Grams) |\n|---|---|---|---|---|---|\n| 4.4 | 2 | 1/2 | 27 | 1/2 | 34 |\n| 5.5 | 2.5 | 1/2 | 32 | 1/2 | 40 |\n| 6.6 | 3 | 1/2 | 37 | 1/2 | 46 |\n| 7.7 | 3.5 | 1/2 | 41 | 1/2 | 51 |\n| 8.8 | 4 | 1/2 | 45 | 1/2 | 56 |\n| 9.9 | 4.5 | 1/2 | 49 | 1 | 61 |\n| 11 | 5 | 1/2 | 53 | 1 | 66 |\n| 12 | 5.5 | 1/2 | 56 | 1 | 70 |\n| 13 | 6 | 1 | 60 | 1 | 75 |\n| 14 | 6.5 | 1 | 63 | 1 | 79 |\n| 15 | 7 | 1 | 67 | 1 | 84 |\n| 17 | 7.5 | 1 | 70 | 1 | 88 |\n| 18 | 8 | 1 | 73 | 1 | 92 |\n| 19 | 8.5 | 1 | 77 | 1 | 96 |\n\n**Guaranteed Analysis (Dry Matter Basis):**\n\n| Nutrient | % |\n|---|---|\n| Protein (Min) | 27.0 |\n| Fat (Min) | 13.0 |\n| Fiber (Max) | 7.2 |\n| Moisture (Max) | 10.5 |\n| EPA + DHA (Min) | 0.11 |\n| Calcium (Max) | 0.65 |\n| Phosphorus (Max) | 0.46 |\n| Vitamin E (Min) | 328 IU/kg |\n| Ascorbic acid* (Min) | 320 mg/kg |\n\n*Not recognized as an essential nutrient by the AAFCO Cat Food Nutrient Profiles.\n\n**Ingredients:**\nChicken by-product meal, corn, brewers rice, corn gluten meal, brown rice, chicken fat, wheat gluten, pea fiber, powdered cellulose, dried plain beet pulp, natural flavors, calcium sulfate, sodium bisulfate, potassium chloride, fish oil, L-lysine, DL-methionine, vegetable oil, powdered psyllium seed husk, sodium silico aluminate, calcium carbonate, fructooligosaccharides, choline chloride, salt, sodium tripolyphosphate, sodium pyrophosphate, taurine, vitamins [DL-alpha tocopherol acetate (source of vitamin E), L-ascorbyl-2-polyphosphate (source of vitamin C), biotin, niacin supplement, pyridoxine hydrochloride (vitamin B6), D-calcium pantothenate, riboflavin supplement, vitamin A acetate, thiamine mononitrate (vitamin B1), folic acid, vitamin B12 supplement, vitamin D3 supplement), hydrolyzed yeast, trace minerals [zinc proteinate, zinc oxide, manganese proteinate, ferrous sulfate, manganous oxide, copper sulfate, sodium selenite, calcium iodate, copper proteinate], marigold extract (Tagetes erecta L.), rosemary extract, preserved with mixed tocopherols and citric acid.\n\n**Nutrition Statement:**\nRoyal Canin Feline DENTAL dry is formulated to meet the nutritional levels established by the AAFCO Cat Food Nutrient Profiles for maintenance.\n\n**Bag Sizes:** 1.3 lb (600 g), 7.7 lb (3.5 kg)\n\n| Bag Size | Cups per Bag |\n|---|---|\n| 1.3 lb (600 g) | 6 |\n| 7.7 lb (3.5 kg) | 40 |"
