      "description": "This page provides information about Royal Canin Pill Assist Cat, including nutritional benefits, feeding recommendations, ingredients, and recommended/not recommended uses.",
      "contents": "## Royal Canin Pill Assist Cat\n\n**Recommended for:**\n*   Use with most Royal Canin Feline Veterinary Diets\n\n**Not recommended for:**\n*   Cats with adverse food reactions\n\nAvailable in a 1.58 oz (45 g) bag containing approximately 45 pieces.\n\n**Nutritional Benefits:**\n*   Highly attractive formula\n*   Shown to enable pill acceptance in 91% of cases\n*   Designed to easily mold and shape for pill administration\n\n**Daily Feeding Recommendations:**\nTo be used as recommended by veterinarian.\n\n**Guaranteed Analysis**\n\n| Ingredient      |             | Dry  |\n| :-------------- | :---------- | :--- |\n| Protein         | % Min       | 19   |\n| Fat             | % Min       | 10.5 |\n| Fiber           | % Max       | 3.1  |\n| Moisture        | % Max       | 30   |\n| Vitamin E       | IU/kg Min   | 270  |\n| Ascorbic Acid* | mg/kg Min | 124  |\n\n*Not recognized as an essential nutrient by the AAFCO Cat Food Nutrient Profiles.\n\n**Additional Benefits:**\n*   Compatible with most ROYAL CANIN VETERINARY DIETS\u00ae with the exception of those formulated for adverse food reactions\n*   In most cases, all URINARY S/O\u2122 diets, Multifunction URINARY S/O\u2122 + SATIETY, URINARY S/O\u2122 + CALM, URINARY S/O\u2122 + SATIETY + CALM and URINARY S/O\u2122 AGING 7+ + CALM, can be compatible with Pill Assist. Cases with recurrence of uroliths or struvite dissolution cases need to be evaluated on an individual basis\n*   Adapted energy content with 3 kcal/piece\n\n**Feeding Guidelines:**\n*   Maximum 6 pieces daily for an 8 lb (4 kg) cat.\n\n**Ingredients:**\nPILL ASSIST CAT\nGlycerin, water sufficient for processing, chicken, wheat flour, chicken liver, wheat gluten, vegetable oil, corn\nsyrup, gum arabic, yeast extract, natural flavors, fructooligosaccharides, fumaric acid, potassium sorbate (a\npreservative), vitamins [DL-alpha tocopherol acetate (source of vitamin E), ascorbic acid), rosemary extract,\npreserved with mixed tocopherols and citric acid.\n\n**Nutrition Statement:**\nROYAL CANIN PILL ASSIST CAT is intended for intermittent or supplemental feeding only."
