      "page_number": 251,
      "document": "Royal_Canin.pdf",
      "description": "This page contains information about Royal Canin Boxer Puppy food, including its benefits, ingredients, guaranteed analysis, and feeding guide.",
      "contents": "## Royal Canin Boxer Puppy\n\nFor Boxer puppies up to 15 months old\n\n**BREED HEALTH NUTRITION\u00ae**\n\n**IMMUNE SYSTEM SUPPORT**\nAs puppies grow, they will experience big changes and new discoveries. During this key period, the puppy's immune system develops gradually. Royal Canin Boxer Puppy helps support your puppy's natural defenses with an exclusive complex of antioxidants including vitamin E.\n\n**MUSCLE DEVELOPMENT**\nFormulated with a precise protein content and enriched with L-carnitine to support muscle development.\n\n**DIGESTIVE HEALTH**\nFormulated with high quality protein (L.I.P.*) and prebiotics to support digestive health and a balanced intestinal flora, contributing to optimal stool quality.\n*Protein selected for its very high digestibility.\n\nRefer to Retail Price List for available sizes\n\n**GUARANTEED ANALYSIS**\n+-------------------------+---------+\n| Crude Protein (min)     | 28.0%   |\n+-------------------------+---------+\n| Crude Fat (min)         | 16.0%   |\n+-------------------------+---------+\n| Crude Fiber (max)       | 3.7%    |\n+-------------------------+---------+\n| Moisture (max)          | 10.0%   |\n+-------------------------+---------+\n| Vitamin E (min)         | 420 IU/kg |\n+-------------------------+---------+\n| L-carnitine* (min)      | 210 mg/kg |\n+-------------------------+---------+\n| Glucosamine* (min)      | 743 mg/kg |\n+-------------------------+---------+\n| Chondroitin sulfate* (min) | 8 mg/kg |\n+-------------------------+---------+\n*Not recognized as an essential nutrient by the AAFCO Dog Food Nutrient Profiles.\n\n**CALORIE CONTENT**\nThis diet contains 3763 kilocalories of metabolizable energy (ME) per kilogram or 361 kilocalories ME per cup on an as fed basis (calculated).\n\n**EXCLUSIVE KIBBLE: SPECIAL BRACHYCEPHALIC JAW**\nWith a short muzzle, Boxers are a good example of a brachycephalic breed. Royal Canin Boxer Puppy kibbles are designed with an exclusive shape and size to make it easy for the Boxer puppy to pick up and chew.\n\n**INGREDIENTS**\nChicken by-product meal, brewers rice, oat groats, brown rice, chicken fat, wheat gluten, pork meal, natural flavors, dried plain beet pulp, fish oil, pea fiber, vegetable oil, coconut oil, sodium silico aluminate, potassium chloride, monocalcium phosphate, calcium carbonate, psyllium seed husk, fructooligosaccharides, sodium tripolyphosphate, vitamins [DL-alpha tocopherol acetate (source of vitamin E), niacin supplement, L-ascorbyl-2-polyphosphate (source of vitamin C), D-calcium pantothenate, biotin, pyridoxine hydrochloride (vitamin B6), riboflavin supplement, thiamine mononitrate (vitamin B1), vitamin A acetate, folic acid, vitamin B12 supplement, vitamin D3 supplement], hydrolyzed yeast (source of betaglucans), salt, DL-methionine, L-lysine, choline chloride, glucosamine hydrochloride, marigold extract (Tagetes erecta L.), taurine, trace minerals [zinc proteinate, zinc oxide, manganese proteinate, ferrous sulfate, manganous oxide, copper sulfate, calcium iodate, sodium selenite, copper proteinate], L-carnitine, Yucca schidigera extract, chondroitin sulfate, carotene, rosemary extract, preserved with mixed tocopherols and citric acid.\n\n**RECOMMENDED DAILY FEEDING PORTION**\n\n| Age of Puppy in Months | Target Adult Dog Weight | 57 lb (26 kg) | 70 lb (32 kg) | 79 lb (36 kg) |\n|---|---|---|---|---|\n|  |  | cups | grams | cups | grams | cups | grams |\n| 2 |  | 2+5/8 | 254 | 2+3/4 | 267 | 2+7/8 | 276 |\n| 3 |  | 3+1/4 | 313 | 3+1/2 | 338 | 3+3/4 | 354 |\n| 4 |  | 3+1/2 | 340 | 3+7/8 | 369 | 4 | 388 |\n| 6 |  | 4 | 388 | 4+3/4 | 453 | 5+1/8 | 494 |\n| 7 |  | 4+1/8 | 402 | 4+7/8 | 471 | 5+3/8 | 515 |\n| 8 |  | 4 | 388 | 4+3/4 | 456 | 5+1/4 | 502 |\n| 10 |  | 3+5/8 | 354 | 4+3/8 | 416 | 4+7/8 | 468 |\n| 12 |  | 3+3/8 | 320 | 3+7/8 | 375 | 4+1/4 | 412 |\n| 14 |  | 3+1/4 | 317 | 3+7/8 | 371 | 4+1/4 | 405 |\n| 15 |  |  |  | BOXER ADULT dry dog food |  |  |\n\n1 cup = 8 fluid ounces = 96 grams\nThis is only a guide. Optimal feeding amounts may vary according to your dog's temperament, activity level and environment. If you have any questions regarding your pet's health, please contact your veterinarian.\n\nBREED HEALTH NUTRITION\u00ae BOXER PUPPY is formulated to meet the nutritional levels established by the AAFCO Dog Food Nutrient Profiles for growth including growth of large size dogs (70 lb. or more as an adult)."
