      "contents": "## Royal Canin Cavalier King Charles Puppy\n\nFor Cavalier King Charles Spaniel puppies up to 10 months old\n\n**Immune System Support**\nAs puppies grow, they will experience big changes and new discoveries. During this key period, the puppy's immune system develops gradually. Royal Canin Cavalier King Charles Puppy helps support your puppy's natural defenses with an exclusive complex of antioxidants including vitamin E.\n\n**Cardiac Tone**\nRoyal Canin Cavalier King Charles Puppy contains the nutrients necessary to help support optimal cardiac health with EPA & DHA, taurine, L-carnitine, antioxidants and a precisely balanced mineral content.\n\n**Digestive Health**\nFormulated with high quality protein (L.I.P.*) and prebiotics to support digestive health and a balanced intestinal flora, contributing to optimal stool quality.\n*Protein selected for its very high digestibility.\n\n**Exclusive Kibble**\nThe Cavalier King Charles Spaniel has a slightly tapered muzzle with teeth that meet in a scissors bite. The size, shape and texture of the kibble is designed to be easy for Cavalier King Charles Spaniels to pick up and chew.\n\n**Ingredients**\nChicken by-product meal, brewers rice, corn, wheat gluten, chicken fat, dried plain beet pulp, corn gluten meal, natural flavors, fish oil, monocalcium phosphate, vegetable oil, sodium silico aluminate, calcium carbonate, potassium chloride, L-lysine, fructooligosaccharides, salt, sodium tripolyphosphate, vitamins [DL-alpha tocopherol acetate (source of vitamin E), niacin supplement, L-ascorbyl-2-polyphosphate (source of vitamin C), D-calcium pantothenate, biotin, pyridoxine hydrochloride (vitamin B6), riboflavin supplement, thiamine mononitrate (vitamin B1), vitamin A acetate, folic acid, vitamin B12 supplement, vitamin D3 supplement], hydrolyzed yeast (source of betaglucans), DL-methionine, choline chloride, magnesium oxide, taurine, L-tyrosine, L-arginine, trace minerals [zinc proteinate, zinc oxide, manganese proteinate, ferrous sulfate, manganous oxide, copper sulfate, calcium iodate, sodium selenite, copper proteinate], marigold extract (Tagetes erecta L.), L-carnitine, Yucca schidigera extract, carotene, rosemary extract, preserved with mixed tocopherols and citric acid.\n\n**Guaranteed Analysis**\n| Nutrient                     | Value  |\n|------------------------------|--------|\n| Crude Protein (min)          | 28.0%  |\n| Crude Fat (min)              | 16.0%  |\n| Crude Fiber (max)            | 3.7%   |\n| Moisture (max)               | 10.0%  |\n| Eicosapentaenoic acid (EPA) (min) | 0.17%  |\n| Docosahexaenoic acid (DHA) (min) | 0.07%  |\n| Vitamin E (min)              | 420 IU/kg |\n| Taurine* (min)               | 0.14%  |\n| L-carnitine*                 | 280 mg/kg |\n\n*Not recognized as an essential nutrient by the AAFCO Dog Food Nutrient Profiles.\n\n**Calorie Content**\nThis diet contains 3756 kilocalories of metabolizable energy (ME) per kilogram or 368 kilocalories ME per cup on an as fed basis (calculated).\n\n**Recommended Daily Feeding Portion**\n\n| Age of Puppy in Months | 11 lb (5 kg) | 15 lb (7 kg) | 18 lb (8 kg) |\n|-----------------------|-------------|-------------|-------------|\n|                       | cups | grams | cups | grams | cups | grams |\n| 2                     | 1 | 95 | 1+1/8 | 115 | 1+1/4 | 127 |\n| 3                     | 1+1/8 | 108 | 1+3/8 | 136 | 1+1/2 | 149 |\n| 4                     | 1+1/8 | 112 | 1+1/2 | 144 | 1+5/8 | 158 |\n| 5                     | 1+1/8 | 113 | 1+1/2 | 145 | 1+5/8 | 160 |\n| 6                     | 1 | 102 | 1+1/2 | 144 | 1+5/8 | 159 |\n| 7                     | 7/8 | 92 | 1+3/8 | 130 | 1+1/2 | 144 |\n| 8                     | 7/8 | 81 | 1+1/4 | 117 | 1+1/4 | 129 |\n| 9                     | 7/8 | 81 | 1 | 104 | 1+1/8 | 115 |\n| 10                    |        |     |       |      |        |     |\n\n1 cup = 8 fluid ounces = 98 grams\n\nRoyal Canin Cavalier King Charles Adult dry dog food\n\nThis is only a guide. Optimal feeding amounts may vary according to your dog's temperament, activity level and environment. If you have any questions regarding your pet's health, please contact your veterinarian.\n\nBREED HEALTH NUTRITION\u00ae Royal Canin Cavalier King Charles Puppy is formulated to meet the nutritional levels established by the AAFCO Dog Food Nutrient Profiles for growth including growth of large size dogs (70 lb. or more as an adult)."
